(3, 'Introduction to Customer Service', '<p>Providing excellent customer service is essential to the long term viability of every business. This free online Diploma course introduces the fundamental elements of customer service and explains how they can be applied in any organization. Following this, it describes how a business can develop its customer service program to the highest level. This course also details the role of customer service in the hospitality industry, the retail industry and the public sector. These sections explain the elements of customer service that should be focused on in these sectors. This free online Diploma course is ideal for business managers, business owners and entrepreneurs who wish to learn how to implement an effective customer service program in their organization. This course will also be of great interest to retail staff, hospitality workers and public servants who want to become more proficient at providing friendly and effective customer service.Â </p> <p>Course is accessible on:Â https://alison.com/topic/learn/2321/32626/introduction-to-customer-service/introduction-to-customer-service</p> <p>Â </p>', '01/10/2014', '31/05/2016', 170, 2000, '0.00', 'Online', 'N/A', 'Y', '', 'Y'),
(23, 'General Education and Training Certificate:NQF 1', '<p><strong>General Education and Training Certificate:</strong></p>\r\n<p><strong>Business Practice (Level 1)</strong></p>\r\n<p><strong>Qualification code: 61755 / Learnership Registration No: 23Q230071391211</strong></p>\r\n<p>This General Education and Training Certificate: Business Practice is for utilisiation by all members of the population.</p>\r\n<p>Anyone preapring to become employed, or self-employed, in any business whatsoever would be the person most likely to be attracted to this qualification. In fact many newly (or not-so-newly)&nbsp;appointed personel, or struggling entrepreneurs, could benefit from part or all of this&nbsp;qualilfication.</p>\r\n<p>&nbsp;</p>', '27/01/2014', '27/01/2015', 47, 8, '0', 'Cape Town', 'Western Cape', 'Y', 'N', 'Y'),
(24, 'National Certifcate: Wholesale and Retail Operations (Level 2) ', '<p>National Certificate: Wholesale and Retail Operations (Level 2)</p>\r\n<p>The National Certificate: Wholesale and Retail Operations, addresses skills and comptencies for enabling entry-level employment and positions. The&nbsp;qualifying learner will access opportunities for further development and training in the specialised areas of Wholesale and Retail such as: Operations, Administration , Merchanding, Stock control, Customer service, Visual display merchandising and Help desk operations.</p>\r\n<p>Qualification Code: 58206/Learnership Registration No: 27Q270014551202&nbsp;&nbsp;&nbsp;</p>', '27/01/2014', '27/01/2015', 47, 20, '0', 'Cape Town', 'Western Cape', 'Y', 'N', 'Y'),
(25, 'Assessor Training NQF 5 ', '<p>Assessor are in great demand in the training and development field, either working for large companies or as consultants. This course focuses on giving you the necessary knowledge and skills in conducting outcomes-based assessments in line with your area of expertise.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: National Certificate Occupationally Directed&nbsp;Education Training and Development Practices (NQF 5)&nbsp;&nbsp;</p>', '13/11/2013', '15/11/2013', 47, 20, '0', 'Cape Town', 'Western Cape', 'Y', 'N', 'Y'),
(26, 'Moderator NQF 6', '<p>It is the responsibility of the Moderator to moderate assessments according to relevant outcome statements and quality assurance requirements. The responsibility of the&nbsp;Moderator is significant and they need to meet a high standard of criteria and have to be registered&nbsp;before they are allowed to moderate. this practical course will equip learners with the knowledge and skills to conduct moderation of outcome-based assessment.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: national Certificate: Occupationally Directed Education Training and Development Practices (NQF&nbsp;5)&nbsp;&nbsp;&nbsp;&nbsp;</p>', '06/11/2013', '07/11/2013', 47, 20, '0', 'Cape Town', 'Western Cape', 'Y', 'N', 'Y'),
(27, 'Facilitating Learning (TtT) NQF L5', '<p>Completing this unit standard will provide recognition for ehose who facilitate or intend to facilitate learning using a variety of given methodologies. Formal recognition will enhance thier employability and also provide a means to identify competent learning facilitators.&nbsp;</p>', '09/12/2013', '11/12/2013', 47, 20, '0', 'Cape Town', 'Western Cape', 'Y', 'N', 'Y'),
