(70, 'Computer Training', '<p>Microsoft Office Foundation</p>\r\n<p>Microsoft Office Intermediate</p>\r\n<p>Microsoft Office&nbsp; Advanced -</p>\r\n<p>See more at: http://ifundi.co.za/content/short-courses#sthash.c0EbtFU2.dpuf</p>', '01/01/2014', '01/01/2014', 55, 25, '0', 'Johannesburg and Cape Town', 'N/A', 'N', 'N', 'Y'),
(71, 'Customer Interactions', '<p>Call Center Training - Sales and Customer Service Training for Call Center Agents</p>\r\n<p>CRM - An Introduction to Customer Relationship Management</p>\r\n<p>Customer Service - What Sets You Apart</p>\r\n<p>Customer Service and Communication Skills</p>\r\n<p>Debt Collection Email Writing Skills for Customer Interactions</p>\r\n<p>Making and Receiving Calls</p>\r\n<p>Making Target Telemarketing -</p>\r\n<p>Using the Telephone as a Sales Tool Telephone Etiquette -</p>\r\n<p>See more at: http://ifundi.co.za/content/short-courses#sthash.c0EbtFU2.dpuf</p>', '01/01/2014', '01/01/2014', 55, 25, '0', 'Johannesburg and Cape Town', 'N/A', 'N', 'N', 'Y'),
(72, 'Personal Mastery', '<p>Anger Management - Understanding Anger</p>\r\n<p>Building Your Self Esteem and Assertiveness Skills</p>\r\n<p>Conflict Resolution - A One Day Primer</p>\r\n<p>Conflict Resolution - Dealing with Difficult People</p>\r\n<p>Emotional Intelligence (Three Days)</p>\r\n<p>NLP Tools for Real Life</p>\r\n<p>Personal Mastery - The Foundation of Success</p>\r\n<p>Stress Management</p>\r\n<p>Stress Relief and Stress Reduction - A One Day Primer -</p>\r\n<p>See more at: http://ifundi.co.za/content/short-courses#sthash.c0EbtFU2.dpuf</p>', '01/01/2014', '01/01/2014', 55, 25, '0', 'Johannesburg and Cape Town', 'N/A', 'N', 'N', 'Y'),
(73, 'eWorld of Work ', '<p>Accent Neutralisation Business Ethics for the Office</p>\r\n<p>Business Etiquette - Gaining That Extra Edge</p>\r\n<p>Communications in the Workplace</p>\r\n<p>Creating a Dynamite Job Portfolio</p>\r\n<p>Entering the World of Work</p>\r\n<p>Getting Your Job Search Started</p>\r\n<p>Mastering the Interview Teamwork -</p>\r\n<p>See more at: http://ifundi.co.za/content/short-courses#sthash.c0EbtFU2.dpuf</p>', '01/01/2014', '01/01/2014', 55, 25, '0', 'Johannesburg and Cape Town', 'N/A', 'N', 'N', 'Y'),
(74, 'Learning ', '<p>Advanced Skills for the Practical Trainer</p>\r\n<p>Become an Assessor</p>\r\n<p>Developing Your Training Program</p>\r\n<p>Facilitation Skills</p>\r\n<p>Make Training Fun</p>\r\n<p>&nbsp;</p>\r\n<p>The Practical Trainer</p>\r\n<p>Train-the-Trainer - Inspire, Motivate and Educate - A One Day Primer&nbsp;&nbsp; -</p>\r\n<p>See more at: http://ifundi.co.za/content/short-courses#sthash.c0EbtFU2.dpuf</p>', '01/01/2014', '01/01/2014', 55, 25, '0', 'Johannesburg and Cape Town', 'N/A', 'N', 'N', 'Y'),
(75, 'Sensory Intelligence for Call Centre Executives', '<p><b>Management is better equipped to lead with success through:</b></p> <p>1) Increased awareness of self and others to accurately measure and manage staff behaviour. 2) Optimised team cohesion through higher levels of engagement. 3) Enhanced insight into creating working conditions conducive to productivity</p> <p>Â </p> <p>PLEASE NOTE :</p> <p>Courses are customised for every client and costing is calculated based on every client''s specific needs & requirements. </p>', '01/15/2014', '12/05/2014', 85, 25, '0', '', 'N/A', 'Y', 'N', 'Y'),
(76, 'Sensory Intelligence for Call Centre Team Leaders', '<p><b>Team leaders learn how to engage, manage and motivate call centre staff successfully, through: 1)Â </b>Being observant and focused on managing their people best. 2) Using brain strategies to optimise concentration, energy and performance levels. 3) Developing postitive working habits to minimise stress and increase wellness. 4) Creating a positive and successful work milieu where agents and business thrive</p> <p>PLEASE NOTE:</p> <p>Courses are customised for every client and costing is calculated based on every client''s requirements.</p>', '01/15/2014', '12/05/2014', 85, 25, '0', '', 'N/A', 'Y', 'N', 'Y'),
(77, 'Stress Management for Call Centre Agents', '<p><b>Practical and sustainable self-regulation strategies for agents, based on neuroscience principles, to cope with stress:</b></p> <p>1) Identify stress and become more self-aware. 2) Tips and tools to de-stress throughout the day. 3) Empower staff to take ownership of controlling their stress levels</p> <p>** Courses are customised for every client, so costing is calculated based on every client''s specific needs and requirements.</p>', '15/01/2014', '12/05/2014', 85, 30, '0', '', 'N/A', 'Y', 'N', 'Y'),
(78, 'General Education & Training Practice NQF 1 (L/Reg: 23Q230071391211) ', '<p>This General Education and Training Certificate: Business Practice is for utilisation by all members of the population. Anyone preparing to become employed, or self-employed, in any business whatsoever would be the person most likely to attracted to this qualification. In fact many newly (or not-so-newly) appointed personnel, or struggling entrepreneurs, could benefit from part or all of this qualification. &nbsp;&nbsp;&nbsp;&nbsp;</p>', '2014', '2015', 47, -96, '14000', 'Cape Town', 'N/A', 'N', '', ''),
(79, 'National Certificate: Contact Centre Support NQF 2', '<p>The Contact Centre Support Certificate Programme is aimed at any staff who to be involved in a contact centre environment, or staff who deal with internal and/or external customers and who will benefit from contact centre support skills.</p> <p>Qualification Code: 71490/ Learnership Registration No: 23Q23008920182Â </p>', '27/01/2014', '26/01/2015', 47, 20, '16000', 'Cape Town', 'N/A', 'N', 'N', 'Y'),
(80, 'National Certificate: Community House Building NQF 2', '<p>The certificate programme is aimed at provide learners as well as providers of education and training with national standards that represent the competencies required to meet the challenge of participating affectively in the building construction industry as a multi-skilled practitioner</p> <p>Qualification Code: 24273 /Learnership Registration No: 05Q050032221223</p>', '27/01/2014', '26/01/2015', 47, 20, '16000', 'Cape Town', 'N/A', 'N', 'N', 'Y'),
(81, 'National Certificate: Wholesale and Retail Operations NQF 3', '<p>This qualification provides a planned combination of learning outcomes that willÂ qualify learners with the knowledge and applied competence in wholesale and retail operations and a basis for further learning. This qualification will serve to provide the wholesale and retail sector with personnel that can perform the operation functions to industry standards, optimise productivity and improve service levels. The qualifying learner will undergo personal development that will contribute to social and economic development</p> <p>Qualification Code: 63409 / Learnership Registration No: 27Q270012551203</p> <p> </p>', '27/01/2014', '26/01/2015', 47, 20, '18000', 'Cape Town', 'N/A', 'N', 'N', 'Y'),
(82, 'National Certificate: Business Administration Services NQF 3', '<p>This qualification is for anyone who is or wishes to be, involved in the Administration function in any organisation or business in any sector, or field as well as non-commercial organisation such as clubsÂ and charitable organisations. It contains all the competencies, skills and values required by the learner who wishes to access the National Certificate in Business Administration Services at NQF level4</p> <p>Qualification Code: 67465/ Learnership Registration No: 23Q230026461303 </p>', '27/01/2014', '27/01/2015', 47, 20, '22000', 'Cape Town', 'N/A', 'N', 'N', 'Y'),
(83, 'Team Leader Programme ', '<p>High Performance Team Leader Programme coveringÂ the followingÂ modules:</p> <p>1. The Operating Environment and Context</p> <p>2. Team Leadership and Change Management</p> <p>3. Processes, measures, performance goals and objectives</p> <p>4. Quality Assurnance and coaching</p> <p>5. Performance Management</p> <p>6. Management information and systems</p> <p>7. Problem solving</p> <p>8. Pracitcal solutions for operational problems</p> <p>9. Prioritisation</p> <p>10. Project Planning</p> <p>11. Communication</p> <p>Â </p> <p>Â </p> <p>Â </p>', '01/01/2014', '01/01/2014', 63, 16, '35 000.00', '', 'N/A', 'Y', 'N', 'Y'),
(84, 'Agent TRaining for Collections', '<p>Five day training for Collections Agents</p>', '01/012014', '31/12/2014', 63, 21, 'R8,500.00', 'Johannesburg, Cape Twon, Durban', 'N/A', 'N', 'N', 'Y'),
(85, 'Customer Service Skills', '<p>NQF 4 (US 457852)</p> <p>Learning Outcomes:</p> Outcome 1 Outcome 2 Outcome 3', '09/12/2013', '09/12/2013', 71, 12, '800', 'Cape Town', 'N/A', 'Y', 'N', 'Y'),
(86, 'Getting Things Done', '<p>South Africa is a country that is made up of many different cultures, races and people with different backgrounds and this causes conflict in organisations daily. Conflict arises when there are values clashes and people behave in ways that we don''t always understand. The course discusses how we are socialised, how our values are created and how our cultural background triggers the way that we behave. We touch on stereotypes, bias and prejudice and discuss strategies on how to develop cultural empathy for people who are not from the same cultural group as we are. The course also focuses on the legal obligation of companies and how to instil respect for all in the workplace â€“ to enhance harmony and co-operation.</p>', '01/01/2014', '01/01/2014', 74, 1, '700.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(87, 'HIV In a Work Place ', '<p>Despite all the information that is available on the topic of HIV, employees are still remarkably ignorant when it comes to their basic rights around HIV, their status in the workplace if they contract the disease, how to treat others who are infected, what to do to avoid contracting HIV and how to manage their health. Our course is designed as a short introduction to all of these topics â€“ to inform employees of their basic rights, a simple approach to health management and how to protect the dignity of others in the workplace, who may be suspected of being HIV positive. The course also outlines what the Code of Good Practice says and gives an outline of good HIV strategies and policies in the workplace.</p>', '01/01/2014', '01/01/2014', 74, 1, '250.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(88, 'Cultural Sensitivity', '<p>South Africa is a country that is made up of many different cultures, races and people with different backgrounds and this causes conflict in organisations daily. Conflict arises when there are values clashes and people behave in ways that we don''t always understand. The course discusses how we are socialised, how our values are created and how our cultural background triggers the way that we behave. We touch on stereotypes, bias and prejudice and discuss strategies on how to develop cultural empathy for people who are not from the same cultural group as we are. The course also focuses on the legal obligation of companies and how to instil respect for all in the workplace â€“ to enhance harmony and co-operation.</p>', '01/01/2014', '01/01/2014', 74, 1, '250.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(89, 'Sexual Harassment ', '<p>This course is a guideline to staff on what constitutes Harassment and Bullying in the workplace, with a focus on Sexual Harassment. Every employee is entitled to come to work, expecting not to be bullied and harassed by colleagues and superiors. This course provides an explanation of what constitutes harassment and bullying, what the definition of Sexual Harassment is and what the Code of Good Practice says about the topic. The course also covers what employees can do if they are harassed, how to recognise it and how to raise it correctly to have it resolved.</p>', '01/01/2014', '01/01/2014', 74, 1, '250.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(90, 'General Employment Equity ', '<p>Annually, all companies with 150 or more employees need to submit their reports in terms of the Employment Equity Act. Companies with fewer than 150 employees, yet more than 50, have to report every even numbered year.</p> <p>These reports, sent to the Director General of Employment Equity, need to show that they have complied with the provisions of the Act including training their staff on the act and their rights in terms of the act. Should companies be found non-compliant by an inspector or the Department of Labour they could face a fine of R500 000 or more.In this course, subject matter expert, Marleen Potgieter covers the act and regulations, the role and responsibilities of the forum and the concepts of unfair discrimination and affirmative action. The course includes videos, activities and a final assessment.</p> <p>Â </p>', '01/01/2014', '01/01/2014', 74, 1, '250.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(91, 'Treating Customers Fairly ', '<p>The Training Room Online has developed a generic Treating Customers Fairly (TCF) Awareness course which is available to our clients for off-the-shelf purchase.Â The concept of TCF, in its entirety, is very reflective and the aim of the e-learning course is to provide TCF awareness to learners. The learners will then need to relate this to their own working environment once they complete the course.Â The content is centred around the 6 TCF outcomes and we have used video role plays, presenter-led theory, expert answers and case studies as tools for the learner to explore each of these.</p>', '01/01/2014', '01/01/2014', 74, 1, '590.00', 'Online ', 'N/A', 'N', 'N', 'Y'),
(92, 'FAIS', '<p>The Financial Advisory Intermediary Service Act of 2002 was introduced to protect consumers in relation to financial services as well as professionalise the financial services industry.Â This course will demonstrate the goals of the act and the tools used by the regulator. It looks at financial products and services, who is allowed to sell and advise on those, and explains the conditions and processes that must be adhered to. Each module has a short video and a short assessment.</p> <p>Â </p>', '01/01/2014', '01/01/2014', 74, 1, '590.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(93, 'FICA', '<p>The Financial Intelligence Centre Act 38 of 2002 was introduced to help combat money laundering and financial crime. The act sets out a number of requirements for accountable institutions in terms of record keeping, disclosures and reporting to help accomplish this. Accountable institutions include attorneys, estate agents, banks, long term insurers, those dealing in foreign exchange or investment advice, and trust companies.</p> <p>This course explains the purpose and requirements of the act, the consequences of non-compliance, the record keeping function prescribed within the act, and explains how to report suspicious transactions.</p> <p>The course includes videos to help bring the material to life and increase learner''s retention of key information. Learner''s results are recorded to aid organisations in keeping records of theÂ training completed.</p> <p>Â </p>', '01/01/2014', '01/01/2014', 74, 1, '590.00', 'Online', 'N/A', 'N', 'N', 'Y'),
(94, 'test course', '<p>test</p>', '03/12/2013', '25/12/2013', 2, 25, '2000', 'Cape town', 'N/A', 'N', 'N', 'Y'),
(95, 'Test course', '<p>I am a test course "Hello".</p>', '03/12/2013', '31/12/2013', 2, 1, '2500', '', 'N/A', 'N', 'N', 'Y'),
(96, 'Collections Academy', '<p>Debt Collection is an important issue for a number of institutions ranging from banking, wholesale and retail to medical to name a few. After all, without ensuring institutions receive the money owed to them they may not be able to remain in business and enjoy success. Indeed, your instittution may be among those focussing keenly on how to ensure your debtors pay up within the agreed timeframes. Becasue of the difficult economic conditions, a greater number of debtors are settling up their debts late and, in some cases, are not paying up at all. The debt collections industry is not only to collect outstanding moneys but rehabilitate bad debtors.</p> <p><b>Why attend this learning programme?</b></p> <p>This skills programme is a highly pratical learning programme which will help equip learners with the required insight and skill to successfully apply the knowledge and skill required to collect debt as well as work as part of a team in a contct centre while interfacing with the client.</p> <p>The experiential programme has been desinged to give learners the opportunity to practise the required skills and harness the learning during training in a safe environment before implementing the skills in the workplace. Our experienced facilitators provide practical hints and tips, and share lessons gained during facilitating.</p> <p><b>Who should attend?</b></p> <p>This programme is aimed at junior and emerging debt collectors working in a contact centre for a variety of industries.</p> <p><b>Is the programme accredited?</b></p> <p>IQ Business is an accredited training provider with Bank SETA. (Bank SETA - 557086). The skills programme is aligned to unit standards and upon successful completion of the learning programme, learners will have completed the following unit standards:</p> <p>Cummunicate orally with relevant stakeholders in the reccovery of debt, ID 116606, Credit value 6 Instil in myself a personal Contact Centre culture, ID 13872, Credit value 4 Work as a member of a Contact Centre Team, ID 13874,Â Credit value 5 Gather and provide relevant information to contribute to contact centre problem solving, ID 13886, Credit value 5 Handle a range of customer complaints in Contact Centre, ID 13873, Credit value 4 Identify and respond to customer needs in a Contact Centre, ID 10348, Credit value 12 Handle a range of customer complaints, ID 252210, Credit value 4</p> <p><b>What is the credit value?</b></p> <p>The debt collections programme is a NQF level 4 and has a credit value of 40 credits.</p> <p><b>What is covered in this skills programme?</b></p> <p>The skills programme is divided into two interventions. The first three days will cover theory and skills required to be a debt collector and the second two days will be practical simulation.</p>', '13/01/2014', '15/12/2013', 73, 21, '9000', '', 'N/A', 'Y', 'N', 'Y');
INSERT INTO `courses` (`id`, `courseName`, `courseDetails`, `courseStartDate`, `courseEndDate`, `providerId`, `capacity`, `coursePrice`, `courseLocation`, `province`, `status`, `venueBooked`, `archived`) VALUES
(97, 'National Certificate: Generic Management', '<p>A person acquiring this qualification will be able to manage first line managers in an organisational entity. First line managers may include team leaders, supervisors, junior managers, section heads and foremen. The focus of this qualification is to enable learners to develop competence in a range of knowledge, skills, attitudes and values. The skills, knowledge and understanding demonstrated within this qualification are essential for the creation of a talent pool of experienced and effective middle managers that represents the demographics of the South African society</p> <p><b><strong>Why attend this learning programme?</b></strong></p> <p>This qualification is a highly practical learning programme which will equip learners with the required insight and skills to successfully manage and lead teams to meet organisational goals. The experiential programme has been designed to give learners the opportunity to practise the required skills and harness the learning during training in a safe environment before implementing the skills in the workplace. Our experienced facilitators provide practical hints and tips, share lessons gained during facilitating.</p> <p><b><strong>Who should attend?</b></p> <p><br />This programme is aimed at managers, senior team leaders, supervisors and section heads.</p>', '13/01/2014', '15/12/2014', 73, 16, '35 000.00', '', 'N/A', 'Y', 'N', 'Y'),
(98, 'Business Practice Level 1 - ID 61755', '<p>Minimum credits: 121</p> <p>GETC:Â Business Practice is aimed at anyone preparing to become employed, or self-employed, in any business whatsoever.Â In fact many newly (or not-so-newly) appointed personnel, or struggling entrepreneurs, could benefit from part or all of this qualification. It seeks to embed the six key literacies required by business organisations: Numeracy, Literacy, Entrepreneurial, Financial, Technological and Cognitive.Â </p> <p>The learner successfully completing this qualification will have gained the knowledge and ability to:Â </p> <p class="MsoNormal" style="margin-bottom: 0.0001pt;">Â· Use fundamental skills in a business environment.</p> <p class="MsoNormal" style="margin-bottom: 0.0001pt;">Â· Make appropriate use of Information and Communications Technology in an office setting.</p> <p>Â· Incorporate a range of life skills in an employment or self-employment situation. <br /> <br /> The learner will also develop some entrepreneurial and business knowledge coupled with correct business attitudes.</p> <p>Â </p> <p>Â </p>', '01/01/2014', '01/01/2014', 46, 20, '0', '', 'N/A', 'Y', 'N', 'Y'),
(99, 'NC: Contact Centre Support NQF2 - ID 71490', '<p>Minimum credits: 128</p> <p>This qualification is intended to enhance the provision of entry level service within the Contact Centre Industry.</p> <p>The Contact Centre National Certificate at NQF Level 2 will provide the broad knowledge and skills needed in the industry and to progress along a career path for learners who:</p> <p>Were previously disadvantaged orÂ who were unable to complete their schooling and were therefore denied access to Further Education and Training</p> <p>Have worked in a Contact Centre for many years but have no formal qualification for Contact Centre Support</p> <p>Wish to extend their range of skills and knowledge of the industry so that they can become competent workers in Contact Centres.</p>', '01/01/2014', '01/01/2014', 46, 20, '0', '', 'N/A', 'Y', 'N', 'Y'),
(100, 'NC: Contact Centre & Business Process Outsourcing Support NQF3 - ID 80566', '<p>Minimum credits: 124</p> <p>This qualification is intended for persons who already work as Contact Centre (CC) and/or BusinessÂ Process Outsourcing (BPO) agents or who wish to join the contact centre and/or Business ProcessÂ Outsourcing industry. The qualification will equip learners with the underpinning knowledge and skills toÂ be able to supply high quality customer service.</p> <p>On achieving this qualification the learner will be competent in:</p> <p>Â· Providing effective customer service in a contact centre and/or Business Process Outsourcing</p> <p>industry.</p> <p>Â· Using communication technology in a contact centre.</p> <p>Â· Capturing data to track interactions.</p> <p>Â· Working effectively as a team member in a group.</p> <p>This qualification is needed to empower entry level employees to deal effectively with the public and to make</p> <p>a meaningful, positive contribution to customer satisfaction and to the image of the organisation.</p>', '01/01/2014', '01/01/2014', 46, 20, '0', '', 'N/A', 'Y', 'N', 'Y'),
(101, 'FETC: Business Administration Services NQF4 - ID 61595 LP35928', '<p>Minimum credits: 140</p> <p>This Qualification is for any individual who is or wishes to be involved in the Administration function within any industry, or non-commercial venture/organization. It is also the building block to advance the learner into the National Certificate in Business Administration Services: NQF Level 5.</p> <p>The National Certificate in Business Administration Services: Level 4 is a generic Qualification which offers Administrative knowledge and skills to learners who:</p> <p>Have attained a NC in Business Administration Level 3and wish to continue on a path of life-long learning in administration</p> <p>Have worked in Administration for many years but have no formal qualification in their area of expertise</p> <p>Wish to extend their range of skills and knowledge of Administration so that they can become knowledge workers</p> <p>Â </p>', '01/01/2014', '01/01/2014', 46, 10, '0', '', 'N/A', 'Y', 'N', 'Y'),
(102, 'FETC: Contact Centre Operations NQF4 - ID 71489', '<p>Minimum credits: 132</p> <p>Learners working towards this qualification will find that the acquisition of competence in the unit standards, which make up the qualification, will add value to learner`s job. This qualification is intended to enhance the provision of entry level service within the Contact Centre Industry.</p> <p>The National Qualification in Contact Centre operations: Level 4 is designed to meet the needs of those learners want to progress and will assist those who make Contact Centre Operations their chosen career path, in the field of Contact Centres.</p> <p>The qualification focuses on the skills, knowledge, values and attitudes required to progress further within the Contact Centre industry.</p>', '01/01/2014', '01/01/2014', 46, 10, '0', '', 'N/A', 'Y', 'N', 'Y'),
(103, 'FETC: Generic Management NQF4 - ID 57712 LP 74630', '<p class="MsoNormal">Minimum credits: 150</p> <p class="MsoNormal">This qualification lays the foundation for the development of management qualifications across various sectors and industries. It specifically develops management competencies required by learners in any occupation, particularly those who are currently operating as junior managers.</p> <p class="MsoNormal">The qualification introduces key terms, rules, concepts, principles and practices of management that will enable learners to be informed managers in any occupation. It has also been developed to enable managers and prospective managers to access higher education and provide flexible access to life-long learning</p>', '01/01/2014', '01/01/2014', 46, 10, '0', '', 'N/A', 'Y', 'N', 'Y'),
(104, 'NC: Management NQF3 - ID 83946 LP 23654', '<p>Minimum credits: 120</p> <p>The National Certificate in Management: Level 3 is intended for personnel already employed and other learners who intend to follow a career in management. The unit standards classified as core may be added to other industry qualifications to provide a management focus and align qualifications to the work done by learners. Practical competence is within a number of contexts some of which may be non-routine. The focus is on comparison, choice, interpretation and application of knowledge.</p> <p>Qualifying learners are capable of:</p> <p>Carrying out simple research tasks</p> <p>Interpreting current affairs related to a specific business sector</p> <p>Applying knowledge of self and team to enhance team performance</p> <p>Maintaining records</p> <p>Managing time and the work process</p> <p>Management is an essential, key function of a business. The National Certificate in Management: Level 3 is designed to meet the needs of learners who require junior management skills in all sectors of the economy.</p> <p>Â </p>', '01/01/2014', '01/01/2014', 46, 20, '0', '', 'N/A', 'Y', 'N', 'Y'),
(105, 'Call Centre Success', '<p>Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify;">It is important for an organisation to have a professional and efficient call center running, as this is the frontline link with both existing and potential customers. This course is designed to equip the call center agent to handle a high volume of calls, respond quickly and accurately to customers'' needs and present a high level of professionalism at all times.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify;">You will be able to have:Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ The ability to provide quality service on every call.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ The expertise to accurately assess the type of customer on a call.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify;">Â </p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l1 level1 lfo2;">~ The talent to communicate effectively with customers.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l1 level1 lfo2;">~ A positive attitude that transmits to customers, co-workers, and managers.</p> <p>Â </p>', '15/04/2014', '16/04/2014', 48, 16, '3 250', 'Midrand', 'N/A', 'Y', 'N', 'Y'),
(106, 'Achieving Life Balance', '<p>Â </p> <p style="margin: 0cm 0cm 0pt;">Spending the amount of time on each aspect of your life according to how important that aspect is to you. The ideal life balance can only be determined by you because it is your values, goals, dreams and desires that will determine what will be most satisfactory to you.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify;">Upon completion of this course you will be able to:</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify;">Â </p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ Explore the meaning of life balance and in what ways your own life may not be balanced the way you would like.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ Explain goal setting and creating action plans to meet your goals.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ Help you discover your psychological drivers and reprogram them for more positive results.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ To present strategies for managing your time according to your values.</p> <p style="margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;">~ To demonstrate effective ways to manage your relationship with others.</p> <p style="margin: 0cm 0cm 0pt 35.45pt; text-indent: -35.45pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p>', '24/04/2014', '24/04/2014', 48, 16, ' 2,100', 'Midrand', 'N/A', 'Y', 'N', 'Y'),
(107, 'Contact Centre Support NQF 2', '<p> <b></p> <p style="margin: 0cm 0cm 0pt;"><strong>Contact Centre career opportunities are growing rapidly in South Africa. The availability of talent at the Agent level has been identified as critical for the Contact Centre Sector. </b></p> <p> <b></p> <p style="margin: 0cm 0cm 0pt;"><strong>Any individual who plans to pursue a career in the Contact Centre Sector, need to start with this qualification. It also serves as the entry qualification into Contact Centre operations and management. </b></p> <p> <b></p> <p style="margin: 0cm 0cm 0pt;"><strong>Â </b></p> <p> <b></p> <p style="margin: 0cm 0cm 0pt;"><strong>The qualification aims to provide learners with the following skills: </b></p> <p> <b></p> <p><strong>Instill themselves into a Contact Centre culture.</b></p> <p> <b></p> <p style="color: #000000; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><strong>Work as a member of a Contact Centre team.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Contribute to a diverse working environment.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Provide information to customers in a Contact Centre.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Handle a range of customer complaints in a Contact Centre.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Identify and respond to customer needs in a Contact Centre.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Collect and record information, queries and requests from a customer.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Gather and provide relevant information to contribute to project problem solving.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Meet performance standards within a Contact Centre.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Â Input data received onto appropriate packages in a Contact Centre.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Â Apply in-bound and out-bound Contact Centre operations in a commercial environment.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Â Mathematical fundamentals.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Â Communication fundamentals.</b></p> <p> <b></p> <p style="margin: 0cm 0cm 0pt 36pt; text-align: justify; mso-pagination: none;"><strong>Â </b></p> <p> <b></p> <p style="margin: 0cm 0cm 0pt 36pt;"><strong>To ensure the learner is well equipped to enter into the workplace Bytes People Solutions incorporates the following additional activities into the programme to ensure successful placement: </b></p> <p> <b></p> <p style="color: #000000; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><strong>Basic computer skills to ensure smooth transition into the working environment.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Additional English development.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>Workplace readiness programme.</b></p> <p style="color: #000000; font-family: ''Times New Roman'',''serif''; font-size: 12pt; font-style: normal; font-weight: normal; mso-list: l0 level1 lfo1;"><b>In-depth understanding of the working environment they will enter.</b></p> <p> <br /></p>', '22/04/2014', '25/07/2014', 48, 20, '0', 'Midrand', 'N/A', 'Y', 'N', 'Y'),
(108, 'Contact Centre and Business Process Outsourcing Support', '<p>Â </p> <p style="margin: 0cm 0cm 0pt;"><b>Purpose of the qualification:</b> <b> <br style="mso-special-character: line-break;" /> </b></p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">This qualification is intended for individuals who already work as Contact Centre and / or Business Process Outsourcing Agents and who plans to continue to pursue a career in this sector.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â The qualification provides an introduction to Contact Centre and / or Business Process Outsourcing operations. The qualification will equip learners with the underpinning knowledge and skills to be able to supply high quality customer service.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;"><b>Rationale of the qualification: </b></p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Contact Centres have become key business tools - integral to the way organisations achieve their business objectives. Contact Centres are a high growth industry constantly in need of skilled people.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Learners will be provided with competencies to handle both inbound and outbound interactions, within different types of operations of Contact Centre and / or Business Process Outsourcing. The qualification develops skills in the use of various communication channels e.g. telephone, fax, email, internet, intranet, multifunction devices, webchat, SMS and letters. The qualification also develops skills in dealing with walk-in clients.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Qualified learners will be able to work in Contact Centre involving marketing, account management, sales, hospitality, tourism, emergency services, retail, telecommunications, financial services, credit control, etc.</p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;"><b>Â </b></p> <p>Â </p> <p style="margin: 0cm 0cm 0pt;"><b>On completion of the qualification learners will be able to: </b></p> <p>Â </p> <p style="color: #000000; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l0 level1 lfo1;">Provide effective customer service in a Contact Centre and / or Business Process Outsourcing Centre.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l0 level1 lfo1;">Demonstrate knowledge of and use communication technology in a Contact Centre environment.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l0 level1 lfo1;">Capture data to track interactions.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l0 level1 lfo1;">Work effectively as a team member in a group to enhance team performance.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;">Â </p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;">The qualification covers the foundational areas of the Contact Centre and / or Business Process Outsourcing agent''s role in the workplace.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;">Â </p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;"><b>Addition Learning:</b></p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;"><b>Â </b></p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt;">To ensure the learner is well equipped to enter into the workplace Bytes People Solutions incorporates the following additional activities into the programme to ensure successful placement:</p> <p>Â </p> <p style="color: #000000; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l1 level1 lfo2;">Additional English development.</p> <p style="color: #000000; font-family: ''Calibri'',''sans-serif''; font-size: 11pt; font-style: normal; font-weight: normal; margin-top: 0cm; margin-bottom: 0pt; mso-list: l1 level1 lfo2;">Workplace readiness programme.</p> <p>In-depth understanding of the working environment they will enter.</p>', '07/04/2014', '06/06/2014', 48, 20, '0', '', 'N/A', 'Y', 'N', 'Y'),
(109, 'Life Power - Communication Skills, Emotional Intelligence and Personal Mastery', '<p>Â <b>Programme Modules:</b></p> <p>1. Finding Your Voice</p> <p>2. Bridging the Generation Gap</p> <p>3. Understanding Personalities</p> <p>4. Living Your Brand</p> <p style="margin: 0cm 0cm 0pt;">Life Power is a life changing communication and self-leadership programme which uncovers and defines key elements of one-self, including spiritual and emotional intelligence, dominant personality, dominant intelligence and generational influence.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">We have found that intelligent and enlightened self-discovery is the most positive catalyst for change in a person and in an organisation. The way we communicate with people and lead others is a reflection of the way we view ourselves, our team, our company and the world around us.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Candidates who attend this programme will not only discover themselves in a new and exciting way, they will also discover their colleagues, customers and family in a profoundly new way; a way which empowers them to communicate with more confidence, more understanding, and more empathy.</p> <p>To improve their communication skills, candidates are trained to use our ground-breaking Life Power tools and exercises to profile themselves, their customers and their colleagues; for team managers and team leaders these tools are invaluable, providing vital information on team members for further development and coaching.</p> <p>NQF Level 5: 10 Credits</p> <p><b>"A mind-blowing experience! This course makes you analyse your purpose in both your personal and professional life." Prima Gramane, FNB Direct, Relationship Manager</b>Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Content is powerful, informative and enlightening. The enthusiastic manner in which it was presented lifted it to a higher dimension. It is essential that every staff member is exposed to this to improve their lives in every aspect." </b>Scarlett Elliot, Liberty Life, Customer Service Advisor</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>Â "It is brilliant training that will transform your life."</b> Yvonne Mtyobile, Telkom Direct, Sales Agent</p> <p>Â </p> <p>Â </p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(110, 'Coaching Your Team to Success', '<p><b>Programme Modules:</b>Â </p> <p>1. Becoming an Authentic Leader-Coach</p> <p>2. Action-Centred Coaching</p> <p>3. Building a 90 Day Coaching Plan</p> <p>4. Implementing a 90 Day Coaching Plan</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Coaching Your Team to Success is an accredited coaching skills programme designed for team leaders and managers who are responsible for the specific as well as overall behavioural performance of their colleagues or team members.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt;">Delegates will discover that coaching is more about describing behaviour (asking), rather than prescribing behaviour (telling), and that real coaching is about evoking responses so that the other person creates ideas in their own mind which accords with yours.Â </p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Delegates are taught key listening and questioning skills including learning how to read mind-body states and establishing the correct sensory contexts for high performance coaching.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Our key behavioural and performance specific coaching tools together with our progressive accredited learning methodology, ensures that candidates are empowered to evaluate and review a team member or colleague''s performance against specific criteria, run an effective goals-based coaching session, and deliver against a predetermined 90 day coaching plan.</p> <p>NQF Level 5: 8 Credits</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Was one of the best courses I have attended in my 31 years with Telkom!"</b> Faffa De Jager, Telkom Direct, Branch Manager</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Best course I have ever attended."</b> Wayne Reynecke, Telkom Direct, Branch Manager</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Outstanding facilitator! Really Brilliant!"</b> Gerald Ndlovu, SAICA, Training Manager</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(111, 'Effective Team Leadership', '<p><b>Programme Modules:</b>Â </p> <p>1. Becoming an Authentic Leader-Manager</p> <p>2. Action-Centred Leadership</p> <p>3. Managing Change Effectively</p> <p>4. Managing Conflict Effectively</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Effective Team Leadership is an advanced leader-manager skills programme which prepares candidates for challenging and complex team leadership challenges including; developing a high performance team, managing change and managing conflict effectively.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Candidates will discover that trust is the key currency in leadership today and that an inside-out approach to principle-centred leadership is fundamental to achieving sustainable success as a team leader, manager or executive.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Effective Team Leadership uncovers what high performance teams'' need; it also teaches candidates how to develop their teams in stages and how to prioritise their work based on leading the individual, leading the team and managing their tasks.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Candidates will learn how to recommend, implement and manage change on their teams and in their businesses more efficiently; they will also learn how to maintain productivity and positive energy on their teams, whilst dealing with resistance to change and managing conflict more effectively.</p> <p>NQF Level 5: 22 Credits</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"A new way of looking at our business; gives us a definite sense of direction; innovative and effective way of learning; very energising and powerful course." </b>Cheryl Bradshaw, Telkom Direct, Branch Manager</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt;"><b>"This course is excellent; it has given me: new hope for change in our business; empowered me to take charge; reminded me how important coaching and people management is; helped me to figure out what was missing on our team; given me structure to implement change more effectively."</b> Dave Pillay, Alexander Forbes, Call Centre Manager</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;"><b>"I really enjoyed the training. The facilitator is enthusiastic and really "lives" the training experience." </b>Estelle Webster, SAICA, PA to Executive President</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(112, 'Setting and Achieving Your Team Goals', '<p><b>Programme Modules</b>:</p> <p>1. Effective Time Management</p> <p>2. Setting Your Team Goals</p> <p>3. Effective Goal Planning</p> <p>4. Implementing Your Team Goals.</p> <p>Setting and Achieving Your Team Goals is an accredited skills programme which is designed to sharpen time management skills and improve team goal planning for team leaders, managers and executives.</p> <p>Candidates will discover simple, easy-to-use tools to manage their time in their life and work much more efficiently, including the work of their teams; they will also learn how to build goals for their teams based on their strategic business and performance development priorities.</p> <p>By breaking down their goals into specific and achievable tasks, candidates will learn how to build a comprehensive 90 day plan for their team which is specific, measurable, achievable and realistic; they will also learn how to run short term meetings which inspire, instruct and inform their team members.</p> <p>The measurable outcomes of the 90 day plan, which includes 2 high priority team goals, is always the goal of this programme, as is the momentum and precedent we set for candidates to re-invent and re-set their team goals every quarter.</p> <p>NQF Level 5: 12 Credits.</p> <p><b>"The training was invaluable and it will be excellent if all managers can attend this training. Thank you for your passion!"</b> Anne Alberts, Telkom Direct, Branch Manager.</p> <p><b>"This was one of the best SAICA courses I have attended. The facilitator is passionate about what he does and this is very evident. Thank you!"</b> Rene Naidoo, South African Institute of Chartered Accountants, Seminars and Events Manager.</p> <p><b>"Lots of work, time and energy invested. Well done."</b> Johan Vermeulen, Alexander Forbes, Head: New Business, Sales and Marketing.</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(113, 'CollectAbility', '<p><b>Programme Modules:</b>Â </p> <p>1. Finding Fortune on the Phone</p> <p>2. Match-Play for Results</p> <p>3. Turning Objections into Collections</p> <p>4. Collect the Money and Keep the Client</p> <p style="margin: 0cm 0cm 0pt;">CollectAbility is an accredited skills programme aligned to Unit Standard 80566: National Certificate in Contact Centre and BPO Support; the programme is designed for customer service agents, collections agents and team leaders who are primarily involved in the recovery of debt in the banking and financial services industry.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Candidates who attend this programme will discover key collections and customer service techniques which will transform the way they communicate with their customers and negotiate for payment of outstanding arrears.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">The programme is always customised to align with our client''s existing call performance scorecards, key performance indicators, and collections strategy, including applying different communication strategies for different levels of debt.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Candidates who attend this programme will learn how to sell their customer a reason to pay whilst retaining the customer as a valued client; when the CollectAbility tools and methods are applied in the collections call, agents collect with more care, they increase their number of promises to pay, they improve their payment conversion ratio, and they collect more cash.</p> <p>NQF Level 3: 10 Credits</p> <p>NQF Level 4: 6 Credits</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"His input is invaluable and the course of collections will forever changeâ€¦he caused a</b> <b>whole wave of change and re-awakened our potential to collect."</b> Advocate Geoffrey Kundu, Barclays Bank Kenya, Recovery Officer</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Richard''s energy and enthusiasm is excellent and infectious. He made the effort to research Kenya and Kenyans and that gained him immediate respect."</b> Marian Killu, Barclays Bank Kenya, Performance Manager</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;"><b>"Loved the energy; made me realise simple things that are really important. Very interactive!" </b>Tshoele Moloi, African Bank, Collections Agent</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(114, 'Dynamic Presentation Skills', '<p><b>Programme Modules:</b>Â </p> <p>1. Planning for a Dynamic Presentation Part 1</p> <p>2. Planning for a Dynamic Presentation Part 2</p> <p>3. Delivering a Dynamic Presentation Part 1</p> <p>4. Delivering a Dynamic Presentation Part 2</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Dynamic Presentation Skills is an accredited skills programme which provides candidates with the tools, methods and presentation skills to radically improve their ability to design a dynamic presentation and present their ideas to a group of people in a compelling and persuasive way.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Candidates will learn how to use mind-mapping to develop their ideas and define the purpose of their presentation; they will also learn how to plan and design a presentation for maximum effect using audio-visual aids including slide presentations and the use of flip-charts, whiteboards and other presentation tools.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Candidates will learn how to use key verbal and non-verbal communication techniques, including positive body language, voice intonation, and tone and pitch of voice; they will also learn how to deal with nervousness and present themselves confidently before an audience.</p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">Â </p> <p style="margin: 0cm 0cm 0pt; text-align: justify; -ms-text-justify: inter-ideograph;">We use video recording, amongst other instruments, to assess candidates at the beginning of the programme and at the end of the programme; these recordings, together with a quality assessment of their final presentation, provides candidates with clear and specific instructions to help them improve their planning and delivery of presentations in the workplace.</p> <p>NQF Level 4: 4 Credits</p> <p><b>Â "My best trainer so far! Very empowering, motivational and great content delivery!" </b>Arthur Simba, Barclays Bank Kenya, Learning and Development Manager</p> <p style="margin: 0cm 0cm 0pt;"><b>"Inspirational, energetic, knowledgeable and professional. Thank you!" </b>Averett Bawa, Alexander Forbes, Sales Representative</p> <p style="margin: 0cm 0cm 0pt;"><b>"Richard is one of the best trainers in the country. People are highly motivated when they leave the training." </b>Toniel Marais, Nedbank Home Loans, Team Leader</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(115, 'SHIFT High Performance Selling ', '<p><b>Programme Modules:</b>Â </p> <p>1. Finding Your Voice</p> <p>2. Selling to Personalities</p> <p>3. Living Your Brand</p> <p>4. Match-Play for Results</p> <p>5. Turning Objections Into Sales</p> <p>6. Closing the Deal & Keeping the Client</p> <p style="margin: 0cm 0cm 0pt;">SHIFT High Performance Selling is a life changing programme for any sales consultant or sales professional involved in face-to-face sales or sales consulting.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">SHIFT uncovers and defines key elements of one-self, including your emotional intelligence, dominant personality and dominant intelligence. We have found that intelligent and enlightened self-discovery is the most positive catalyst for change in a person and especially in a sales person. The way we sell our products and services is a reflection of the way we see ourselves, our customers and our company.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Candidates who attend this programme will not only discover themselves in a new and exciting way, they will also discover their customers in a profoundly new way, a way which empowers them to sell with more confidence, more understanding, and more empathy.</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">Based on the "What''s in it for me?" sales formula, candidates will discover that by asking intelligent questions they can learn how to unlock their customers'' needs, handle objections effectively and close the deal in a variety of effective ways to secure the sale and retain the client for future business..</p> <p>NQF Level 5: 9 Credits</p> <p style="margin: 0cm 0cm 0pt;"><b>"I found the course very useful and helpful. My day to day selling techniques will change <strong>drastically."</b></strong> Yvonne Pillay, Telkom Direct, Sales Agent</p> <p style="margin: 0cm 0cm 0pt;"><b>Â </b></p> <p style="margin: 0cm 0cm 0pt;"><b>"I feel that everyone in Telkom Direct needs this course as it is in direct line with our day to day jobs. The course has really made me realize how to be a better salesperson and in handling <strong>different types of clients."</b></strong> Kim Bagley, Telkom Direct, Sales Agent</p> <p style="margin: 0cm 0cm 0pt;">Â </p> <p style="margin: 0cm 0cm 0pt;"><b>"I have invested my time wisely for these 3 days'' workshop, very informative and inspiring. I learnt how to change problem customers into sales opportunities and I commit to implement <strong>the knowledge I have gained."</b></strong> David Duba, Telkom Direct, Branch Manager</p>', '01/01/2014', '01/01/2014', 92, 16, 'POA', '', 'N/A', 'Y', 'N', 'Y'),
(116, 'National Certificate: OD-ETDP (Level 5) ', '<p>Â </p> <p class="MsoNormal" style="margin: 12pt 0cm 3pt; line-height: 150%; page-break-after: avoid; mso-outline-level: 1;"><b>National Certificate: OD-ETDP (Level 5) </b></p> <p>Â </p> <p class="MsoNormal" style="margin: 12pt 0cm 3pt; line-height: 150%; page-break-after: avoid; mso-outline-level: 1;"><b><i>Enrol now: Start date May 2014</i></b></p> <p>Â </p> <p class="MsoNormal" style="margin: 12pt 0cm 3pt; line-height: 150%; page-break-after: avoid; mso-outline-level: 1;"><b>The OD-ETDP qualification is for those who want to build on a Further Education and Training Certificate from another field to potentially enter the field of (OD-ETDP) as a possible career, and had none or minimal exposure or experience to Education and Training Development (ETD). The qualification is advantageous to those practising within this specific field, without formal certification. The OD-ETDP National Certificate is beneficial for Assessors, Facilitators of Learning programmes, Learner and Learning supporters as well as Skills Development Facilitators.</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Cluster: Identifying Learning: Unit standards: 114924 123396</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Cluster: Evaluating Learning: Unit standards: 117865 117874 123397</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Cluster: Facilitating and Assessing Learning:</b> Unit standards: <b>117871 115753</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Cluster: Communicating: Unit standards: 115789 115790</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Elective Cluster: Moderator (Compulsory Elective):</b> <b>115759</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Elective Cluster: Skills Development Facilitator: Unit standards:</b><b>15218 15217 15232 15227</b> <b>15221 252041</b></p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: normal;"><b>Elective Cluster: Designing: Unit standards:</b> <b>123401 115755</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 6pt 0cm; line-height: 150%;"><b>Total Credits (Requirements): </b>Fundamental (10), Core (61), Electives (49) = TOTAL<b> (120)</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Target Audience</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%; text-indent: -1cm; mso-list: l0 level1 lfo2;"> <b>Target Audience:</b> Assessors, Facilitators of Learning Programmes, Skills Development Facilitators</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%; text-indent: -1cm; mso-list: l0 level1 lfo2;"> <b>Programme level:</b> The Level of the Programme is at NQF Level 5</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%; text-indent: -1cm; mso-list: l0 level1 lfo2;"> <b>Minimum Qualifying Criteria: </b> Communication at NQF Level 4 & Mathematical Literacy at NQF Level 3.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%;"><b><i>Note:</i></b><i> It is assumed that practitioners have expertise in the subject/occupation field in which they intend to provide education, training and development, at a level required to engage meaningfully in ETD within that field. It is also assumed that learners working towards this qualification hold a FETC or equivalent. </i></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Duration</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l3 level1 lfo1; tab-stops: 1.0cm;"> <b>Qualification Duration:</b> Qualification â€“ between one and three years. Learnership â€“ twelve months. Contact sessions - between nine (9) - twelve (12) months.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l3 level1 lfo1; tab-stops: 1.0cm;"> <b>Pre-Assessment:</b> Pre-assessment of proposed learners is undertaken to identify current qualifications and experience, and may result in reduced contact training sessions.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l3 level1 lfo1; tab-stops: 1.0cm;"> <b>Contact Training & Assessment Sessions: </b>Between 10 - 24 contact days (as per qualifying criteria).</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l3 level1 lfo1; tab-stops: 1.0cm;"> <b>Non-Contact Duration:</b> Learners will be required to invest the necessary additional hours per module on additional reading, on job practical assignments, and POE building, with the support of the supervisor and/or coach. A workplace log will be completed in this regard.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l3 level1 lfo1; tab-stops: 1.0cm;"> <b>NOTE:</b> A detailed project plan will be compiled to support business operations while meeting SETA requirements. </p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Accreditation </b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%; text-indent: -1cm; mso-list: l1 level1 lfo3; mso-layout-grid-align: none;"> Primeserv Corporate Solutions (Pty) Ltd Reg. No. 1997/008827/07 trading as Primeserv HR Solutions Provisionally registered with the Department of Higher Education and Training, Registration No. 2011/FEB07/064, as a Private FET College.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt 1cm; line-height: 150%; text-indent: -1cm; mso-list: l1 level1 lfo3;"> Training Provider Accreditation: Services SETA - No. 2194 / MOU ETDP Seta ETDPS1159</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Â </b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Training Methodology</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; text-align: justify; line-height: 150%;">The programme is facilitated by a competent subject matter specialist/s, who utilises the following techniques to ensure that the session is practical and experiential: Discussion; Role Plays; Exercises & Case Studies; Videos/DVDs; and Formative Assessments. </p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; text-align: justify; line-height: 150%;"><b>Â </b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; text-align: justify; line-height: 150%;"><b>To facilitate this process we offer:</b></p> <p>Â </p> <p class="MsoListParagraph" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l2 level1 lfo4;"> <b>Coaching Support:</b> The Primeserv appointed assessor and project co-ordinator are available to the learners for telephonic support and coaching while learners compile their POE''s. Additional coaching support will be scheduled, as required, to assist with the building of POE''s.</p> <p>Â </p> <p class="MsoListParagraph" style="margin: 0cm 0cm 0pt 1cm; text-align: justify; line-height: 150%; text-indent: -1cm; mso-list: l2 level1 lfo4;"> <b>Credits:</b> Learners exiting this qualification before completion, retain the credits for Unit Standards successfully completed. Learners can build their credits by attending skills programmes aligned to the Qualification.</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 0pt; line-height: 150%;"><b>Â </b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><b>Contact Person: Shaheda Davids or Tammy Alexander</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><b>Tel:021</b><b> 5283906/08</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><b>Cell: 083 2300413 / 083 2301307</b></p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;"><b>Email: shahedad@primeserv.co.za; tammya@primeserv.co.za</b></p> <p>Â </p>', '12/05/2014', '12/05/2015', 47, 15, '24000', 'Cape Town', 'N/A', 'Y', 'N', 'Y');
INSERT INTO `courses` (`id`, `courseName`, `courseDetails`, `courseStartDate`, `courseEndDate`, `providerId`, `capacity`, `coursePrice`, `courseLocation`, `province`, `status`, `venueBooked`, `archived`) VALUES
(117, 'Customer Service Serve to Lead Workshop', '<p>Customer First Academy offers affordable 1 day workshops. Our unique fun pact, interactive but robust <b>Serve to Lead</b> approach enables and prepares participants to deliver quality customer services within the work place and are designed to enable individuals within a customer service function to speak the neglected customer satisfaction language which we call <b>Customer Conscientiousness</b>. Our workshop takes participants on a journey to bridge the gap between perceived and expected service delivery.</p> <p><b>Course/Workshop outcomes: Customer FIRST</b></p> <p><b>F</b>ulfillment - Commit: Manage the expectation of the customer and exceed it</p> <p><b>I</b>nnovative - Out of the box: Anticipate and provide the service customers need</p> <p><b>R</b>elationship - Respect: Invest time and effort to understand customers needs</p> <p><b>S</b>erve - Handle with care: Understand the importance and impact of excellent customer service</p> <p><b>T</b>rust - Emotional Intelligence: build bridges through effective conflict management, and higher levels of self-understanding and motivation.</p> <p>Our workshop consist of 5 units and the duration is 6 hours (breaks included) which caters for 12 participants.</p>', '01/04/2014', '01/01/2015', 123, 12, '2250 p/ group', '', 'N/A', 'Y', 'N', 'Y'),
(118, 'English Accent Improvement ', '<p class="MsoNormal" style="margin-bottom: .0001pt;">The Accent Labs English Improvement Course is an e-learning course designed to dramatically improve the English Accents of trainees whose second or third language is English.</p> <p class="MsoNormal" style="margin-bottom: .0001pt;">The course is made up of four main sections â€“ an introduction with a self evaluation questionnaire, then the Vowel Sounds section, covering the 23 English vowel sounds, followed by sections covering consonants and syllables. Each section is split up into multiple subsections, each with a voice recording clearly illustrating the relevant sounds, and there are 107 exercises with recordings, which include quizzes and dialogues.</p> <p class="MsoNormal" style="margin-bottom: .0001pt;">The course is designed for easy revision and repeated practice, and there are built in reports and assessment options that allow the trainer to closely monitor and measure the progress of learners.</p> Learning Outcomes <p style="margin: 0px 0px 1em; padding: 0px;">1.Identify the short and long vowel sounds in English</p> <p style="margin: 0px 0px 1em; padding: 0px;">2. Develop an understanding of how to produce these sounds clearly</p> 3. Pronounce short and long vowel sounds clearly in words 4. Pronounce short and long vowel sounds clearly in sentences 5. Identify the consonant sounds in English 6. Develop an understanding of how to produce these sounds clearly 7. Pronounce consonant sounds clearly in words 8. Pronounce consonant sounds clearly in sentences 9. Identify the number of syllables in words 10. Pronounce two, three, four and five syllable words clearly 11. Pronounce two, three, four and five syllable words clearly in sentences 12. Place emphasis on the correct syllable in words 13. Identify when to use the articles ''a'' and ''an'' 14. Identify the different pronunciations of ''the'' and when to use these', '01/01/2014', '01/01/2014', 128, 1000, '750', 'Online', 'N/A', 'Y', 'N', 'Y'),
