client''s organisation.</p> <p>Â </p> <p>Courses on offer:</p> <p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;">Microsoft Office 2003/2007/2010/2013</p> <p>Access: Advanced Workshop (Level 3)</p> <p>Access: Essentials (Levels 1 & 2)</p> <p>Access: Visual Basic for Applications (Level 4)</p> <p>Excel: Advanced Formulas (Level 3)</p> <p>Excel: Data Analysis (Level 2)</p> <p>Excel: Essentials (Level 1)</p> <p>Excel: Visual Basic for Applications</p> <p>Excel: Visual Basic Programming</p> <p>Outlook: Productivity (Level 1)</p> <p>PowerPoint: Workshop (Levels 1 & 2)</p> <p>Project: Advanced Workshop (Level 2)</p> <p>Project: Essentials (Level 1)</p> <p>Visio</p> <p>Word: Advanced Functions (Level 3)</p> <p>Word: Essentials (Level 1)</p> <p>Word: Styles and Formatting (Level 2)</p> <p>Excel: Amazing Macros</p> <p>Excel: Secrets of Excel</p> <p>Microsoft Office 2013 New Features</p> <p>Microsoft Office 2007 Excel: Dynamic Charting</p> <p>Microsoft Office 2010 Excel: Maximizing Pivot Tables</p> <p>Microsoft Office 2010 PowerPoint: Infusing Magnificent Multimedia</p> <p>Microsoft Office: Introduction to PC''s</p> <p>Microsoft Office: PowerPivot for End-Users</p> <p>Microsoft Office Windows 7 for End-Users</p> <p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p> <p>PLEASE CONTACT BYTES REGARDING SCHEDULED COURSE DATES.</p> <p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p> <p>Â </p>', '01/01/2016', '02/01/2016', 157, 20, '800.00 - R 2 500.00', '', 'N/A', 'Y', '', ''),
