rganisation.</p> <p>Â </p> <p>Courses on offer:</p> <p>CompTIA Linux+</p> <p>CompTIA A+</p> <p>CompTIA Network+</p> <p>CompTIA Security+</p> <p>CompTIA Storage+</p> <p>CompTIA Mobility+</p> <p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p> <p>PLEASE CONTACT BYTES REGARDING SCHEDULED COURSE DATES.</p> <p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p> <p>Â </p>', '01/01/2016', '02/01/2016', 157, 20, '800.00 - R 2 500.00', 'xxx', 'N/A', 'Y', '', ''),
(130, 'POPI (Personal Protection of Information Act)', '<p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">The Protection of Personal Information Act (POPI) sets conditions for how your business may process personal information.Â It has been signed by the President and is law. Once the commencement date is announced, your business will have one year to comply or face significant consequences.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Let us help you assess your risk and train your employees on this important legislation. We offer a comprehensive training programme that covers the following topics:</p> What is POPI and who must comply? What is personal information? When is information "processed"? What are the rules that you must comply with when processing information? What are the practical steps your business needs to take to ensure compliance with POPI? What are the consequences for non-compliance? <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Our programme allows for employees to provide feedback on the type of information that they process and their view on how compliant your current processing is with POPI. This tool offers a unique opportunity to obtain a high level assessment of the potenital risks your business may be exposed to in regard to POPI.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Â </p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Â </p>', '01/01/2015', '31/12/2015', 166, 100, '4000', 'Online ', 'N/A', 'Y', 'N', 'Y'),
(131, 'CPA (Consumer Protection Act)', '<p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">The CPA creates a myriad of consumer rights and corresponding obligations for all businesses that supply goods or services to consumers.Â </p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Whether your business is a producer, importer, distributor, franchisor or retailer, it needs to train its employees on the CPA. Let us help you identify your CPA risks and implement a training programme that addresses those risks â€“ adequately and appropriately.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">We offer a range of CPA modules from which you can select the appropriate combination to compile a unique CPA programme that addresses the needs of your business. Module topics include:</p> What is the CPA and who does it apply to and protect? What are the powers of the Consumer Authorities? What rights does the CPA give Consumers? What obligations does the CPA place on business? Marketing and the CPA Labelling, pricing and the CPA Your agreements and the CPA Supplier warranties and liability Lay-byes, pre-paid facilities and returns of consumer'' property Business names and trade marks Franchise agreements and the CPA Fixed term agreements and the CPA', '01/01/2015', '31/12/2015', 166, 100, '4000', 'Online ', 'N/A', 'Y', 'N', 'Y'),
(132, 'Microsoft Digital Literacy', '<p class="justify" style="box-sizing: border-box; color: #555555; line-height: 24px; margin: 0px 0px 20px; text-align: justify; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px;">Computing is an important part of everyday life in the twenty-first century. From music and photos to banking and communicating, computers have changed the way we work and live.Â </p> <p>The first module of the Microsoft Digital Literacy curriculum, available for free online, introduces you to the fundamentals of computing, explains the components of a computer, explores operating system basics, and shows you how to use a mouse and a keyboard. Go toÂ http://alison.com/courses/MSDL-M1 to get started.</p>', '01/09/2014', '02/01/2017', 170, 1000, 'FREE', '', 'N/A', 'Y', 'N', 'Y'),
(133, 'Plan Your Career Path', '<p class="justify" style="box-sizing: border-box; color: #555555; line-height: 24px; margin: 0px 0px 20px; text-align: justify; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px;">Stan Christensen is a partner at Arbor Advisors, an investment banking firm where he negotiates on behalf of mid-market technology companies. He has nearly twenty years of experience in both transactional and operations roles and has worked on hundreds of transactions.Â </p> <p>In this free online course he advises doing as much informational interviewing as you can to ensure you pick a career path that you will enjoy and be a good fit for your interests. He says that when you are planning a career not to be overly concerned with a linear path, if you are savvy and wilful you can work your way into most careers. He outlines a few of the erroneous career assumptions that will help you avoid picking the wrong job. You will learn how a career/life balance is important and how a career where you are constantly overworking is unhealthy. Stan Christensen also explains the art of negotiation and relationship management and how to handle salary and job negotiations. He talks about how men and women do indeed negotiate for compensation differently. Finally, he discusses how the negotiations conducted when leaving a job are as critical as when starting one. This course will be of interest to business professionals, students and, indeed, anyone looking for advice on planning their career path. Go toÂ http://alison.com/courses/How-to-Plan-Your-Career-Path to get started.</p>', '01/09/2014', '04/01/2016', 170, 1000, 'FREE', '', 'N/A', 'Y', 'N', 'Y'),
(134, 'Fundamentals of English Grammer', '<p style="box-sizing: border-box; color: #555555; line-height: 24px; margin: 0px 0px 20px; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px;">This free online course offers a comprehensive review of English grammar and is ideal for those already fluent in English who want to improve their writing skills, as well as their spoken English.</p> <p style="box-sizing: border-box; color: #555555; line-height: 24px; margin: 0px 0px 20px; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px;">It examines spelling, grammar and punctuation including commas, colons, adverbs and prepositions, meaning you will be able to write English more confidently â€“ enhancing both your personal and professional skills.Â </p> <p style="box-sizing: border-box; color: #555555; line-height: 24px; margin: 0px 0px 20px; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px;">Go toÂ http://alison.com/courses/English-Grammar to get started.</p>', '01/09/2014', '02/01/2017', 170, 1000, 'FREE', 'ONLINE', 'N/A', 'Y', 'N', 'Y'),
