(139, 'Master Class: Leading and coaching contact centre agents ', '<p>Â </p> <p class="MsoNormal">This Master Class is highly experiential and will challenge you as a leader to think differently about how your team works with customer relationship during each call. You will then learn and practice a simple coaching method developed by Game On Coaching that will help your agents work more effectively with customer relationship and help you to develop a team that''s more empowered, resourceful and successful. </p> <p>Â </p> <p>Â </p> <p><b>Who should register:</b><b><br /> <strong>Operations Managers</b></strong><b> <strong>Team Leaders</b></strong><b> <strong>Quality Coaches</b></strong><b> <br style="mso-special-character: line-break;" /> </b></p>', '21/10/2015', '21/10/2015', 3220, 20, '1,500.00', 'Durban', 'KwaZulu-Natal', 'N', 'Y', ''),
(140, 'Master Class: Contact Centre Operations', '<p>In this powerful one day seminar Rod Jones introduces and discusses many of the fundamental day-to-day issues and challenges that typically face contact centre operational managers, supervisors, team leaders and support personnel. The focus of these discussions are on Operational Best Practices and internationally recognized standards.</p> <p>Introduction to CRM & The Customer Experience The role of the modern contact centre: The Centreof Excellence Operational Dynamics of a modern Contact Centre Performance Measurement & Management Issues The critical importance of Business Processes Contact Centre Technologies and Best Practice Guidelines Quality Management and Quality Assurance issues Auditing, Assessing and Benchmarking your Call Centre or Contact Centre</p> <p>The interactive nature of this seminar allows delegates to exchange ideas, discuss specific challenges and to share experiences with the group.</p> <p>This exclusive BPeSA-endorsed Rod Jones MasterClass has been designed specifically with call centre operational management in mind.</p> <p>Call Centre, Contact Centre Managers Customer Care Centre Managers Operations Managers Supervisors & Team Leaders QA and WFM Managersand Specialists MIS and HR Specialists Training Managers</p>', '27/10/2015', '27/10/2015', 3220, 20, '1,500.00', 'Mt Edgecombe, Durban.', 'KwaZulu-Natal', 'Y', 'Y', ''),
(142, 'Master Class: Leading and coaching contact centre agents', '<p><b>This Master Class is highly experiential being delivered in the PMI Connect Contact Centre using the Acclimate Contact Centre Simulator, a rich simulation environment that enables agents to undergo repeated simulations that they would typically experience in their daily role and thereby allowing for real time coaching. This unique combination of simulation together with a proven contact centre coaching method will allow participants to grapple with new skills and then groove them through real life simulation.</b></p> <p>Â </p> <p><b>Who should register:</b><b><br /> <strong>Operations Managers</b></strong><b> <strong>Team Leaders</b></strong><b> <strong>Quality Coaches</b></strong></p>', '06/10/2015', '06/10/2015', 3220, 20, '1,500.00', 'Harambee - Cape Town', 'Western Cape', 'Y', 'Y', ''),
(143, 'Master Class: Contact Centre Operations', '<p>In this powerful one day seminar Rod Jones introduces and discusses many of the fundamental day-to-day issues and challenges that typically face contact centre operational managers, supervisors, team leaders and support personnel. The focus of these discussions are on Operational Best Practices and internationally recognized standards.</p> <p>Introduction to CRM & The Customer Experience The role of the modern contact centre: The Centreof Excellence Operational Dynamics of a modern Contact Centre Performance Measurement & Management Issues The critical importance of Business Processes Contact Centre Technologies and Best Practice Guidelines Quality Management and Quality Assurance issues Auditing, Assessing and Benchmarking your Call Centre or Contact Centre</p> <p>The interactive nature of this seminar allows delegates to exchange ideas, discuss specific challenges and to share experiences with the group.</p> <p>This exclusive BPeSA-endorsed Rod Jones MasterClass has been designed specifically with call centre operational management in mind.</p> <p>Call Centre, Contact Centre Managers Customer Care Centre Managers Operations Managers Supervisors & Team Leaders QA and WFM Managersand Specialists MIS and HR Specialists Training Managers</p>', '29/10/2015', '29/10/2015', 3220, 20, '1,500.00', 'Harambee - Cape Town', 'Western Cape', 'Y', 'Y', ''),
(144, 'Master Class: Contact Centre Operations', '<p>In this powerful one day seminar Rod Jones introduces and discusses many of the fundamental day-to-day issues and challenges that typically face contact centre operational managers, supervisors, team leaders and support personnel. The focus of these discussions are on Operational Best Practices and internationally recognized standards.</p> <p>Introduction to CRM & The Customer Experience The role of the modern contact centre: The Centreof Excellence Operational Dynamics of a modern Contact Centre Performance Measurement & Management Issues The critical importance of Business Processes Contact Centre Technologies and Best Practice Guidelines Quality Management and Quality Assurance issues Auditing, Assessing and Benchmarking your Call Centre or Contact Centre</p> <p>The interactive nature of this seminar allows delegates to exchange ideas, discuss specific challenges and to share experiences with the group.</p> <p>This exclusive BPeSA-endorsed Rod Jones MasterClass has been designed specifically with call centre operational management in mind.</p> <p>Call Centre, Contact Centre Managers Customer Care Centre Managers Operations Managers Supervisors & Team Leaders QA and WFM Managersand Specialists MIS and HR Specialists Training Managers</p>', '21/10/2015', '21/10/2015', 3220, 20, '1,500.00', 'IQ Business - Rivnoia', 'Gauteng', 'Y', 'Y', ''),
(146, 'Master Class: Quality Assurance', '<p>Presented by Lynnette Morris who started her contact centre career over 20 years ago in the telecommunications industry, her exposure in various strategic and contact centre operational management roles, development of green field contact centres in Africa and her specialist focus on people development and enabled support services has provided her the opportunity to have worked with international and national organisations in over 16 African countries; providing "best practice" services ranging from strategic and operational consulting support; operational reviews, outsourced quality assurance services, vendor liaison; operational leadership support, coaching and providing learning interventions to develop contact centre competencies.Â </p> <p>Â </p> <p></p> <p class="MsoNormal" style="margin-top: 0cm; margin-right: 13.0pt; margin-bottom: 10.0pt; margin-left: 1.0cm; tab-stops: 52.5pt;">Lynnette actively participates in the following global and national industry initiatives as part of her commitment to positively influence the customer contact centre industry and to develop "Best Practice" customer contact centres that enhance customer experiences and staff wellbeing:</p> <p class="MsoNormal" style="margin-top: 0cm; margin-right: 13.0pt; margin-bottom: .0001pt; margin-left: 54.0pt; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;">Â· Convener ISO South Africa Mirror Group â€“ ISO 18295 /PC 273 Customer Contact Centre Standards and Member of the ISO International Development Team - www.ISO.com</p> <p class="MsoNormal" style="margin-top: 0cm; margin-right: 13.0pt; margin-bottom: .0001pt; margin-left: 54.0pt; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;">Â· Chairlady SABS Technical Review Committee - TC 273 Customer Contact Centre Standards (SABS 990-1 to 3:2008) â€“ www.sabs.org.za</p> <p class="MsoNormal" style="margin-top: 0cm; margin-right: 13.0pt; margin-bottom: .0001pt; margin-left: 54.0pt; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;">Â· Community Expert Practitioner SAQA QCTO - Occupational Qualification OFO143905 Contact Centre Manager qualification - www.saqa.org.za</p> <p class="MsoNormal" style="margin-top: 0cm; margin-right: 13.0pt; margin-bottom: .0001pt; margin-left: 54.0pt; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;">Â· Vice Chairlady and Treasurer ICCCA - Independent Customer Contact Centre Association â€“ www.iccca.co.za</p>', '04/11/2015', '04/11/2015', 3220, 20, '1,500.00', 'Harambee - Cape Town', 'Western Cape', 'Y', 'Y', '');
INSERT INTO `courses` (`id`, `courseName`, `courseDetails`, `courseStartDate`, `courseEndDate`, `providerId`, `capacity`, `coursePrice`, `courseLocation`, `province`, `status`, `venueBooked`, `archived`) VALUES
(151, 'Briefing the Team', '<p class="MsoNormal" style="margin-bottom: .0001pt;">When people work in teams, the sum of their efforts can be far greater than when they work as individuals. Being able to build effective, high performance teams is a key aspect of your role as a manager.<br /> <br /> When you have completed this course you will be able to:<br /> <br /> Â· Recognise the difference between groups and teams<br /> Â· Identify the stages of development of teams<br /> Â· Recognise the current development stage of the team<br /> Â· Recognise the range of team roles and apply this concept to build an effective team<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'N', 'Y', ''),
(153, '5 Steps to Risk Assessment in your Workplace', '<p class="MsoNormal" style="margin-bottom: .0001pt;">5 Steps to Risk Assessment in your Workplace, provides an interactive method of training in the importance of risk assessments. This activity will show the learner how risk assessments don''t need be daunting and time-consuming tasks. An emphasis is placed on how they can easily become second nature during a working day.<br /><br />Chapters:<br /><br />1. What is a Hazard? What is a Risk? Learners are given the opportunity to view a real life situation and assess the Hazards and Risks in the area with multiple choice Q&A.<br /> 2. Decide who might be at Risk? Watching a short clip, learners can assess which people in the situation are at risk from hazards.<br /> 3. Evaluate the Risks. Risks are explained and learners have a number of action options.<br /> 4. Record your findings and implement them. The importance and appropriateness of recording information is explained along with steps to minimise hazards.<br /> 5. Review the Assessment and Update Risks should be assessed by everyone all of the time.<br /><br />(Duration: 22 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(154, 'Acrobat X', '<p>Do you want to learn how to use Acrobat X to create Portable Document Format (PDF) documents. You can create documents that can be animated, used as a presentation, tagged for accessibility, tracked and digitally signed. This activity will teach you how to gain these skills. This activity is ideal if you need to create secure documents that are visible to large numbers of people.<b><br /><br /></b>Modules<b>:<br /><br /></b>There are four modules in this activity:<br /><br />- creating PDF files <br />- editing PDF files with Acrobat<br />- creating forms and using digital signatures<br />- creating interactive presentations<br /><br />(Duration: 5 hours 15 minutues)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(155, 'Age Discrimination', '<p class="MsoNormal">Age discrimination legislation should be important in every workplace. It''s a person''s ability to do their job properly that matters and age shouldn''t be an issue. <br /><br />This activity explores:<br /><br />- why age discrimination matters<br />- your rights as an employee<br />- the responsibilities of an employer<br /><br />(Duration: 40 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(156, 'Age: Realising the Benefits of a an age-diverse workforce', '<p>Overview:</p> <p>It is illegal to discriminate against employees, job seekers or trainees on grounds of age. This online activity covers a comprehensive range of age-related topics. It is aimed at employees of all levels, and provides guidance on best practice in the workplace and emphasises the value of an age diverse workforce.<br /> <br /> Details:<br /> <br /> Age is probably the most common form of discrimination in the workplace. More and more organisations are reaping the business rewards of a mixed age workforce. This activity will help you to realise the benefits of an age diverse workforce and enable your staff to have a better understanding of:</p> <p>Â· Employers'' and employees'' responsibilities.</p> <p>Â· Why age is a key aspect of diversity.</p> <p>Â· Why it is misleading, unreasonable and unlawful to make assumptions about people''s abilities based on age alone.</p> <p>Â· How an ''age-balanced'' workforce can give your organisation a healthy combination of fresh thinking, new ideas, stability and experience.</p> <p>Â· How to create the right atmosphere so your organisation can reap the benefits of a mixed age workforce.</p> <p>Â· What actually constitutes harassment on the grounds of age</p> <p>Â· Age laws designed to protect employees throughout their working lives.</p> <p>Chapters:</p> <p>This activity doesn''t just consider organisations'' and individuals'' responsibilities â€“ it looks beyond compliance. The activity content will ensure that your staff gain the knowledge and skills necessary to work successfully as part of a diverse team.<br /> <br /> Part 1 â€“ Manager''s module on when people join, are working or leaving â€¢ Assessment quiz.<br /> <br /> Part 2 â€“ Legislation â€¢ Case studies â€¢ Assessment quiz<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(157, 'Health and Safety Level 1', '<p class="MsoNormal">Employers are, by law, responsible for providing safe and healthy workplace conditions for all employees. This activity covers all the general health and safety issues that affect your job and highlights the importance of adhering to good health and safety practices.<br /><br />By taking this activity you will: <br /><br />â€¢ understand your responsibilities with regard to Health & Safety legislation<br />â€¢ understand the importance of risk assessment and your responsibilities associated with this risk<br />â€¢ identify the different types of accidents and how to prevent them<br />â€¢ understand how to lift and carry heavy loads safely<br />â€¢ understand how fire starts and how this can be prevented<br />â€¢ identify the different types of fire extinguishers and how they should be used<br />â€¢ understand how to identity hazardous substances and the dangers associated with these<br /><br />To progress your knowledge in this area our Health and Safety Level 2 activity covers the subject in greater depth.<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(158, 'Health and Safety Level 2', '<p>This activity is designed to equip you with the necessary skills and knowledge to ensure that you work safely. All staff members will also benefit from refreshing their knowledge of good health and safety practice.<br /><br />Employers are, by law, responsible for providing safe and healthy workplace conditions for all employees. This activity covers all the general health and safety issues that affect your job and highlights the importance of adhering to good health and safety practices.<br /><br />Coverage also includes:<br /><br />â€¢ Reporting procedures<br />â€¢ Accidents at Work<br />â€¢ Hazards in the Workplace,<br />â€¢ Minor Hazards<br />â€¢ Safety Signs<br />â€¢ Emergency Escapes<br />â€¢ Control of Hazardous Substances<br />â€¢ Fire Prevention<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(160, 'ECDL Skills Suite (Office 2010)', '<p>If you want to gain the confidence, skills and knowledge to use computers, then getting an ECDL qualification could be right for you. Not only will you get familiar with a whole range of common IT software packages, but the ECDL is also an internationally recognised qualification. This group of seven modules can be used to work towards the ECDL qualification. The required assessments for the qualification must be purchased separately from an approved ECDL test centre.<br /><br />This activity programme is perfect for beginners. It will help you to feel comfortable with IT and become more confident using Microsoft applications. Some basic experience of using a computer is needed, but there are no formal entry requirements. To get the most from this activity access to Microsoft Office 2010 is advised.<br /><br />When you have completed these activities, you will be able to:<br /><br />â€¢ understand key concepts in IT<br />â€¢ use a computer to organise files and folders<br />â€¢ use word processing, spreadsheet and database applications<br />â€¢ produce and deliver a professional presentation<br />â€¢ use the internet and email<br /><br />Skills Suite components:<br /><br />ECDL Module 1: Security for IT Users<br />ECDL Module 2: IT User Fundamentals â€“ Windows 7<br />ECDL Module 3: Word Processing - Word 2010<br />ECDL Module 4: Spreadsheets - Excel 2010<br />ECDL Module 5: Database Software - Access 2010<br />ECDL Module 6: Presentation Software â€“ PowerPoint 2010<br />ECDL Module 7: Using Email and the Internet â€“ IE8<br /><br />(Duration: 55 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R2,400.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(161, 'ECDL Skills Suite (Office 2007)', '<p>If you want to gain the confidence, skills and knowledge to use computers, then getting an ECDL qualification could be right for you. Not only will you get familiar with a whole range of common IT software packages, but the ECDL is also an internationally recognised qualification. This group of seven modules can be used to work towards the ECDL qualification. The required assessments for the qualification must be purchased separately from an approved ECDL test centre.<br /><br />This activity programme is perfect for beginners. It will help you to feel comfortable with IT and become more confident using Microsoft applications. Some basic experience of using a computer is needed, but there are no formal entry requirements. To get the most from this activity access to Microsoft Office 2007 is advised.<br /><br />When you have completed these activities, you will be able to:<br /><br />â€¢ understand key concepts in IT<br />â€¢ use a computer to organise files and folders<br />â€¢ use word processing, spreadsheet and database applications<br />â€¢ produce and deliver a professional presentation<br />â€¢ use the internet and email<br /><br />Skills Suite components:<br /><br />ECDL Module 1: Security for IT Users<br />ECDL Module 2: IT User Fundamentals â€“ Windows Vista<br />ECDL Module 3: Word Processing - Word 2007<br />ECDL Module 4: Spreadsheets - Excel 2007<br />ECDL Module 5: Database Software - Access 2007<br />ECDL Module 6: Presentation Software â€“ PowerPoint 2007<br />ECDL Module 7: Using Email and the Internet â€“ IE8<br /><br />(Duration: 55 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R2,400.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(162, 'Forces for Change', '<p>This activity focuses on the causes of change.<br /> <br /> When you''ve completed this activity, you''ll be able to:<br /><br />â€¢ Identify internal and external forces for organisational change<br />â€¢ Recognise opportunities for your own organisation created by the forces for change<br />â€¢ Recognise threats to the organisation from the forces for change<br /><br />(Duration: 2 hours 45 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(163, 'Ethics in Business', '<p>Ethics is concerned with the set of moral principles by which we live our lives. Businesses also follow a set of principles that they consider to be morally right. Like individuals, businesses can be judged by their principles and by whether they practice what they preach.<br /><br />When you''ve completed this activity, you''ll be able to:<br /><br />â€¢ Understand the concept of ethics and its relevance for the workplace<br style="mso-special-character: line-break;" /> â€¢ Identify and resolve situations where individuals may have different perceptions and apply different values<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(164, 'Influencing and Negotiating', '<p class="MsoNormal">It''s likely that you''ll often need to negotiate with other people and persuade them to, for example, accept an idea of yours. In these situations your influencing and negotiating skills are paramount.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Explain and apply the principle of negotiation<br />â€¢ Recognise the importance of non-verbal communication and social skills in effective negotiation<br />â€¢ Influence people to achieve identified objectives<br />â€¢ Reduce resistance and minimise conflict<br />â€¢ Know when and how to accept the opinions, values and will of others<br />â€¢ Work to achieve a win-win situation<br /><br />(Duration: 2 hours 55 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(165, 'Briefing Skills', '<p class="MsoNormal">Effective briefing allows managers, team leaders and project co-ordinators to communicate their goals and expectations from the beginning of every project. Whether employees are dealing with a supplier or talking to their team or colleagues, Briefing Skills will help them brief people clearly and constructively.<br /><br />As participants learn how to develop focused, comprehensive briefs - and acquire the skills to present them successfully - they will find it easier to get the results they are aiming for in a wide range of situations. Most importantly, the business will benefit from the time and resources saved by giving others accurate, relevant information about the projects they are involved in.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Identify what to include in (and omit from) briefings<br />â€¢ Understand how to plan and prepare for briefings<br />â€¢ Describe how to deliver briefings effectively<br />â€¢ Use feedback constructively to keep management informed<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(166, 'Interpersonal Skills and Trust', '<p class="MsoNormal">Interpersonal skills and trust are vital factors in building effective working relationships with your team members and colleagues.<br /><br />When you have completed this course you will be able to:<br /><br />â€¢ Appreciate the importance of open communications and the exchange of information in promoting effective working relationships<br />â€¢ Understand the changing nature of relationships in the workplace<br />â€¢ Demonstrate respect for the needs of others through your working practices<br />â€¢ Act positively to build trust within working relationships<br />â€¢ Respect confidentiality in the workplace<br /><br />(Duration: 4 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R720.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(167, 'Communication Skills', '<p>Learners will understand how it is possible to communicate in different ways in a variety of situations. These include communicating face to face and by telephone. They will look at body language, ways of asking questions and who to ask for help in different circumstances. The activity includes real life success stories from members of the public.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Identify different communication skills required<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(168, 'Dealing with Problems', '<p>In an ideal world, your team would never experience problems but the reality is that they will. In this activity you''ll explore the kinds of problems that can arise in the workplace. You''ll find out how to solve problems using a six-step process, and you''ll learn how to cope when a crisis occurs.<br /><br />The activity incorporates a range of supporting material to help you develop your skills, including web links and resources, as well as case study scenarios and an action plan to help you apply your knowledge to real situations.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(169, 'Producing Project Reports', '<p>Whatever the purpose of a report, it is crucial that its contents are accurate, clear and credible. This introductory activity is for anyone involved in the report-writing process. Learners will gain the confidence to plan well-written reports, and organisations will benefit from clear, concise documents which will be read and understood - improving communication and saving valuable time.<br /><br />From this activity, you will be able to understand : <br /><br />â€¢ Identify what to include in reports<br />â€¢ Structure reports effectively<br />â€¢ Include visual material to create a greater impact<br />â€¢ Gather the necessary information<br />â€¢ Communicate numerical information clearly<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(170, 'Developing Yourself', '<p class="MsoNormal">You need to know where your strengths and weaknesses lie, and take responsibility for your personal development needs. In this activity, you''ll look at what personal development actually means. You''ll explore how you can assess your current skills and abilities, and how you can find out what other people think of your performance. Most importantly, you''ll discover how to address your development needs by setting and achieving personal goals.<br /><br />This online activity is aimed at new or aspiring team leaders, and incorporates a range of supporting material to help you develop your skills, including web links and resources, as well as case study scenarios and an action plan to help you apply your knowledge to real situations.<br /><br />When you''ve completed this activity, you''ll be able to:<br /><br />â€¢ Assess your current skills and abilities<br />â€¢ Find out what other people think of your performance<br />â€¢ Address your development needs by setting and achieving personal goals<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'N/A', 'Y', '', ''),
(171, 'Respecting and Supporting Others', '<p>This activity explains what supportive behaviour at work means and why it matters, how to show consideration to others and how to treat people with respect.<br /><br />When you have completed the activity you will be able to:<br /><br />â€¢ Understand how to behave in a way that supports effective working<br />â€¢ Understand the purpose of meeting work standards and deadlines<br />â€¢ Understand the purpose of leaving equipment and the work area read<br />â€¢ Understand the purpose of meeting work standards and deadlines<br />â€¢ Understand how to respect other people at work<br /><br />(Duration: 1 hour)<br /><br /></p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(172, 'Maintaining Discipline', '<p class="MsoNormal">Wherever people have to work, they''ll perform better if they are managed fairly and consistently according to the rules and procedures of the law and the organisation. As a first line manager it is often your responsibility to enforce those rules and procedures and to maintain discipline within your team.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the organisation''s employment policies and procedures, and the need to follow them<br />â€¢ Maintain adequate records to support and enable the disciplinary process<br />â€¢ Monitor individual''s compliance with organisational policies<br />â€¢ Identify areas of concern<br />â€¢ Recognise different attitudes and behaviours and their impact on the team<br />â€¢ Support individuals to meet requirements<br /><br />(Duration: 3 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'N/A', 'Y', '', ''),
(173, 'Developing Your Administration Skills', '<p class="MsoNormal">This activity covers effective business administration, using a diary system and representing your organisation to visitors.<br /> <br /> When you''ve completed this activity, you''ll be able to:</p> <p>â€¢ Understand a diary system<br />â€¢ Be able to work in a way that fits with organisational values<br />â€¢ Understand procedures for meeting and welcoming visitors<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(174, 'Organising yourself', '<p>This activity looks at how you can organise yourself better by setting objectives and planning your work. The activity begins by exploring why it''s important to be organised and the main stages involved in getting more organised at work.<br /><br />You will be shown how setting objectives can help and how you can reach your goals by managing your time more effectively, prioritising your workload, allocating tasks to the right people and producing a schedule. Finally, learners will look at why it''s important to be flexible and adaptable to changing circumstances and learn lots of new techniques to stay organised!<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(175, 'Writing and Analysing Reports', '<p>This activity covers researching information and analysing and evaluating data.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand how to organise and evaluate data that has been researched<br />â€¢ Understand how to report data that has been researched<br />â€¢ Be able to report data<br />â€¢ Be able to analyse and evaluate data<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(176, 'Time Management', '<p>All individuals, plus Team leaders and managers should be able to organise their own, and their team''s, time. Good time management skills allow individuals to achieve more during the working day and contribute to the success of the organisation.<br /> <br /> When you have completed this activity, you will be able to:<br /><br />â€¢ Analyse your daily activities using this process<br />â€¢ Understand the three-step process to effective time management<br />â€¢ Prioritise ''urgent'' and ''important'' activities<br />â€¢ Develop a personal approach to using your time in the most productive way<br />â€¢ Implement techniques for minimising disruptions<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(177, 'Producing Documents to Agreed Standards', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require in the field Business and/or Administration. This activity covers using equipment, managing problems with equipment, sustainability and reducing waste.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the purpose of producing high quality and attractive documents in a business environment<br />â€¢ Understand the purpose of following procedures when producing documents in a business environment<br />â€¢ Understand procedures for researching information<br />â€¢ Be able to produce documents to agreed specification<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(178, 'Working with Others', '<p class="MsoNormal">This activity helps you to understand how to establish, develop and manage relationships in the workplace.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the purpose of communication in teams and how to do so<br />â€¢ Understand the value of people in a team and how to respect and support them<br />â€¢ Understand how to communicate as a team<br />â€¢ Understand how to work as a team to achieve goals and objectives<br />â€¢ Understand how to communicate as a team<br />â€¢ Understand the purpose & benefits of assessing the work of a team<br />â€¢ Understand how to deal with problems and disagreements<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(179, 'Managing Successful Meetings', '<p>This activity covers preparing for and holding meetings, including supporting the running of a meeting.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the arrangements and actions required for planning meetings<br />â€¢ Be able to prepare for a meeting<br />â€¢ Be able to support running a meeting<br />â€¢ How to follow up a meeting<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(180, 'Motivating the Team', '<p>The first part of the activity takes a close look at what exactly motivation is. You will explore the many benefits motivation can bring - and the problems that can arise when a team becomes demotivated. You will learn popular motivation theories and examine studies that uncover how motivation actually works. In the second part of the activity you will be given plenty of practical guidance on how to motivate your team. By the time you have finished the activity, you will have the skills needed to enable your team to get more out of their work - and increase their productivity at the same time!<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'N/A', 'Y', '', ''),
(181, 'Supporting Individuals', '<p>Supporting Individuals introduces line managers to basic concepts around building supportive and trusting relationships with people who work for them.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Build and maintain trust relationships with your team members<br />â€¢ Provide support to your team, through advising, mentoring and counselling, and consider when each is appropriate<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(182, 'Resolving Conflict', '<p>Resolving conflict looks at conflict in the workplace, its causes and what can be done to handle it effectively. It helps managers and team leaders create a positive working environment through a range of strategies, which can be used to prevent conflict.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Define conflict and its effects<br />â€¢ Recognise why, how and where conflict might occur in the workplace<br />â€¢ Understand a range of conflict handling styles<br />â€¢ Describe how to handle conflict to achieve positive results<br /><br />(Duration: 3 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(183, 'Types of problem behaviour', '<p>This online activity takes a close look at some of the most common types of problem behaviour - such as aggression, manipulation, extreme emotional responses, persistent negativity and work avoidance - and suggest effective techniques for turning those difficult people into dedicated professionals.<br /><br />Problem behaviour can have a huge impact on your workforce. Negative and obstructive behaviours affect our drive and our sense of wellbeing and can leave us feeling distracted and demotivated. If allowed to continue unchecked in an organisation, they can lead to a drop in productivity, low morale, absenteeism, a rise in grievances and complaints and high staff turnover.<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(184, 'Working Relationships', '<p>In this activity you''ll discover the secrets of developing good working relationships. This activity will start by looking at the benefits of working well together, and the difficulties that teams often have to work through before they become fully integrated and productive. Also explored are the various causes of conflict that can arise at work, from minor disagreements through to harassment and bullying. Finally this activity will look at how to deal with conflicts quickly and effectively.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(185, 'Giving and Receiving Feedback', '<p class="MsoNormal">Giving and Receiving Feedback provides an introduction to the ''communication cycle'' and the importance of feedback within it. It also covers the different forms and styles of giving and receiving feedback. Users will discover practical tips and techniques to help them give and receive feedback positively and effectively.<br /><br />When you have completed this course, you will be able to:<br /><br />â€¢ Understand the vital importance that feedback has to play in the communication process<br />â€¢ Consider different ways in which feedback can be communicated<br />â€¢ Understand how and when feedback should be used<br />â€¢ Appreciate how you can benefit from feedback received from others.<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(186, 'Delegation', '<p class="MsoNormal">Management is the art of achieving results through other people and delegation is an essential skill to learn if you''re going to manage other people effectively.<br /><br />When you''ve completed this activity, you''ll be able to:<br /><br />â€¢ Understand power, authority, responsibility and accountability within an organisation<br />â€¢ Understand the process of effective delegation and its role of empowering staff<br />â€¢ Recognise and encourage commitment and participation<br />â€¢ Encourage and support individuals to accept responsibility<br />â€¢ Provide constructive feedback<br />â€¢ Monitor progress<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(187, 'Assessing Performance', '<p class="MsoNormal">Assessing performance helps organisations to achieve their objectives and can play an important role in motivating employees.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Appreciate the value of assessing performance to the organisation and individuals.<br />â€¢ Ensure individuals have fair access, and an opportunity to contribute, towards assessments.<br />â€¢ Plan and prepare effective assessments against agreed criteria.<br />â€¢ Make valid and reliable assessments.<br />â€¢ Provide feedback to the individual on their performance and development.<br />â€¢ Provide information on assessments to authorised people only.<br /><br />(Duration: 3 hours 10 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(188, 'Managing Performance', '<p>To be effective as a manager you need to determine how well people are performing and then what to do about it.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the manager''s role in managing performance to meet objectives<br />â€¢ Identify and agree performance objectives<br />â€¢ Review progress and agree improvements<br />â€¢ Monitor performance against objectives<br />â€¢ Select appropriate methods to improve performance where necessary<br /><br />(Duration: 4 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R720.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(189, 'Leadership', '<p>The Leadership activity will help new managers to identify, understand and develop more effective skills in leading people in the workplace. Using theory and a practical case study, this activity examines the qualities that good leaders show and suggests ways to evolve them to motivate individuals and teams.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Describe what leadership means<br />â€¢ Understand several different leadership styles<br />â€¢ Identify a style which suits you<br />â€¢ Understand how to develop that style and the qualities needed<br />â€¢ Recognise any changes you need to make to become a more effective leader<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(190, 'Managing Social Media in the Workplace', '<p class="MsoNormal">Blogs, Twitter, Google Plus, Facebook, YouTube â€“ social media is here to stay and its impact on our lives is growing by the day. The growing use of social media has wide-ranging implications for the workplace. While it''s true that there are huge benefits to our highly connected society, its darker sides are also starting to be felt in areas such as data protection, freedom of speech, online defamation, time theft, cyber-bullying and the invasion of privacy, all of which pose significant risks for businesses and organisations. This online course looks at the law on virtual communication and provides guidance on how to manage social media use in the workplace.<br /><br />Misuse of social media by workers is believed to cost millions every year in ''lost time''. The use of social media can pose challenges for businesses and organisations.<br /><br />This online activity examines the challenges and risks that social media and social networking tools poses, it looks at the law on virtual communication and provides guidance on how to manage social media use in the workplace.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ look at how and why people use social media<br />â€¢ examine the use and misuse of social media in the workplace and identify the main risks for businesses and organisations<br />â€¢ outline relevant strategies for managing social media and minimising any risks<br />â€¢ help employees to use social media responsibly<br />â€¢ provide the tools to draw up and implement your own workplace social media policy<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(191, 'Performance Indicators', '<p>In your role, you need to be able to get the most out of the people in your team by managing them effectively and providing them with the support they need to achieve their objectives. This activity is suitable for all managers and all aspiring managers.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Understand how to measure performance and why it''s important to do so<br />â€¢ Understand the different ways in which key stakeholders of your organisation may seek to measure performance<br />â€¢ Describe how to set up and use a system to manage performance in your workplace, and how it can be enhanced<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(192, 'Analysing Information', '<p class="MsoNormal">Effective analysis of information can reveal how a business is performing and help people make the right business decisions. Analysing Information explores the difference between data and information. It introduces data analysis techniques including ratios, percentages and averages, and explains how these techniques can be used to monitor business performance. It also considers non-numerical information and how to structure and organise documents effectively. <br /><br />This activity will help employees learn how to gather, interpret, analyse and present business information to identify a business''s key strengths and weaknesses and help identify how its operations can be improved.<br /><br />When you have completed this activity you will be able to:</p> <p class="MsoNormal">â€¢ Describe the difference between data and information<br />â€¢ Use data analysis techniques such as ratios, percentages and averages<br />â€¢ Use charts and diagrams to interpret and present numerical information<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(193, 'Application Forms', '<p class="MsoNormal">Learners will know when to use an application form, understand the ''rules'' for completing applications and identify what information is required for applications. A required outcome for this Learning Module is that learners will complete a draft or final version of an application form. This application can either be for a real job or using the details in this module of the Working Ways Online Activity. The ''Practice makes perfect'' section allows learners to have the chance to practice what they have learnt about Application Forms.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Complete an application form<br />â€¢ Identify what information is relevant for applications<br /><br />(Duration: 40 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(194, 'Applying for Jobs', '<p>This activity uses video and a range of activities to introduce learners to application forms, covering letters and other documents that they may need to apply for a job.<br /><br />There are three modules in this activity:<br /><br />In the first module, application forms, learners will find out: why employers use application forms; what questions will be included in a typical application form; and tips for completing an application form. The activity in this module asks the learner to write answers to some typical questions. They can then download and keep their answers for future reference. <br /><br />The second module learners will find out about covering letters and how to write a good one. In the activity, the learner will create a covering letter that they can download to use as a template for real job applications. <br /><br />In the third module learners will find out about other documents they may need for a job application. These include letters of reference, career portfolios and records of achievement. An activity will give the learner the chance to consider their own achievements and create some notes they can use for real job applications. <br /><br />All the modules in this activity include hints and tips that the learner can download and keep for future reference.<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(195, 'Building Relationships with Customers', '<p class="MsoNormal">This activity is about developing relationships and going the extra mile. Emphasis is on stressing the importance of keeping customers informed and reassured.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the difference between an internal and an external customer<br />â€¢ Understand standard expectations that customers have<br />â€¢ Understand types of behaviours that will upset and impress customers<br />â€¢ Describe customers using the appropriate customer service language<br />â€¢ Communicate with customers in a way that makes them feel respected and valued<br />â€¢ How to identify a customer''s expectations and how to verify these<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(196, 'Building the Team', '<p class="MsoNormal">Effective teams boost productivity and help create positive working environments, so good team-building skills are a must-have for every successful manager. Find out how to combine the right blend of individual''s, strengths and aptitudes with this starter activity in Building the Team. You''ll discover the characteristics of good and bad teams, and learn how sound team management gets the best results for your business.<br /><br />When you have completed this activity you will be able to:</p> <p class="MsoNormal">â€¢ Understand the difference between groups and teams<br />â€¢ Identify the stages of team development<br />â€¢ Describe the changing role of the team builder<br />â€¢ Explain the roles within a team<br />â€¢ Understand the principals of building an effective team<br /><br />(3 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(197, '   Business Analysis', '<p class="MsoNormal">As one of the fastest growing roles in the marketplace today, the Business Analyst has become important to organisations to help understand their structure, policies, and operations, and to recommend solutions that enable them to meet their goals. This activity provides a thorough grounding in "BA" principles and also provides the underpinning knowledge for the BCS Business Analysis Foundation qualification.<br /><br />With this activity, you will quickly be able to demonstrate knowledge and understanding of business analysis principles and techniques. It covers strategy analysis, system and process modelling, stakeholder analysis, requirements, business case development and change management<br /><br />BCS Business Analysis Foundation exam:<br /><br />For those wishing to gain an internationally recognised qualification, the activity provides the full background knowledge and practice tests for the BCS Business Analysis Foundation exam*. It also provides a foundation for the range of specialist BCS modular certificates in the areas of Business Analysis, IS Consultancy and Business Change. The qualification can be used as the knowledge-based specialist module for the Diploma in Business Analysis.</p> <p class="MsoNormal">* The exam itself is not included in the price of the activity but is available separately through authorised test centres.<br /><br />The key modules within the activity are:<br /><br />â€¢The role and competencies of a business analyst<br />â€¢Strategy analysis<br />â€¢Business system and business process modelling<br />â€¢Stakeholder analysis<br />â€¢Investigation and modelling techniques<br />â€¢Requirements engineering<br />â€¢Business case development<br />â€¢Management of business change<br /><br />Learners will benefit from the exam simulator included with their e-learning, helping you to re-enforce your knowledge before sitting the final exam by completing the interactive quiz after each session and the mock exam quizzes at the end of the activity. This will significantly enhance your understanding of the method.</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R7,200.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(198, 'Communicating at Work', '<p class="MsoNormal">Being able to communicate well is a desirable aspect of employability. This activity covers all types of communication, written, verbal, graphs, charts and tables, all of which are valuable skills. Whether the learner uses communication skills formally as a manager or informally to lead a small group, this activity will benefit the learner.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Be able to identify a customer''s needs<br />â€¢ Be able to identify appropriate customer care<br />â€¢ Understand the effects of good and bad customer service<br />â€¢ Know how to prepare for meetings<br />â€¢ Understand the different ways of taking notes in meetings<br />â€¢ Understand the key issues when handling data in the workplace<br /><br />(Duration: 5 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(199, 'Communication in the Workplace', '<p class="MsoNormal">This activity uses video and a range of activities to help learners to improve their communication skills. There are six modules in this activity:<br /><br />In the first module, Effective communication, learners will find out why effective communication is essential and understand the importance of effective verbal and non-verbal communication.<br /><br />In the modules, Delegating, Negotiation, Influencing and Teamwork, learners will hear from a range of employers talking about why these skills are important and explore a range of different techniques and styles. Learners can use the checklists provided to make sure the learning is put into practice. <br /><br />In the final module, Communicating at work, learners can use the skills checker to test their own communication style and put those skills into practice as they help local business owner Brian to overcome some communication challenges. <br /> <br /> All the modules in this activity include hints and tips that the learner can download and keep for future reference.<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R312.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(200, 'Communication Process', '<p class="MsoNormal">Communication is vital to the success of any business. When it''s done right, it can result in excellent relationships with colleagues, customers and suppliers. But when it''s done wrong, poor communication can have a negative effect on a business''s relationships and its bottom line. This course will help employees improve the way they interact with people they work with. From understanding body language to learning active listening and questioning techniques, participants will gain a good grounding in the principles and practice of effective communication. As well as reducing the risk of awkward and costly misunderstandings, effective communication will save users time and increase the efficiency of their business.<br /><br />When you have completed this course you will be able to:<br /><br />â€¢ Identify the main stages in the communication process<br />â€¢ Understand the importance of effective communication<br />â€¢ Describe some common barriers to communication<br />â€¢ Know how to avoid and break down these barriers<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(201, 'Cost Benefit Analysis', '<p class="MsoNormal">Business managers have a vital role to play in identifying opportunities for change. But to make change happen they need to be able to present a strong financial case, something many business people are not trained to do. Cost Benefit Analysis explains how to generate and prioritise ideas for change within a business context. It describes how to assess the costs involved and weigh up the merits of different options. <br /><br />The course also shows how to assess the wider implications of change and take these into account when developing a financial case.<br /><br />When you have completed this course you will be able to:<br /><br />â€¢ Know how to generate and prioritise ideas for change<br />â€¢ Understand how to assess the costs involved in change<br />â€¢ Understand how to weigh up the financial merits of different options.<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(202, 'Creating a Good First Impression', '<p class="MsoNormal">This course is about giving your customers a good first impression of yourself and your organization.<br /><br />When you have completed this course you will be able to:<br /><br />â€¢ Know how to prepare for and greet customers<br />â€¢ Understand how the way you behave affects how the customer sees you<br />â€¢ Know how to respond appropriately to customers<br />â€¢ Understand the ways in which you can communicate with customers<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', '');
INSERT INTO `courses` (`id`, `courseName`, `courseDetails`, `courseStartDate`, `courseEndDate`, `providerId`, `capacity`, `coursePrice`, `courseLocation`, `province`, `status`, `venueBooked`, `archived`) VALUES
(203, 'CSS (E-learning Video course)', '<p class="MsoNormal">Do you want to further your web site building skills by learning how Cascading Style Sheets (CSS) can extend the formatting and stylistic capabilities of your HTML documents? This is an instructional e-learning course, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The course videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. <br /><br />You can follow your own pace or use our schedule to give structure to your learning The course has four modules: â€¢Introduction to CSS (Cascading Style Sheets)<br /><br />â€¢ Designing with CSS<br />â€¢ CSS Layout<br />â€¢ Advanced CSS & Links<br /><br />(Duration: 1 hour 40 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(204, 'Customer Service', '<p class="MsoNormal">In today''s highly competitive marketplace, customer service can be the difference between success and failure for many businesses.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Identify the rights and expectations of customers for customer service<br />â€¢ Agree customer service standards to meet customers'' rights and expectations<br />â€¢ Take appropriate action to respond to failures to deliver customer service to agreed standards<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(205, 'Customer Service: Being Competitive - Stand Out from the Crowd', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:</p> <p class="MsoNormal">â€¢ Know and understand how to use customer service as a competitive tool<br />â€¢ Organise customer service to gain a competitive advantage<br />â€¢ Deliver a competitive service<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(206, 'Customer Service: Building relationships - aim to exceed expectations', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Improve the customer relationship<br />â€¢ Improve communication with your customers<br />â€¢ Balance the needs of your customer and your organisation<br />â€¢ Exceed customer expectations to develop the relationship<br />â€¢ Know and understand how to improve the customer relationship<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(207, 'Customer Service: Complaint Procedures - A Structure for Solutions', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Process customer service complaints<br /> â€¢ Recognise the signs that a problem is about to produce a complaint<br /> â€¢ Deal with a complaint effectively<br /> â€¢ Know and understand how to process customer service complaints<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(208, 'Customer Service: Difficult Situations - A Guide to Dealing with Problems', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Monitor and solve customer service problems<br />â€¢ Solve immediate customer service problems<br />â€¢ Identify repeated customer service problems and options for solving<br />â€¢ Take action to avoid the repetition of customer service problems<br />â€¢ Know and understand how to monitor and solve customer service problems<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(209, 'Customer Service: Effective Communication - Dealing with Customers in Writing', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Deal with customers in writing or electronically<br />â€¢ Use written or electronic communication effectively<br />â€¢ Plan and send an effective written or electronic communication<br />â€¢ Handle incoming written or electronic communications effectively<br />â€¢ Know how to deal with customers in writing or electronically<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(210, 'Customer Service: Organisation - The Secret of Successful Service Delivery', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Organise the delivery of reliable customer service<br />â€¢ Plan and organise the delivery of reliable customer service<br />â€¢ Review and maintain customer service delivery<br />â€¢ Use recording systems to maintain reliable customer service<br />â€¢ Know and understand how to organise the delivery of reliable customer service<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(211, 'Customer Service: Promotion - The First Step to Reaching your Customers', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Use customer service as a competitive tool<br />â€¢ Offer additional services or products<br />â€¢ Organise support to promote use of additional services or products<br />â€¢ Monitor the promotion of additional services or products<br />â€¢ Understand how to organise and promote services and products to customers<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(212, 'Customer Service: Reflection and Development - Continuing Improvement', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Promote continuous improvement<br />â€¢ Plan improvements in customer service based on customer feedback<br />â€¢ Implement changes in customer service<br />â€¢ Review changes to promote continuous improvement<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(213, 'Customer Service: Understanding Customer Service - Get the Essentials', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Work with others to improve customer service<br />â€¢ Follow their organisation''s accepted customer service language<br />â€¢ Apply customer service principles in their customer service role<br />â€¢ Understand the principles of customer service<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(214, 'Customer Service: Working with Others - A Guide to Making a Difference', '<p class="MsoNormal">This activity is designed to support you in gaining the skills, knowledge and understanding you require to deliver high levels of customer service.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Work with others to improve customer service<br />â€¢ Improve customer service by working with others<br />â€¢ Monitor their own performance when improving customer service<br />â€¢ Monitor team performance when improving customer service<br />â€¢ Understand how to work with others to improve customer service<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(215, 'Working with the Data Protection Act', '<p class="MsoNormal">Overview:<br /><br />This concise online activity will teach you how to identify common risks with data protection and raise awareness of these with your colleagues. You will also learn how to take appropriate action to prevent breaches of data protection legislation.<br /><br />Features:<br /><br />More personal information is kept about individuals than ever before. The Data Protection Act was introduced to safeguard personal data.<br /><br />As we do more and more of our daily transactions online â€“ shopping, downloading music and films, banking, or managing things like our tax or pensions â€“ vast amounts of our personal data is captured, stored and processed. We are also spending more and more time using digital media to communicate and socialise â€“ resulting in a lot of our personal data being publicly available online.</p> <p class="MsoNormal">This activity will give a better understanding of:</p> <p class="MsoNormal">â€¢ the core principles of the Data Protection Act<br />â€¢ data security<br />â€¢ collecting, sharing and processing data<br />â€¢ subject access requests<br />â€¢ retention and disposal of data<br /><br />(Duration: 45 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(216, 'Nw course', '', '19/02/2016', '27/02/2016', 2, 5, '', 'new', 'Mpumalanga ', 'N', 'Y', ''),
(217, 'POrtal training ', '<p>skill sportal user functioanlity</p>', '18/02/2016', '19/02/2016', 63, 2, 'R0', 'online', 'N/A', 'Y', 'Y', ''),
(218, 'Delivering Good Customer Service', '<p class="MsoNormal">Delivering Good Customer Service is a activity full of everything you need to know to get a good basic understanding of customer service. It covers the different types of customers, the importance of good communication skills, and dealing with problems and complaints. You''ll find it useful whatever your situation is; whether you need to know about customer service because you''re looking to start your career; whether you''re working towards a qualification in customer service; or whether you''re simply just interested in finding out more.<br /><br />(Duration: 5 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(219, 'Delivering Quality', '<p class="MsoNormal">In an increasingly competitive marketplace, organisations need to be able to deliver quality each time, every time in order to attract and retain customers.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Explain the meaning and purpose of quality<br />â€¢ Contribute to the management of quality<br />â€¢ Identify relevant aspects of ISO 9000<br />â€¢ Apply simple systems for quality control<br />â€¢ Identify and use statistical methods as appropriate to the organisation<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(220, 'Developing and Improving Your Own Performance', '<p>This activity covers why developing and improving you performance is important, learning and development plans and the value of giving and receiving feedback.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand how to improve own performance<br />â€¢ Be able to agree own development needs using a learning plan<br />â€¢ Be able to improve own performance using feedback<br />â€¢ Understand the purpose of feedback when working as a team<br />â€¢ Understand the purpose of feedback in developing communication skills<br />â€¢ Be able to identify and agree ways of developing communication skills<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(221, 'Developing Leadership Skills', '<p>Enables learners to develop leadership skills, as well as manage yourself in the workplace. They will learn about time management skills, prioritising time and tasks during the working day, being mindful of their daily objectives at work, taking breaks at appropriate times and finally how to carry out an evaluation of their performance.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand the different types of leaders<br />â€¢ Understand the main features of a leader<br />â€¢ Be able to explain the steps taken to make a decision<br />â€¢ Understand how to give instructions appropriately<br />â€¢ Understand how to give feedback to a member of a group<br />â€¢ Understand how to receive feedback from a member of a group<br /><br />(Duration: 4 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(222, 'Developing Your Customer Service Performance', '<p>This course is designed to support you in gaining the skills, knowledge and understanding you require in the field Business and Administration. This course covers why developing and improving you performance is important, learning and development plans and the value of giving and receiving feedback.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand how to improve own performance<br />â€¢ Be able to agree own development needs using a learning plan<br />â€¢ Be able to improve own performance using feedback<br />â€¢ Understand the purpose of feedback when working as a team<br />â€¢ Understand the purpose of feedback in developing communication skills<br />â€¢ Be able to identify and agree ways of developing communication skills<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(223, 'Dreamweaver CS5 (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to create code to display items on web pages? Dreamweaver is a web design package that creates the code for you. This activity will teach you how to code web pages using the Dreamweaver software. With this knowledge you can use programs to increase efficiency and allow you to do complex things very quickly and build better web sites faster. Knowledge of Dreamweaver is a requirement for many web design jobs. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />There are six modules in this activity:<br /><br />â€¢Setting up a site<br />â€¢Table layout<br />â€¢Using Cascading Style Sheets<br />â€¢Advanced Techniques<br />â€¢Advanced CSS & CSS Layout<br />â€¢CSS Links & Coding<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(224, 'Display Screen Equipment (DSE)', '<p class="MsoNormal">Introduction:<br /><br />The use of Display Screen Equipment has rapidly become part of everyday life and we are all exposed to their harmful effects. This activity will provide information on how to correctly set up your workstation to avoid injury as well as looking at the hazards and risks you face while using the equipment.<br /><br />Chapters:<br /><br />1. Introduction - Overview of different Display Screen Equipment (DSE) and principal health risks associated with DSE work. <br /><br />2. Hazards and Risks - This section covers Musculoskeletal Disorders, Fatigue and Stress, Eye and Eyesight problems - all of which can be caused by working with DSE. <br /><br />3. The Workstation - As you proceed through this section, you should adjust aspects of your workstation accordingly to achieve a comfortable and good working posture. Additional factors and equipment that can help you improve your posture and working conditions include wrist rests, good housekeeping, temperature and ventilation, document holders and pointing devices.<br /><br />4. Working with portable DSE - Some of the key hazards of working with laptops are associated with the portability of the equipment. This section will also cover the Health and Safety hazards involved and what you can do to avoid these hazards. <br /><br />5. Stretches - Throughout the activity you will learn that sitting at your workstation for prolonged periods on a regular basis increases the risk of developing musculoskeletal disorders. Not only can you adjust your posture and your workstation correctly, but if you have been sitting at your workstation for a prolonged period this section will cover a few simple stretches that could be beneficial. <br /><br />6. Summary - An overview of the topics covered: hazards and risks, The workstation, working with portable DSE and stretches<br /><br />(Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(225, 'Display Screen Equipment (DSE) - Video', '<p class="MsoNormal">Introduction:<br /><br />A fresh approach to working safely with DSE. Advice is given which can be applied to your workstation, your job and your working environment. At the end of the activity there is a test and a risk analysis of the individual. <br /><br />Chapters: <br /> <br /> 1. Introduction - This section gives you an overview into the difference between VDU, Monitors and DSE.<br /> <br /> 2. Eyes - This section covers the affects DSE can have on your eyes and how to minimise risks by changing your focus / activity.<br /> <br /> 3. Aches and Pains - This section gives an overview of problems caused by DSE such as Repetitive Strain Injury (RSI) and Upper Limb Disorder (ULD). This section also covers how you can reduce the risks by taking pauses and breaks and good use and positioning of your Mouse and Keyboard. <br /> <br /> 4. The Workstation - In this section you will learn how to set up your workstation correctly and how changing posture throughout the day can reduce the risk of aches and pains. <br /> <br /> 5. Portable Devices - This section covers using portable devices with docking stations, external keyboards and mouse that can reduce risks when away from a desk/office. <br /> <br /> 6. Electrical Safety - An overview of the risks of overloading plug sockets and using Surge Protectors.<br /><br />(Duration: 25 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(226, 'Effective Communication', '<p>This activity covers effective written and verbal communication, electronic communication and checking your written communications.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand how to communicate in writing<br />â€¢ Understand how to communicate verbally<br />â€¢ Be able to communicate in writing<br />â€¢ Be able to communicate verbally<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(227, 'Effective Teamworking', '<p>This activity will explain what makes a successful team, how to communicate within a team and how to deal with problems within a team.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand how to work as part of a team to achieve goals and objectives<br />â€¢ Understand the contribution of individuals within a team<br />â€¢ Understand how to communicate as part of a team<br />â€¢ Understand the purpose of feedback when working as a team<br />â€¢ Be able to work in a team to achieve goals and objectives<br />â€¢ Understand how to deal with problems and disagreements<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(228, 'Equality Essentials', '<p class="MsoNormal">Overview:<br /><br />Equality means different things to different people and is sometimes confused with added business burdens and positive discrimination. Equality is about recognising and promoting people''s rights and responsibilities in ways that support the creation of an inclusive working and customer service environment.<br /><br />This interactive and engaging online activity is designed to demystify and simplify equality issues. It provides staff and managers with a practical introduction to the key principles which help promote equality in your workplace.<br /><br />Features:<br /><br />Equality Essentials encourages your staff to consider what equality and diversity mean in practice, explains individual rights and responsibilities, gives examples of inappropriate behaviour and identifies how to respond to harassment and bullying, as well as giving tips on how to put policy into practice.<br /><br />Details:<br /><br />This online activity will enable you or your staff to have a better understanding of:<br /><br />â€¢ What equality and diversity mean in practice<br />â€¢ The key benefits of good equality practice<br />â€¢ How to recognise and challenge inappropriate behaviour at work<br />â€¢ How to provide an inclusive and accessible customer experience<br />â€¢ How to put policy into practice<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(229, 'Financial Environment', '<p>Financial information is used to measure performance and help make decisions about how an organisation should operate. Despite its importance, many managers do not fully understand the financial information they use or how it fits into a wider business context. Financial Environment shows managers how to interpret financial information and, in doing so, make better decisions. It covers important elements of finance that affect organisations large and small.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand the important elements of finance that affect all managers and team leaders<br />â€¢ Read and understand company accounts, balance sheets and profit and loss accounts<br />â€¢ Identify sources of finance available to businesses and be able to use key financial ratios to analyse performance<br />â€¢ Understand the importance of managing cash flows.<br /><br />(Duration: 4 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R720.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(230, 'Finding that Job', '<p class="MsoNormal">Learners will discover why it is important to understand how the local labour market impacts on the availability of jobs. They will also match types of jobs to their interests, skills and experience. Finally learners will identify different sources of information to use in job search and understand that some jobs may require additional training or qualifications.<br /><br />(Duration: 25 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(231, 'Gathering Valid Information', '<p>In today''s highly competitive business world, having access to good quality information can be a key factor in operating successfully.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand the need for information<br />â€¢ Identify means of collecting and recording data and/or information<br />â€¢ Gather information relevant to your own area of responsibility<br />â€¢ Recognise any constraints on the collection of and access to data<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(232, 'Get That Job - A practical guide to the job search process', '<p class="MsoNormal">Overview:<br /> <br />Rredundancy is traumatic for everyone â€“ those who must leave, those who ''survive'' and the managers who have to hold everything together. The professional response is to ensure that employees whose jobs are redundant get the best help available when searching for new work.<br /> <br /> Features:<br /> <br /> Get That Job is a practical on line learning activity, which has been designed to support employees through the redundancy process. The activity will identify their key skills and learn how to match them to their ideal job. It will enable individuals to develop their potential and move forward with added confidence.<br /> <br /> Many employers make outplacement and job search counselling available, but this is not just nice to do â€“ there are sound business reasons. Making ''Get That Job'' available to your outgoing employees will help you discharge your moral responsibility to these people. It will also send a clear message to them, to those who remain, to the local community and to your business sector, that in your organisation, corporate social responsibility is not just a phrase but a reality.<br /> <br /> Details:<br /> <br /> Get That Job: A practical guide to the job search process'' will show your outgoing staff:<br /> <br /> â€¢ The options available to them<br />â€¢ Effective negotiation<br />â€¢ Their personal skill set<br />â€¢ How to organise job searches<br />â€¢ CV and interview preparation<br />â€¢ Confident interviewing techniques<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(233, 'Giving Effective Presentations', '<p>This activity covers preparing and giving a presentation, and getting feedback on a presentation.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Understand the purpose of preparing for and evaluating a presentation<br />â€¢ Understand the techniques used in enhancing a presentation<br />â€¢ Be able to prepare for delivery of a presentation<br />â€¢ Be able to evaluate a presentation<br />â€¢ Be able to develop a presentation<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(234, 'Giving Good Customer Service', '<p>This activity is about giving good and consistent customer service.<br /><br />When you complete this activity you will be able to:<br /><br />â€¢ Making and keeping realistic promises to customers ensuring that the customer''s and organisation''s needs are balanced<br />â€¢ Recognising when customer needs or expectations have changed and ensuring customers are kept informed<br />â€¢ Ensuring that the service given meets the customer''s needs and expectations<br />â€¢ Maintaining and improving standards of service delivery by sharing information and the methods that can be used<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(235, 'Handling difficult conversations', '<p class="MsoNormal">Overview:<br /><br />Being able to approach difficult conversations constructively is a crucial skill for managers. A positive outcome can mean the difference between an employee becoming engaged and productive, or getting increasingly dissatisfied, going absent or even making a grievance claim.<br /> <br /> Details:<br /><br />It could be addressing someone''s behaviour or work performance, breaking the news about redundancies, turning someone down for promotion or trying to get a long-term absentee back to work. Whatever the reason, it''s unlikely to be a conversation you look forward to. You''ll probably try and put it off for as long as you can, and when it does happen, you''ll want to get it over and done with as quickly as possible. This online activity will give you the skills and confidence you need to manage these conversations positively and achieve the outcomes you want.<br /> <br /> Features:<br /><br />This online activity will focus on...</p> <p class="MsoNormal">â€¢ Why conversations go wrong: The most common mistakes we make when having a difficult conversation, and how to avoid them</p> <p class="MsoNormal">â€¢ Planning ahead: What we can do to prepare in advance for a difficult conversation</p> <p class="MsoNormal">â€¢ Effective communication skills: Getting the message across and knowing when to listen</p> <p class="MsoNormal">â€¢ Dealing with angry people: How to stay calm and defuse the situation</p> <p class="MsoNormal">â€¢ Getting to the root of the problem: Knowing when and how to dig a little deeper</p> <p class="MsoNormal">â€¢ Negotiating and agreeing a way forward: What happens next<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(236, 'Health & Safety in the Office (video)', '<p class="MsoNormal">Introduction:<br /><br />This activity describes the Health and Safety issues faced within the office environment. The activity looks at Manual Handling, Fire Safety, Electrical Safety and Slips, Trips and Falls.<br /><br />Chapters:<br /><br />1. Office Environment - This section introduces you to Health and Safety in the office and covers risks in the office along with positioning and ventilation of printers.<br />2. Computer Safety - You will cover computer safety including ergonomics, posture, visual fatigue and laptops.<br />3. Manual Handling - Find out what Manual Handling is and the key areas involved in the manual handling process: Planning, Lifting, Carrying, Pushing and Pulling. <br />4. Slips, Trips and Falls - In this section you will learn the causes of Slips, Trips and Falls and how to prevent them. <br /> 5. Electrical Awareness - Fixed installations and transportable equipment and what to do in the event of an electrical fault. <br />6. Fire Safety - This section covers what to do in the event of a fire, fire safety signs and assembly point and the use of various fire extinguishers. <br />7. Security - Cover your workplace security, what to do in the event of a bomb scare or suspicious packages.<br /><br />(Durtion: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(237, 'Health & Safety We Are All Responsible (video)', '<p class="MsoNormal">Introduction:<br /> <br /> Health and Safety is not just the responsibility of managers and directors, in modern working environments every employee should be responsible for ensuring the correct practices are followed.<br /> <br /> Chapters:<br /><br />Scene 1 Scenario: Health and Safety news programme inviting you to see a workplace where managers and staff have little or no understanding of general Health and Safety. <br /><br />Scene 2 Scenario: Induction training in a new job with no risk assessment training and out of date Health and Safety policies. <br /><br />Scene 3 Scenario: Tour of the workplace and informing new starters to disregard the safety signs. <br /><br />Scene 4 Scenario: Doubts of taking the job, poor feedback from current staff and thrown in at the deep end. <br /><br />Scene 5 Scenario: Newspaper article with accident in local workplace.<br /><br />(Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(238, 'Identifying and Reducing Risks to Health and Safety', '<p class="MsoNormal">This activity forms part of the ILM Team Leading Level 2 qualification. Learners working towards the qualification should be enrolled on the relevant qualification activity (Award or Certificate).<br /><br />The modules of this activity incorporate a range of supporting material to help develop the learner''s skills, including web links and resources, case studies and action plans to help apply their knowledge to real situations.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(239, 'Introduction to Health and Safety (video)', '<p class="MsoNormal">Introduction:<br /><br />Good Health and Safety practice is one of the most important aspects within any work environment. Looking at all of the key areas, this activity is ideal for providing your employees with a general understanding of Health and Safety, covering 12 essential Health and Safety topics.<br /><br />Chapters:<br /><br />1. Fire Safety - Correct fire evacuation procedure and the basics of fire extinguishers. <br /><br />2. Manual Handling - This section will cover the correct manual handling procedure. <br /><br />3. Slips, Trips and Falls - Find out how to avoid Slips, Trips and Falls. <br /><br />4. Electrical Safety - Checking electrical equipment before using them and reporting electrical faults. <br /><br />5. COSHH - What is COSHH? The safe storage of COSHH and the affects that COSHH can have on your health. <br /><br />6. PPE - Find out about the various types of PPE and the importance of using them.<br /><br />7. Machinery Safety - This section covers the importance of being very careful when it comes to using machinery at work. <br /><br />8. DSE - The correct set up of workstations and the consequences of incorrect workstation set up. <br /><br />9. Statements and Assessments - You will briefly cover risk assessments and good working practice.<br /><br />10. Safety Signs - This section will cover various types of safety signs found in the workplace. <br /><br />11. Health and Welfare - Find out about Health and Welfare. <br /><br />12. Emergency Procedures - Covers the importance of knowing the correct emergency procedures.<br /><br />(Duration: 25 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(240, 'Introduction to Health and Safety', '<p class="MsoNormal">Did you know that, in 2009/10, 5.1 million working days were lost due to work place injury? Accidents can and do happen, even in working environments that appear to be safe. It''s important to be aware of potential dangers and to understand their role in identifying and eliminating hazards. <br /><br />This activity gives you a basic understanding of the relevant laws, and how they affect both employees and employers. <br /><br />This activity covers subjects :<br /> <br /> â€¢ how to identify risks<br /> â€¢ manual handling<br /> â€¢ slips and trips<br /> â€¢ fire safety<br /> â€¢ using display screen equipment<br /> â€¢ what to do in the event of an accident.<br /><br />(Duration: 40 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(241, 'HTML (E-learning Video course)', '<p class="MsoNormal">Would you like to know how to use HTML code so that you can build basic level web pages? <br /><br />This activity is perfect if you want to to do any web work, from designing to developing, as you need to start with HTML. Our HTML lessons will teach you how to format text on your pages, add hyperlinks, pictures and tables. Even if you plan on using an authoring tool like Dreamweaver or WordPress, you still need to know HTML. This is where you start. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />There are four modules for this activity:<br /><br />â€¢ Text Formatting, <br /> â€¢ Hyperlinks and Graphics Lists & Tables <br /> â€¢ Advanced Tables Forms and <br /> â€¢ Web Related Technologies<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(242, 'Identifying Self Development Needs', '<p class="MsoNormal">Identifying Selfâ€‘Development Needs helps individuals take responsibility for their own development. By analysing the requirements of their job, employees can identify any gaps in their skills. The activity follows the process of creating a personal development plan, to help users work towards ''filling the gaps'' in a focused and effective way.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Understand how to assess the requirements of your job<br /> â€¢ Analyse your own strengths and weaknesses<br /> â€¢ Identify opportunities for selfâ€‘development<br /> â€¢ Identify your preferred learning style<br /> â€¢ Take ownership of your development by creating a personal development plan<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2015', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(243, 'Illustrator CC (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to create smooth and professional graphics for web sites, business cards, flyers, brochures, logos, and other graphic artwork? Here you''ll learn how to use Adobe Illustrator and all of its best features. Along the way, you''ll also learn some design theory and how to quickly match colours. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />This activity has three levels and each level has two modules:<br /><br />BEGINNER LEVEL:<br /><br />â€¢ Drawing Basic Shapes <br /> â€¢ Bezier Curves & Colours <br /><br />INTERMEDIATE LEVEL:<br /><br />â€¢ Brushes & Transformation Effects Text,<br /> â€¢ Gradients, Patterns & Blends<br /><br />ADVANCED LEVEL: <br /><br />â€¢ Using Layers, Symbols and Photographs <br /> â€¢ Using Illustrator with the Web<br /><br />(Duration: 3 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(244, 'Improving Your Verbal Communication Skills', '<p class="MsoNormal">This course is about improving your verbal communication skills.<br /><br />When you have completed this activity, you will be able to:<br /> <br /> â€¢ Learn to listen carefully to the customer in order to provide the correct response during a conversation<br />â€¢ Learn to compact explanations to deliver information concisely and the importance of speaking slowly and clearly<br />â€¢ Exploring terms that should be avoided or encouraged when holding a conversation with a customer<br />â€¢ How to adapt conversation to the type of customer you are dealing with<br />â€¢ How using verbal communication correctly can build rapport with customers<br />â€¢ How to calm a situation when a customer is adversely affecting other customers within the service setting<br />â€¢ The difference between speaking passively, aggressively and assertively<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(245, 'InDesign CS5 (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to use In Design CS5 and all of its best features? You''ll also learn how to use drawing tools, graphics, text frames, transparency, tables, colour gradients and other options. You''ll have creative control over newsletters, brochures and flyers. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />This activity has three levels and each level has two modules: <br /><br />BEGINNER LEVEL: <br /><br />â€¢ Working with Test and Images <br />â€¢ Laying Out Pages <br /><br />INTERMEDIATE LEVEL:<br /><br />â€¢ Advanced Text Formatting and Colour <br />â€¢ Advanced Graphics and Templates <br /><br />ADVANCED LEVEL: <br /><br />â€¢ Advanced Features <br />â€¢ Working with Long Documents<br /><br />(Duration: 2 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(246, 'InDesign CS6 (E-learning Video course)', '<p>Would you like to learn how to use In Design CS6 and all of its best features? You''ll also learn how to use drawing tools, graphics, text frames, transparency, tables, colour gradients and other options. You''ll have creative control over newsletters, brochures and flyers. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />This activity has three levels and each level has two modules: <br /><br />BEGINNER LEVEL: <br /><br />â€¢ Working with Test and Images <br />â€¢ Laying Out Pages <br /><br />INTERMEDIATE LEVEL:<br /><br />â€¢ Advanced Text Formatting and Colour <br />â€¢ Advanced Graphics and Templates <br /><br />ADVANCED LEVEL: <br /><br />â€¢ Advanced Features <br />â€¢ Working with Long Documents<br /><br />(Duration: 2 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(247, 'Induction Safety', '<p class="MsoNormal">Introduction:<br /><br />It''s a fact that we are exposed to a range of risks and hazards during a normal working day. This activity will provide the trainee with information about fire safety, PPE and safety monitoring within the workplace. <br /><br />Activity Chapters:<br /><br />1. Introduction - The importance of induction safety, applicable legislation and safety procedures. <br /><br />2. Safety at Work - Identifying the hazards and safety signs within your workplace. <br /><br />3. Fire Safety - What to do in an event of a fire, identify fire safety signs. <br /><br />4. PPE - What is PPE, different types of PPE and specific legal requirements. <br /><br />5. Safety Monitoring - Welfare measures and important points to remember when monitoring safety<br /><br />(Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(248, 'Information Awareness', '<p class="MsoNormal">In order to communicate effectively and make the right business decisions, you need to be able to absorb information and interpret it accurately.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Appreciate the importance of using physical senses to absorb data on activities and behaviours<br /> â€¢ Actively listen, and disregard distractions<br /> â€¢ Use observation and perception to gather relevant data<br /> â€¢ Recognise non-verbal cues<br /> â€¢ Interpret data to provide information to forecast developments<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(249, 'Interview Techniques', '<p class="MsoNormal">Learners will match appropriate answers to common interview questions, learn how to respond effectively to open questions and know how to talk about their skills and experience. A required outcome for this Module is that learners will participate in a practical interview activity. This may be in roleplay or they may have a mock interview with an outside organisation. The ''Practice makes perfect'' section allows learners to have the chance to practice what they have learnt about Interview Techniques.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Everything you wanted to know about interviewing<br /> â€¢ Practice makes perfect<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(250, 'Introduction to Retail', '<p>Introduction to Retail is an activity full of everything you need to know to get a good basic understanding of the retail sector. It covers what retail means, how it impacts the economy, how the sector works, and some important information on why customers matter. You''ll find it useful whatever your situation is; whether you need to know about retail because you''re looking to start your career; whether you''re working towards a qualification in retail; or whether you''re simply just interested in finding out more.<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(251, 'Keeping Your Customers Happy', '<p class="MsoNormal">This activity covers identifying your customers'' needs and expectations and delivering good customer service.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Understand the meaning of internal customers<br /> â€¢ Understand how to deliver customer service that meets/exceeds internal customer service expectations<br /> â€¢ Understand how to deal with internal customer service problems<br /> â€¢ Understand the meaning of external customers<br /> â€¢ Understand how to deal with customer service problems for external customers<br /> â€¢ Understand how to deliver customer service that meets/exceeds external customer expectations<br /> â€¢ Understand purpose of quality standards & timescales for delivering customer service<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', '');
INSERT INTO `courses` (`id`, `courseName`, `courseDetails`, `courseStartDate`, `courseEndDate`, `providerId`, `capacity`, `coursePrice`, `courseLocation`, `province`, `status`, `venueBooked`, `archived`) VALUES
(252, 'Letter Writing', '<p class="MsoNormal">Learners will understand when to use and how to construct a covering letter. They will also learn how to submit speculative applications. A required outcome for this Learning Module is that learners will produce a draft or final version of a cover letter to accompany an application. The ''Practice makes perfect'' section allows learners to have the chance to practice what they have learnt about Letter Writing.<br /> <br /> When you have completed this activity, you will be able to:<br /> <br /> â€¢ How to use this activity<br /> â€¢ Everything you wanted to know about letter writing<br /> â€¢ Practice makes perfect<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(253, 'Microsoft Lync 2010', '<p class="MsoNormal">Would you like to learn how to use Microsoft Lync 2010, an enterprise-ready communications platform? With Lync, you can keep track of your contacts'' availability, send an IM, start or join an audio, video, or web conference, or make a phone call-all through an easy to use interface. This activity will show you how to use this really useful Microsoft tool. The Microsoft Lync 2010 desktop client is available for Windows and for Mac and mobile versions are available for Windows Phone, iPhone/iPad, and Android devices. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />There are two modules in this activity: <br /><br />Introduction which includes signing in and signing out, Lync interface, managing contacts, tag for alerts and privacy settings. <br /><br />Collaboration and Meetings which includes IM conversations, conversations history, continue conversations, integrated office and desktop share.<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(254, 'Microsoft Lync 2013', '<p class="MsoNormal">Would you like to learn how to become familiar with Lync? This activity will help you understand the new face of corporate communication. Users know Lync as an instant messenger, but it does much more. This activity will show you how to maximise your use of Lync. You''ll learn how to make free calls, broadcast a meeting, or set up video chat. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning.<br /> <br /> There are two modules in this activity: <br /> <br /> Introduction including: Introduction to Lync 2013; Signing in and out of Lync; Overview of Lync 2013 interface. <br /> <br /> Collaboration and Meetings including: Lync online meetings; Presenting in an online meeting; Scheduling and ending a meeting.<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(255, 'Managing the Consequences of Change', '<p class="MsoNormal">All change results in repercussions for the organisation and the individuals within it.<br /><br />When you have completed this activity, you will be able to:<br /><br />â€¢ Understand the consequences of change<br /> â€¢ Appreciate the ripple effects of change throughout the organisation<br /> â€¢ Identify the human and financial implications for the organisation, teams, and individuals<br /><br />(Duration: 2 hours 40 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(256, 'Meeting Customers Expectations', '<p class="MsoNormal">Meeting Customers'' Expectations is an activity full of everything you need to know to get a good basic understanding of customer service. It covers the different types of customers, the importance of good communication skills, and the importance of working in a team. You''ll find it useful whatever your situation is; whether you need to know about customer service because you''re looking to start your career; whether you''re working towards a qualification in customer service; or whether you''re simply just interested in finding out more.<br /><br />(Duration: 6 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(257, 'Meetings', '<p class="MsoNormal">Attending meetings is something that many of us have to do on a daily basis. Getting the most from a meeting and making effective use of the time requires good meeting skills.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understand the different types of meetings and their relevance in communications and decision making<br /> â€¢ Prepare to contribute to a meeting<br /> â€¢ Maintain your own notes of a meeting<br /> â€¢ Follow up after a meeting to ensure effective outcomes<br /> â€¢ Make effective contributions to a meeting<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(258, 'Microsoft Visio 2010 (e-learning video course)', '<p class="MsoNormal">Would you like to learn how to create graphical diagrams, timelines, office layout plans, workflow diagrams, organizational charts, maps, flowcharts and more? This activity will also show you how Visio visually connects ideas into a flowchart form. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning.<br /><br />There are 2 modules for this activity: <br /><br />MODULE 1 <br /><br />â€¢ Introduction to Vision<br /> â€¢ Connecting Shapes <br /><br />MODULE 2 <br /><br />â€¢ Create Complex Shapes, Templates, Stencils & Styles<br /><br />(Duration: 2 hours 20 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(259, 'Microsoft Visio 2013 (e-learning video course)', '<p class="MsoNormal">Would you like to learn how to create graphical diagrams, timelines, office layout plans, workflow diagrams, organizational charts, maps, flowcharts and more? This activity will also show you how Visio visually connects ideas into a flowchart form. <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /><br />The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning.<br /><br />There are 2 modules for this activity: <br /> <br /> MODULE 1 <br /> <br /> â€¢ Introduction to Vision<br /> â€¢ Connecting Shapes <br /> <br /> MODULE 2 <br /> <br /> â€¢ Create Complex Shapes, Templates, Stencils & Styles<br /><br />(Duration: 1 hour 15 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(260, 'Nonverbal Communication', '<p class="MsoNormal">In your role, you need to be able to be able to communicate effectively with your team and accurately interpret what people are really saying to you.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Identify range of non-verbal and behavioural factors which affect people.<br />â€¢ Assess impact of different behaviours in the workplace.<br />â€¢ Interpret non-verbal signals from others.<br />â€¢ Assess impact of appearance and mannerisms in the workplace.<br /><br />(Duration: 2 hours 50 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(261, 'Microsoft Office 365 (e-learning video course)', '<p class="MsoNormal">Would you like to learn how to use Office 365 and all of its best features? Learning Office 365 will allow you to join forces more easily when sharing files and managing projects. You''ll be able to access your email, Outlook calendar, and work computer from any other computer, the web, or smart device like your phone or tablet device! <br /><br />This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /><br />There are a range of topics covered in this activity which include: <br /><br />â€¢ What is Office 365? <br /> â€¢ Office 365 Plans <br /> â€¢ System Requirements <br /> â€¢ User Interface <br /> â€¢ Adding New Users <br /> â€¢ Changing Mailbox<br /> â€¢ Setting Up Teamsite <br /> â€¢ Setting Up Lync <br /> â€¢ Using Outlook Web App <br /> â€¢ Intro to Sharepoint<br /> â€¢ Using Web Apps<br /><br />(Duration: 1 hour 15 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(262, 'Office Safety', '<p class="MsoNormal">Provide your office workers with a concise look at the key Health and Safety areas they should be aware of on a day to day basis. <br /> <br /> CHAPTERS: <br /> <br /> 1. Fire Safety - The different types of fires and correct extinguishers to use. <br /> <br /> 2. Manual Handling - Identifying the Manual Handling process. <br /> <br /> 3. Computer Safety - Following a few important guides for a safer workstation. <br /> <br /> 4. Slips, Trips and Falls - What is a Slip, Trip and Fall? <br /> <br /> 5. Electrical Awareness - Find out what to do if you feel there is a fault with some of your equipment<br /> <br /> 6. Office Security - This section will cover office security and reporting theft.<br /><br />(Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(263, 'One-to-One Communication', '<p class="MsoNormal">In order to manage your team effectively and gather the information needed to make the right decisions, you need excellent one-to-one communication skills.<br /><br />When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand the importance of one-to-one communication.<br />â€¢ Select the most appropriate method(s) to communicate with individuals in given situations.<br />â€¢ Prepare to communicate with an individual.<br />â€¢ Communicate appropriately and effectively with individuals in your area of responsibility.<br />â€¢ Communicate appropriately and effectively with individuals outside your area of responsibility and outside the organisation.<br />â€¢ Maintain appropriate records of one-to-one communications.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(264, 'Organising Yourself', '<p class="MsoNormal">This activity looks at how you can organise yourself better by setting objectives and planning your work. The activity begins by exploring why it''s important for team leaders to be organised and the main stages involved in getting more organised at work. You will be shown how setting objectives can help and how you can reach your goals by managing your time more effectively, prioritising your workload, allocating tasks to the right people and producing a schedule. Finally, learners will look at why it''s important to be flexible and adaptable to changing circumstances and learn lots of new techniques to stay organised!<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(265, 'Organisational Culture', '<p class="MsoNormal">On the face of it some organisations seem almost identical. But you don''t have to dig too deeply to discover that organisations that seem the same from the outside can prove to be very different indeed on the inside.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand organisational cultures and their impact upon managers.<br />â€¢ Identify and describe the dominant culture within your organisation and the management styles which embody the culture.<br />â€¢ Understand the impact of "subcultures" within teams and departments.<br />â€¢ Appreciate the value of empowerment, delegation and leadership in managing the team subculture.<br /><br />(Duration: 3 hours 15 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(266, 'People as a Resource', '<p class="MsoNormal">In your role, you need to be able to get the most out of the people in your team by managing them effectively and providing them with the support they need to achieve their objectives.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Plan the activities of work team members to achieve organisational objectives.<br /> â€¢ Organise people''s work activities in an efficient and effective manner.<br /> â€¢ Identify staffing needs and make recommendations on staffing levels.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(267, 'Photoshop CC (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to make your photos shine and stand out? <br /> <br /> Photoshop is widely regarded as the premier photo editing and design software. In this activity you''ll learn how to manipulate, enhance, and edit photos in ways that will amaze you! <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /> <br /> The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /> <br /> There are four levels to this activity and each level has two modules eachâ€¦ <br /> <br /> BEGINNER LEVEL: <br /> <br /> Making Selections Layers & Tools <br /> <br /> INTERMEDIATE LEVEL:<br /> <br /> Masks & Channels <br /> Correcting Images <br /> <br /> ADVANCED LEVEL:<br /> <br /> Working with Digital Images <br /> Creative Features and Techniques <br /> Design File Setup <br /> <br /> ADVANCED LEVEL 2:<br /> <br /> Creating Web Graphics<br /> Prepping Designs for the Web<br /><br />(Duration: 5 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(268, 'Photoshop CS5 (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to make your photos shine and stand out? <br /> <br /> Photoshop is widely regarded as the premier photo editing and design software. In this activity you''ll learn how to manipulate, enhance and edit photos in ways that will amaze you! <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /> <br /> The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning <br /> <br /> There are four levels to this activity and each level has two modules eachâ€¦<br /> <br /> BEGINNER LEVEL: <br /> <br /> Making Selections Layers and tools <br /> <br /> INTERMEDIATE LEVEL:<br /> <br /> Masks and Channels <br /> Correcting Images<br /> <br /> ADVANCED LEVEL: <br /> <br /> Working with Digital Images <br /> Creative Features and Techniques <br /> Design <br /> <br /> ADVANCED LEVEL 2:<br /> <br /> Creating Web Graphics <br /> Prepping Designs for the Web<br /><br />(Duration: 5 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(269, 'Photoshop CS6 (E-learning Video course)', '<p>Would you like to learn how to make your photos shine and stand out? <br /> <br /> Photoshop is widely regarded as the premier photo editing and design software. In this activity you''ll learn how to manipulate, enhance and edit photos in ways that will amaze you! <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /> <br /> The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /> <br /> There are four levels and each has various modules...<br /> <br /> BEGINNER LEVEL: <br /> <br /> Introduction<br /> Tour<br /> Zoom<br /> Lasso<br /> Quick Selection<br /> Inverse And Save Selection<br /> Multiple Undos <br /> Refine Smooth Edge<br /> Refine Soft Edge<br /> Layers<br /> Transform<br /> Resize<br /> History Panel<br /> Painting<br /> Eyedropper<br /> Airbrush Faces <br /> <br /> INTERMEDIATE LEVEL: <br /> <br /> Layer Mask Intro<br /> Using Layer Masks<br /> Masks And Effects<br /> Blending Modes<br /> Wrap<br /> Filters<br /> Filters Gallery <br /> Vibrance<br /> Selections And Colours<br /> Sharpen<br /> Blur<br /> Content Aware Fill And Patch<br /> Liquefy Basics<br /> Liquefy Face Smile<br /> Liquefy Face General<br /> Liquefy Face Eyes <br /> <br /> ADVANCED LEVEL: <br /> <br /> Adobe Bridge<br /> Photomerge<br /> Playing Action<br /> Recording Actions<br /> Batch Process<br /> Red Eye<br /> Black And White <br /> Design File Setup<br /> Vector Vs Bitmap<br /> Drawing Tools<br /> Manage Layers<br /> Effects<br /> Gradients<br /> Combine And Chop Paths<br /> Patterns, Advanced Text <br /> <br /> ADVANCED LEVEL 2:<br /> <br /> Introduction<br /> Web Image Types<br /> Saving Web Types <br /> Tracing Images<br /> Slicing Intro<br /> Smart Objects<br /><br />(Duration: 5 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(270, 'Planning and Organising the Team''s Work', '<p>To get the best out of your team, you need to be able to plan and organise their work effectively. In this activity, you''ll examine the stages involved in planning and organising your team''s work. You''ll discover how to set good objectives and targets for your team and how to use your resources effectively. You''ll also explore how you can monitor progress and take action to achieve your objectives. The activity incorporates a range of supporting material to help you develop your skills, including web links and resources, as well as case study scenarios and an action plan to help you apply your knowledge to real situations.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(271, 'Planning and Preparation', '<p>Â </p> <p>Â </p> <p class="MsoNormal">This activity looks at the principles of change management, focusing on the reasons for change, and planning for effective change.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Identify reasons which prompt change<br /> â€¢ Identify and plan activities to achieve change.<br /> â€¢ Identify and plan the resource implications of change.<br /> â€¢ Identify and plan the timescale for achieving objectives.<br /> â€¢ Plan communication and involvement to facilitate effective change.<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(272, 'Planning Development', '<p class="MsoNormal">Organisations frequently need to train and develop their staff, not least because the commercial environment is constantly changing.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Identify development needs in conjunction with the staff concerned.<br /> â€¢ Understand a range of approaches and techniques and their application in the workplace.<br /> â€¢ Agree development plan(s) with staff to meet their identified needs, taking account of resource implications.<br /><br />(Duration: 4 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R720.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(273, 'Planning to Recruit', '<p class="MsoNormal">Recruitment is one of the most important activities that businesses carry out.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand organisational recruitment policies and procedures.<br /> â€¢ Understand the legal aspects of recruitment.<br /> â€¢ Carry out a job analysis relevant to your area of responsibility.<br /> â€¢ Prepare a job description for a post within your area of responsibility.<br /> â€¢ Prepare a person specification for a post within your area of responsibility.<br /> â€¢ Select the optimum method to attract suitable applicants for a post within your area of responsibility.<br /><br />(Duration: 4 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(274, 'Planning Work', '<p class="MsoNormal">Planning Work helps managers understand why and how a good plan works. It''s an ideal starter activity that shows managers how to break down any task or project into its component parts and map out a clear route through the process.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand the three key stages involved in planning a project: Defining Your Objective, Planning the Work and Monitoring and Evaluating<br /> â€¢ Describe the elements you need to consider when defining your objectives<br /> â€¢ Define how you can break down and schedule the individual tasks and activities involved in completing any piece of work<br /> â€¢ Describe how to define your plans in a central Work Plan<br /> â€¢ Understand how to monitor and evaluate progress against your Work Plan in order to identify any problems and modify your plans<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(275, 'Problem Solving at Work', '<p class="MsoNormal">In this activity, you will be taught how to deal with work related problems, whether these arise on a regular basis or occasionally.<br /><br />When you have completed this activity you will be able to:<br /><br />â€¢ Understanding work problems<br /> â€¢ Finding solutions<br /> â€¢ Communicating solutions<br /> â€¢ Reviewing your actions<br /><br />(Duration: 4 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(276, 'Problem Solving Skills', '<p class="MsoNormal">This activity is an ideal introduction to a set of tools, theories and techniques for solving problems effectively. It shows you how to take a systematic approach to any kind of problem, identify root causes and implement creative and enduring solutions.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Identify the root of a problem<br /> â€¢ Evaluate solutions using different techniques.<br /> â€¢ Use a number of tools to find creative solutions to problems<br /> â€¢ Describe how to distinguish between the problem and its symptoms<br /><br />(Duration: 6 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(277, 'Questionnaire Design and Analysis', '<p class="MsoNormal">In order to make informed business decisions, it''s often vital that you know the views and preferences of groups of people for example, your customers, suppliers, or even fellow staff. But how can you find out what people really think?<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand the purpose of questionnaires<br /> â€¢ Select a representative sample<br /> â€¢ Explain factors which contribute to optimum response rates<br /> â€¢ Design and pilot a questionnaire<br /> â€¢ Analyse the results<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(278, 'QuickBooks 2010 (E-learning Video course)', '<p>Would you like to become more familiar with QuickBooks accounting software? This activity teaches you how to use QuickBooks to manage your company''s finances more efficiently. QuickBooks can lead you through simple step by step procedures to set up your company files. Data entry is quick, consistent, and accurate with features that work together to help you manage your company''s finances efficiently. <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn.<br /> <br /> Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /> <br /> There are two levels to this activity, and each level has 2 modules. These areâ€¦<br /> <br /> BEGINNER LEVEL: <br /> <br /> â€¢ Starting Out Working with Sales and Income <br /> <br /> ADVANCED LEVEL: <br /> <br /> â€¢ the Vendor<br /> â€¢ the Customer<br /> â€¢ Employee Centres Working with Sales and Income<br /><br />(Duration: 6 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(279, 'QuickBooks 2013 (E-learning Video course)', '<p class="MsoNormal">Would you like to become more familiar with QuickBooks accounting software? This activity teaches you how to use QuickBooks to manage your company''s finances more efficiently. QuickBooks can lead you through simple step by step procedures to set up your company files. Data entry is quick, consistent, and accurate with features that work together to help you manage your company''s finances efficiently. <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn.<br /> <br /> Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /> <br /> There are two levels to this activity, and each level has 2 modules. These areâ€¦<br /> <br /> BEGINNER LEVEL: <br /> <br /> â€¢ Starting Out Working with Sales and Income <br /> <br /> ADVANCED LEVEL: <br /> <br /> â€¢ the Vendor<br /> â€¢ the Customer<br /> â€¢ Employee Centres Working with Sales and Income<br /><br />(Duration: 6 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(280, 'Race - Creating an inclusive workplace', '<p class="MsoNormal">OVERVIEW:<br /> <br /> The UK''s Equality Act 2010 makes it illegal to discriminate against employees, job seekers or trainees on the grounds of race.<br /> <br /> This online activity provides guidance on best practice in the workplace and emphasises the value of an inclusive workplace.<br /> <br /> FEATURES:<br /> <br /> This activity doesn''t just consider organisations'' and individuals'' responsibilities under the UK''s Equality Act 2010 â€“ it looks beyond compliance.<br /> <br /> The activity content and structure will ensure that your staff gain the knowledge and skills necessary to work successfully as part of a diverse team.<br /> <br /> DETAILS: <br /> <br /> This online activity will enable your staff to have a better understanding of:</p> <p>â€¢ The requirements of the UK''s Equality Act 2010.<br /> â€¢ Race and culture as being key issues within the workplace.<br /> â€¢ Appropriate behaviour in relation to creating an inclusive workplace.<br /> â€¢ The importance of equality of opportunity within the career development processes and how honest, objective appraisals will support this.<br /> â€¢ The main barriers to career development for many minority or ethnic groups.<br /> â€¢ The knowledge and skills necessary to work successfully as part of a diverse team.<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(281, 'Risk Assessment ', '<p class="MsoNormal">INTRODUCTION:<br /> <br /> This activity is to help provide understanding of risk assessments and why they are needed. Ideal for promoting the need for risk assessments in the workplace with simple and clear training. <br /> <br /> CHAPTERS:<br /> <br /> 1. Introduction: Learn about the importance of a risk assessment and the legislation surrounding them. <br /> 2. What is a Hazard? Find out what a hazard is, identifying the hazard and removing or reducing the risk of the hazard.<br /> 3. What is a Risk? This section covers what a risk is, identifying risk and reducing risk. <br /> 4. Five Key Steps: This section covers identifying the hazard, who''s at risk, evaluating the risk, record your findings monitoring and reviewing the risk. <br /> 5. Monitor and Review the Assessment: Cover elimination, safe working procedures and personal protection.<br /><br />(Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(282, 'Selecting the Right Person', '<p class="MsoNormal">Selecting staff is one of the most important activities that businesses carry out, but it''s often managed badly.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Appreciate the relative merits of internal and external applications<br /> â€¢ Prepare a shortlist from internal and external applications received for a post within your own area of responsibility<br /> â€¢ Contribute to the selection process including interviewing or alternatives<br /> â€¢ Contribute to the final selection decision<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(283, 'Self Development', '<p class="MsoNormal">In today''s highly competitive business world, the pace of change has never been faster. If you''re going to keep up, then you need to take your own self-development seriously.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Agree your development plan with specific, measurable and realistic objectives<br /> â€¢ Plan to review progress<br /> â€¢ Monitor development activities against your plan<br /> â€¢ Revise your development plan as necessary to meet objectives<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(284, 'SharePoint 2010: End User (E-learning Video course)', '<p class="MsoNormal">Would you like to become more familiar with SharePoint? This activity will teach you how to use skills to explore files libraries, team sites and to begin to use standard fundamental elements of SharePoint. <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials.<br /> <br /> The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning. <br /> <br /> There are three levels to this activity, and each level contains 2 modulesâ€¦<br /> <br /> BEGINNER LEVEL: <br /> <br /> â€¢ What is SharePoint? <br /> â€¢ Understanding SharePoint Sites <br /> <br /> INTERMEDIATE LEVEL: <br /> <br /> â€¢ Using Information in Lists <br /> â€¢ Using Documents in Libraries <br /> <br /> ADVANCED LEVEL: <br /> <br /> â€¢ Finding and Sharing Information in a Site <br /> â€¢ Integrating SharePoint and Office<br /><br />(Duration: 5 hours 15 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(285, 'SharePoint 2013: End User (E-learning Video course)', '<p class="MsoNormal">Would you like to learn how to use SharePoint, a network-based way to store files and collaborate on projects? If your office uses SharePoint, this is for you! You will learn basic navigation and how to use the features of SharePoint. <br /> <br /> This is an instructional e-learning activity, featuring a comprehensive set of easy-to-follow video lessons. You''ll see the tutor''s desktop as they explain key functions, tasks and applications. Learning is supported with printable material, suggested homework and support materials. <br /> <br /> The activity videos are designed to allow you to follow while you learn, and set tasks will enable you to try out your new skills as you learn. Topics are combined into learning "modules". You can watch individual topics (three to eight minutes) or complete the full module. You can follow your own pace or use our schedule to give structure to your learning.<br /> <br /> There are four levels to this activity, and each level contains modulesâ€¦<br /> <br /> BEGINNER LEVEL: <br /> <br /> â€¢ What is SharePoint? <br /> â€¢ Understanding SharePoint Sites <br /> <br /> INTERMEDIATE LEVEL: <br /> <br /> â€¢ Using Information in Lists <br /> â€¢ Using Documents in Libraries <br /> <br /> ADVANCED LEVEL: <br /> <br /> â€¢ Finding and Sharing Information in a Site <br /> â€¢ Integrating SharePoint and Office<br /> <br /> ADVANCED LEVEL 2:<br /> <br /> â€¢ Social Feature<br /><br />(Duration: 5 hours 15 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(286, 'Solving Customer Service Problems', '<p class="MsoNormal">This activity is about solving customer service problems and managing customer expectations.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Ensuring that the service given meets the customer''s needs and expectations<br /> â€¢ Maintaining and improving standards of service delivery by sharing information<br /> â€¢ How to recognise repeated problems and how sharing customer feedback can help identify and resolve potential problems<br /> â€¢ Identifying and confirming the options to resolve a customer problem and demonstrating how to work out the advantages and disadvantages for the customer and the organisation<br /> â€¢ The actions that need to be taken when introducing options to the customer and how to keep the customer fully informed of the decision<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(287, 'Taking Phone Calls', '<p class="MsoNormal">This activity is about how to effectively use listening, body language and voice skills to control phone calls.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand how to respond to an incoming call<br /> â€¢ Be able to effectively use listening and voice skills to control calls<br /> â€¢ How to identify and communicate the options available to the customer<br /> â€¢ Be able to effectively respond to customer questions and queries in a timely manner<br /> â€¢ Ensuring that the common procedures for placing customers on hold, taking messages and ensuring call backs are made<br /> â€¢ Effectively completing the call ensuring that the customer knows what action<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(288, 'Team Structures', '<p class="MsoNormal">The activity begins by exploring the benefits and drawbacks of teams - both for the business as a whole and for the individual team members - and the sorts of tasks most suited to teamwork. <br /><br />You will be shown the various roles and responsibilities that exist within a team, how to structure a team to take into account the different personalities and skills of those who work for you and how to lead your team from the front. <br /><br />By the end of the activity you will have a wide range of new skills - and be able to transform an existing workgroup into a highly effective team or even build a new team from scratch!<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(289, 'The Inclusive Workplace - Multiple training needs, one solution', '<p class="MsoNormal">OVERVIEW: <br /> <br /> This online activity not only enables your managers and staff to gain a quick insight into the key themes of the Equality Act 2010 and the Protected Characteristics, but also provides a practical introduction to identifying and responding to bullying and harassment and understanding the unconscious biases we all hold.<br /> <br /> FEATURES: <br /> <br /> The Inclusive Workplace emphasises that, far from being just a matter of legal compliance, Equality, Diversity and Inclusion means fostering and valuing an open and transparent culture, which encourages high performance in individuals and teams.<br /> <br /> DETAILS: <br /> <br /> The Inclusive Workplace delivers an insight and understanding of the following key themes:<br /> <br /> â€¢ Improving policy development and service delivery<br /> â€¢ Ensuring existing policies and services are reality-checked<br /> â€¢ Ensuring compliance with your legal obligations<br /> â€¢ Avoiding unlawful discrimination<br /> â€¢ Promoting trust and confidence<br /> â€¢ Race<br /> â€¢ Religion & Belief<br /> â€¢ Sexual Orientation<br /> â€¢ Bullying & Harassment<br /> â€¢ Unconscious Bias<br /><br />(Duration: 2 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(290, 'The Role of the Team Leader', '<p class="MsoNormal">Being a team leader can be challenging, but it can also be immensely rewarding. In this activity you''ll be introduced to the world of team leading. You''ll explore what teams are, how they work, and where they fit within an organisation. You''ll discover how to take your first steps as the leader of a team, and the personal skills and qualities you''ll need to develop to become an effective team leader. <br /> <br /> This activity explores what teams are, how they work, and where they fit within an organisation. It also examines the personal skills and qualities you''ll need to develop to become an effective team leader.<br /><br />(Duration: 3 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(291, 'Training', '<p class="MsoNormal">This activity provides a basic introduction to the various techniques managers can use to improve the way they train their staff, helping to ensure staff are motivated and productive.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Choose appropriate training methods to suit specific needs<br /> â€¢ Understand what training is and what it means to staff and the business<br /> â€¢ Describe how to evaluate the effectiveness of training<br /> â€¢ Keep appropriate training records<br /><br />(Duration: 2 hours 50 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(292, 'Understanding Costs', '<p class="MsoNormal">In your role as a first line manager, most of the activities that you and your team undertake will incur costs. Your challenge is to manage these costs in order to ensure that you make a positive financial contribution to the business.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Identify the elements of costs, their behaviour and the need for their control<br /> â€¢ Appreciate the value of standard costing and its role as a control mechanism<br /> â€¢ Identify, recommend and implement measures to control and/or reduce costs<br /><br />(Duration: 3 hours 50 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(293, 'Understanding Customer Service in Retail', '<p class="MsoNormal">Understanding customer service in retail is a activity full of everything you need to know to understand how important customers are to retail outlets. It covers why customer service is important, how you can make a good impression and what to do when things go wrong. You''ll find it useful whatever your situation is; whether you need to know about retail because you''re looking to start your career; whether you''re working towards a qualification in retail; or whether you''re simply just interested in finding out more.<br /><br />(Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(294, 'Understanding Customers', '<p class="MsoNormal">Understanding Customers introduces the concepts essential to delivering good customer service. This customer-focused attitude will help your business create better relationships with its customers.<br /> <br /> When you have completed this activity you will be able to:<br /> <br /> â€¢ Understand how you can develop a better understanding of their needs<br /> â€¢ Apply techniques to build and maintain effective customer relationships.<br /> â€¢ Develop a more customer-focused attitude, both within yourself and your team<br /> â€¢ Explain who your customers are<br /><br />(Duration: 1 hor 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(295, 'Understanding Unconscious Bias', '<p class="MsoNormal">OVERVIEW: <br /> <br /> This online activity is designed to raise awareness on a very difficult topic: our preferences and our bias. The premise of this activity is that unless we explore the nature of relationships, perceptions and prejudices we will never make sufficient progress to create truly diverse and inclusive organisations. It is based on the fact that we are all biased. That is everyone, without exception.<br /> <br /> FEATURES: <br /> <br /> The first part of the activity provides an overview of unconscious bias in terms of how it affects you and others. You will see a number of experiments which help illustrate the way our perceptions filter information and how this impacts on what we see and hear, what we fail to see and hear, and the judgements we make. Becoming more aware of how our brains are wired can help us understand that ''trusting our instincts'' can lead to poor decision-making. Once we acknowledge our bias, we can consciously take action to reduce its influence.<br /> <br /> The second part of the activity covers bias at work through a series of drama scenarios. The scenarios will help you understand how unconscious bias can impact on the workplace and on working relationships. Although the organisation is fictitious and the context is specific, the human interactions are quite universal, and you''ll learn a lot about biases, and how to counteract biases by studying how these people are interrelating with one another.<br /> <br /> DETAILS: <br /> <br /> The activity includes visual illusions which offer a compelling insight into how our brains process information and the shortcuts we take. This is backed up with research evidence.<br /> <br /> A drama scenario which shows how even an organisation that prides itself in "''doing the right thing''" in terms of Diversity can fall under the spell of unconscious bias. Individual scenes look at "pressure points" when bias is more likely to have an impact including recruitment, performance review and induction.<br /> <br /> This online activity is designed to:</p> <p>â€¢ Raise awareness of bias in people and organisations<br /> â€¢ Examine the impact of prejudice in decision-making<br /> â€¢ Demonstrate ways in which we can reduce, if not eliminate, bias in our decision-making<br /> <br /> (Duration: 1 hour 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(296, 'Understanding Your Organisation', '<p class="MsoNormal">This activity explains what is meant by organisational values, missions and purpose, helps you to understand the market sector of an organisation and understand how your role contributes to the success of your organisation. It also covers the importance of maintaining security and confidentiality.<br /><br />When you have completed this activity you will be able to: <br /><br />â€¢ Understand how your role fits with organisational values and practices<br /> â€¢ Be able to work in a way that fits with organisational values and practice<br /> â€¢ Understand how to maintain security and confidentiality at work<br /><br />(Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', '');
