(297, 'WordPress (e-learning video course)', '<p>WordPress is the leading web blog software. The product makes it easy to add content to your web site without being an expert. Designers also use WordPress to design dynamic sites and easily add functionality with WordPress plug-ins. The activity will show you how to use and administer a WordPress site. To install WordPress, you should have basic HTML and CSS knowledge (there are other learndirect activities that cover HTML and CSS training). You''ll learn how to post, configure, install and edit a WordPress web site. <br /> <br /> FEATURES: <br /> <br /> This is an instructional e-learning activity featuring a comprehensive set of easy-to-follow video lessons. You will see the tutor''s desktop as they explain, step by step, the key functions, tasks and applications. Learning is supported with printable material, suggested homework and other support material. The activity videos are designed to allow you to follow along while you learn, and set tasks will enable you to try out your new skills as you progress through the activity. Topics are combined into learning "modules". You can watch individual topics (3-8 minutes), follow at your own pace or use our schedule to give structure to your learning Modules. <br /> <br /> MODULE 1: INTRODUCTION <br /> <br /> â€¢ Wordpress.com vs Wordpress.org<br /> â€¢ Making a Wordpress.com account<br /> â€¢ Where to go first<br /> â€¢ The Dashboard<br /> â€¢ Posts<br /> â€¢ Lists<br /> â€¢ Post Options<br /> â€¢ Categories and Tags<br /> â€¢ Screen Options<br /> â€¢ Media Library<br /> â€¢ Media in a Post<br /> â€¢ Links in Posts<br /> â€¢ Making a new Post <br /> <br /> MODULE 2: WORDPRESS FUNCTIONS <br /> <br /> â€¢ Installing WordPress<br /> â€¢ AMP Stack<br /> â€¢ phpMyAdmin<br /> â€¢ Setup your WordPress Install<br /> â€¢ Creating A Website<br /> â€¢ Custom Themes<br /> â€¢ Widgets<br /> â€¢ Menus<br /> â€¢ Pages<br /> â€¢ Editor<br /> â€¢ WordPress Settings<br /> â€¢ Plugins<br /> â€¢ Export/Import<br /> â€¢ Updating<br /> <br /> (Duration: 2 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(298, 'Using Information for Decisions', '<p class="MsoNormal">Using Information for Decisions shows employees how to take a logical and structured approach to the decision making process. It introduces a sequence of steps designed to help plan and implement decisions so they can choose the best option and have greater confidence in the final outcome.<br /> <br /> When you have completed this activity you will be able to: <br /> <br /> â€¢ Take a logical and structured approach to planning and implementing decisions<br /> â€¢ Evaluate the options available to you and choose the best one<br /> â€¢ Implement decisions effectively <br /> <br /> (Duration: 4 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(299, 'Working in Business and Administration', '<p>Working in business and administration is a activity full of everything you need to know to get a good basic understanding of business and administration. It covers what an administrator does, organising and managing your work, and keeping information confidential. You''ll find it useful whatever your situation is; whether you need to know about business and administration because you''re looking to start your career; whether you''re working towards a qualification in business and administration; or whether you''re simply just interested in finding out more.<br /> <br /> (Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R360.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(300, 'Working to a Budget', '<p class="MsoNormal">Every organisation needs to work within budgets in order to operate effectively.<br /> <br /> When you have completed this activity you will be able to: <br /> <br /> â€¢ Monitor performance against budget<br /> â€¢ Recognise ways of reducing or eliminating unacceptable variances<br /> â€¢ Contribute to the formulation of budgets by providing relevant data and/or making appropriate recommendations <br /> <br /> (Duration: 3 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(302, 'Working with the UK''s Bribery Act', '<p>OVERVIEW: <br /> <br /> This online training course has been designed to look at the main issues around working with the UK''s Bribery Act. Bribery doesn''t necessarily have to involve money changing hands â€“ it can take many different forms. By taking this course you will gain a good understanding of all aspects of bribery.<br /> <br /> DETAILS: <br /> <br /> Bribery is defined by the UK''s Bribery Act as:<br /> <br /> "Giving or receiving a financial or other advantage in connection with the ''improper performance'' of a position of trust, or a function that is expected to be performed impartially or in good faith."<br /> <br /> FEATURES: <br /> <br /> This course will give a better understanding of:<br /> <br /> â€¢ What bribery is<br /> â€¢ Why bribery happens<br /> â€¢ Who is at risk and what the penalties are for bribery<br /> â€¢ How to spot, report and prevent bribery<br /> â€¢ What the UK''s Bribery Act says about gifts and hospitality<br /> <br /> (Duration: 50 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(303, 'Workplace Safety ', '<p>It''s a fact that we are exposed to a range of risks and hazards during a normal working day. This activity will provide the trainee with information about the various hazards within the workplace which they must be aware of. <br /><br />CHAPTER:<br /><br />1. Fire Safety - The different types of fires and correct extinguishers to use. <br /><br />2. Manual Handling - Identifying the Manual Handling process <br /><br />3. Computer Safety - Following a few important guides for a safer workstation.<br /><br />4. Slips, Trips and Falls - What is a Slip, Trip and Fall? <br /><br />5. Electrical Awareness - If you feel there is a fault with some of your equipment then you should switch it off at the mains, remove the plug and clearly label it Do Not Use. <br /> <br /> 6. Office Security - Report any incident of theft or suspicious circumstances to your manager.<br /> <br /> (Duration: 35 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(304, 'Writing a CV', '<p>Learners will understand how and when to use a CV, match sample CVs to basic job descriptions and identify relevant information to be included in a CV. A required outcome for this learning activity is that learners will produce their own CV. The ''Practice makes perfect'' section allows learners to have the chance to practice what they have learnt about Writing a CV.<br /> <br /> (Duration: 1 hour)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R240.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(305, 'Written Communications', '<p class="MsoNormal">Written Communications will help employees understand the basic principles of effective writing and give them the confidence to put their thoughts and ideas into words.<br /><br />When you have completed this activity you will be able to: <br /><br />â€¢ Understand the importance of writing effective business communications<br /> â€¢ Identify different forms of written communication and know how to use them<br /> <br /> (Duration: 3 hours 30 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R480.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(307, 'AET Communication in English', '<p>Learndirect is a global leader in technology enabled learning and a registered provider with the IEB in South Africa, delivering online education and training in English Language, Communications, Numeracy and Mathematical Literacy from Foundation level through to NQF 4. <br /><br />Leveraging innovations in learning technologies Learndirect uses graphical illustrations and interactive activities to support the learning process.<br /><br />KEY FEATURES:<br /><br />â€¢ Innovative teaching aids to assist in the illustration of concepts and methodology<br />â€¢ Practise assessments (formative and summative)<br />â€¢ Practical scenario-based teaching<br />â€¢ Individual Learner Plan (supports learner progression, remedial tuition)<br />â€¢ Progress reporting and tacking <br /><br />FOUNDATION & INTERMEDIATE ACTIVITIES:<br /><br />â€¢ Communication / Literacy (English)<br />- Reading<br />- Writing, Vocabulary, Spelling & Grammar<br /><br />ACTIVITY STRUCTURE:<br /><br />â€¢ Tutorials<br />- E-learning knowledge based tutorials which vary in length from 5 mins to Â½ hour.<br />- All questions in the tutorials give comprehensive feedback for wrong answers.<br />- Use free text entry questions to enable the learners to practice the skills of writing and showing out the working of calculations.<br style="mso-special-character: line-break;" /> <br />â€¢ Practice activities<br />- Pdf activities provide practice of the skills and knowledge covered in the tutorials and fact sheets. Practice activities are self-marked so the learner can use them as a tool for learning and build their confidence. The activities are all pdf based so the learner can continue to develop their writing skills and show their workings out.<br /><br />â€¢ Quiz<br />- Each lesson has an e-learning quiz of 8-10 multiple choice questions. The quiz can be used for both the learner and tutor to assess progress. If the learner doesn''t score well, the tutor can point them back to tutorials or get them to do more practice.<br />- The quiz does not save any scores as it is designed to be a moment in time knowledge check for the learner that can be repeated as many times as necessary.<br /><br />â€¢ Learning practice test<br />- These are very comprehensive and challenging activities that will help the tutor to see if the learner is ready to move from learning into test or assessment preparation. These are self-marked.<br /><br />(Duration: 30 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R1,440.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(309, 'FLC Communication in English', '<p class="MsoNormal">Learndirect is a global leader in technology enabled learning and a registered provider with the IEB in South Africa, delivering online education and training in English Language, Communications, Numeracy and Mathematical Literacy from Foundation level through to NQF 4. <br /><br />Leveraging innovations in learning technologies Learndirect uses graphical illustrations and interactive activities to support the learning process.<br /><br />SENIOR & FET ACTIVITIES:<br /><br />â€¢ Diagnostic:<br />- Each programme incorporates the Level Checker and Skills Checker<br />- The Level Checker and Skills Checker are the based on the Forskills diagnostic tools<br />- Once completed an individualised learning plan is created for the learner based on the results <br /><br />â€¢ Communication / Literacy (English)<br />- Reading<br />- Writing<br />- Speaking & Listening<br /><br />ACTIVITY STRUCTURE:<br /><br />â€¢ Tutorials<br />- E-learning knowledge based tutorials which vary in length from 5 mins to Â½ hour.<br />- All questions in the tutorials give comprehensive feedback for wrong answers.<br />- Use free text entry questions to enable the learners to practice the skills of writing and showing out the working of calculations.<br /><br />â€¢ Fact sheets<br />- Fact sheet pdfs complement tutorials or provide information that is better covered in a pdf.<br /><br />â€¢ Practice activities<br />- Pdf activities provide practice of the skills and knowledge covered in the tutorials and fact sheets. Practice activities are self-marked so the learner can use them as a tool for learning and build their confidence. The activities are all pdf based so the learner can continue to develop their writing skills and show their workings out.<br /><br />â€¢ Quiz<br />- Each lesson has an e-learning quiz of 8-10 multiple choice questions. The quiz can be used for both the learner and tutor to assess progress. If the learner doesn''t 