he learner and tutor to assess progress. If the learner doesn''t score well, the tutor can point them back to tutorials or get them to do more practice.<br />- The quiz does not save any scores as it is designed to be a moment in time knowledge check for the learner that can be repeated as many times as necessary.<br /><br />â€¢ Learning practice test<br />- These are very comprehensive and challenging activities that will help the tutor to see if the learner is ready to move from learning into test or assessment preparation. These are self-marked.<br /><br />(Duration: 72 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R1,920.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(312, 'MS Excel 2013 Complete (7 modules) ', '<p class="MsoNormal">This interactive collection of activities will provide you with a comprehensive understanding of Microsoft Excel 2013 and will lead you through the essential and advanced tasks associated with creating cell data, formatting cells and worksheets. Software simulations combined with easy-to-follow examples and exercises will take you through all the main aspects of the world''s most popular spreadsheet application.<br /><br />You''ll have access to this activity collection for six months from the date of purchase â€“ giving you plenty of time to complete your learning.<br /><br />FEATURES:<br /><br />â€¢ Perform tasks at your own pace by following easy step-by-step actions.<br /> â€¢ Test your knowledge at the end of each lesson by completing interactive and multiple choice quiz questions.<br /> â€¢ Assess your skills at any time by undertaking the Activity Test. <br /> â€¢ Complete lessons within 30 minutes so training can be undertaken in bitesize pieces.<br /> â€¢ Learn in multiple training sessions with bookmarking.<br /> â€¢ Access this activity online 24 hours a day.<br /><br />MODULES:<br /><br />The bundle of activities are as follows:<br /> <br /> â€¢ Level 1 - Introduction and Basics; Starting Excel and help, Screen components, Navigating workbooks, Viewing tools and Excel options, Creating workbooks, Opening, saving and closing<br /> <br /> â€¢ Level 2 - Cells and Worksheets; Cell Selection Techniques, Moving and Copying Data, Adding and Removing Cells, Searching and Sorting Data, Cell Formatting, Using Multiple Worksheets<br /> <br /> â€¢ Level 3 - Views and Layouts; Excel Views, Custom Views and Power View, Importing, Forms and Exporting, Working with Hyperlinks, Workbook Properties, Headers, Previewing and Page Setup, Print Place<br /> <br /> â€¢ Level 4 - Formatting and Proofing; AutoFill and Paste Options, Modifying Worksheets, Cell and Table Styles, Formatting Worksheets, Applying Themes, Proofing Tools, Flash Fill and Macros<br /> <br /> â€¢ Level 5 - Formulas and Functions; Formulas and referencing, Working with functions, Logical and informational functions, More logical functions, Named ranges, Financial functions and data tables, Text functions<br /> <br /> â€¢ Level 6 - Presenting Data Visually; creating and modifying charts, adding illustrations, shapes, clip art and sparklines, outlining worksheets<br /> <br /> â€¢ Level 7 - Sharing and Validating Data; use comments, share workbooks, sort and filter, use custom formats and validate data<br /><br />(Duration: 18 hoours 25 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R792.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(313, 'MS Word 2013 Complete (6 modules)', '<p>This interactive collection of activities will provide you with a comprehensive understanding of Microsoft Word 2013 and will lead you through the essential and advanced tasks associated with creating documents. Software simulations combined with easy-to-follow examples and exercises will take you through all the main aspects of the world''s most popular word processing application.<br /><br />You''ll have access to this activity collection for six months from the date of purchase â€“ giving you plenty of time to complete your learning.<br /><br />FEATURES:<br /><br />â€¢ Perform tasks at your own pace by following easy step-by-step actions.<br />â€¢ Test your knowledge at the end of each lesson by completing interactive and multiple choice quiz questions.<br />â€¢ Assess your skills at any time by undertaking the Activity Test.<br />â€¢ Complete lessons within 30 minutes so training can be undertaken in bitesize pieces.<br />â€¢ Learn in multiple training sessions with bookmarking.<br />â€¢ Access this activity online 24 hours a day.<br /> <br /> MODULES;<br /> <br /> The bundle of activities are as follows:<br /> <br /> â€¢ Level 1 - Introduction and Basics; Starting Word, create documents, open documents, and navigate between them. You will also use templates, save documents in other formats and modify Word options<br /> <br /> â€¢ Level 2 - Importing, Navigation and Formatting; Import documents, and use Bookmarks, Cross-references and Hyperlinks. You will also add, Backgrounds, Themes, Headers and Footers and Watermarks<br /> <br /> â€¢ Level 3 - Paragraphs and Page Layout; Format Text and Paragraphs, and apply Styles, Hyphenation and Spacing. You will also adjust Page Margins, Insert Breaks and work with Columns and Text Boxes<br /> <br /> â€¢ Level 4 - Managing Documents; Find and Replace, Manipulate Text, and create Lists and insert Symbols. You will also Protect Files and Share documents, as well as Viewing Tools and Macros<br /> <br /> â€¢ Level 5 - Tables and References; create, modify and format Tables using styles. You will also insert Captions, Footnotes/Endnotes, Citations, and create a Bibliography<br /> <br /> â€¢ Level 6 - Objects and Printing; insert Building Blocks, WordArt, SmartArt and use Drawing Tools. You will also add and format Pictures, add Document Properties and use Printing options<br /> <br /> (Duration: 18 hours 45 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R1,008.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(315, 'MS Access 2013 Complete (5 modules)', '<p>Access 2013 is a Microsoft Office database management program that makes it easy to store and find information, analyse data and create accurate reports. Using Access you can easily create databases to help manage business operations, products and customer information.<br /><br />This course collection will provide comprehensive training for Access 2013. You''ll learn about:<br /><br />â€¢ the key functions of the access environment and the construction and application of tables<br />â€¢ data manipulation within Access 2013<br />â€¢ data entry, display and manipulation using forms<br />â€¢ the design, creation and use of reports<br /><br />You''ll learn how to perform tasks at your own pace by following easy step-by-step actions. You can complete your training in bitesize chunks with 30 minute lessons.<br /><br />Bookmarking allows you to dip in and out, so you can learn whenever suits you, plus you can jump directly to specific topics of interest quickly and easily.<br /><br />You''ll test your knowledge at the end of each lesson by completing multiple choice quiz questions.<br /><br />You''ll have access to this module collection for six months from the date of purchase â€“ giving you plenty of time to finish your activity.<br /><br />MODULES:<br /><br />The bundle of activities are as follows:<br /><br />â€¢ Level 1 - Basic database tasks Starting Access and Help, Screen Components, Database Basics Using Templates, Previewing and Printing, Exporting Data<br /> <br /> â€¢ Level 2 - Managing the access environment and building tables, Managing the Access Environment, Managing Databases, Backup and Splitting Databases, Building Tables, Table Basics including Table Design, Table Relationships; Importing Data, Access Options, Modifying Options<br /> <br /> â€¢ Level 3 - Sorting and filtering records and creating and managing queries, Finding, Sorting and Filtering including Finding and Filtering Data and Sorting Records, Creating and Managing Queries Creating Basic Queries including Multiple Table Queries; Additional Query Options and Action Queries<br /> <br /> â€¢ Level 4 - Building forms Creating and Using Forms, Modifying Forms and Controls, Creating Navigation Forms, Form Design and Formatting, Adding Controls to Forms, Sorting, Filters and Printing<br /> <br /> â€¢ Level 5 - Designing reports Using the Report Wizard, Modifying Reports, Creating Reports in Design View, Using Calculated Controls, Blank Reports and Formatting Tools, Finding, Sorting and Filtering<br /> <br /> (Duration: 17 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R792.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(316, 'MS PowerPoint 2013 Complete (6 modules)', '<p class="MsoNormal" style="margin-bottom: .0001pt;">In this comprehensive and easy-to-follow training programme, you''ll quickly learn the essential presentation tasks using PowerPoint 2013 and progress to the more advanced features to enhance your presentations. You''ll also find out how to use graphical and multimedia elements. You''ll learn how to create charts and tables and collaborate, prepare and deliver presentations.<br /><br />You will also learn how to perform tasks at your own pace by following easy step-by-step actions. <br /><br />Within the activity, bookmarking allows you to dip in and out, so you can learn whenever suits you, plus you can jump directly to specific topics of interest quickly and easily. You''ll also be able to test your knowledge at the end of each lesson by completing multiple choice quiz questions.<br /><br />You''ll have access to this activity for six months from the date of purchase â€“ giving you plenty of time to finish your activity.<br /><br />MODULES:<br /><br />This activity collection is comprised of the following modules:<br /><br />â€¢ Level 1 - Introduction and basics Starting PowerPoint and Help, Screen Components Presentation Views, Navigating Presentations, Creating Presentations, Using Themes and Templates, PowerPoint Options<br /><br />â€¢ Level 2 - Creating presentations Slide Development, Opening, Saving and Closing, Moving and Copying, Formatting Text, Changing Slide Backgrounds, Using Slide Masters<br /><br />â€¢ Level 3 - Slide content Adding and Removing Slides, SmartArt and Hyperlinks, Headers/Footers and Sections, Formatting Text Boxes, Photo Albums, Printing Options<br /><br />â€¢ Level 4 - Graphics and multimedia Adding Clip Art and Images, Formatting Shapes Manipulating Shapes, Editing Images, Organization Charts, WordArt and SmartArt, Manipulating Video and Audio<br /><br />â€¢ Level 5 - Charts and animation Adding Clip Art and Images, Constructing Tables Modifying and Importing Tables, Creating Charts, Markers and Legends, Axis Titles and Data Labels Transition and Animation Effects, Modifying Animations<br /><br />â€¢ Level 6 - Reviewing and presenting Reviewing and Comparing, Proofing Presentations Protecting and Publishing, Presentation Tools, Custom Shows, Setting Up Slide Shows<br /><br />(Duration: 18 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R792.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(317, 'MS Outlook 2013 Complete (4 modules)', '<p class="MsoNormal" style="margin-bottom: .0001pt;">Would you like to gain a comprehensive understanding of Outlook 2013? With this activity collection you will quickly learn the basics of Outlook 2013, and how to create and format messages, manage contacts, folders and the Calendar.<br /><br />All of the advanced features are also covered, ensuring that you can use Outlook to communicate and organise effectively.<br /><br />FEATURES:<br /><br />â€¢ Perform tasks at your own pace by following easy step-by-step actions.<br />â€¢ Test your knowledge at the end of each lesson by completing interactive and multiple choice quiz questions.<br />â€¢ Assess your skills at any time by undertaking the Activity Test.<br />â€¢ Complete lessons within 30 minutes so training can be undertaken in bitesize pieces.<br />â€¢ Learn in multiple training sessions with bookmarking.<br />â€¢ Access this activity online 24 hours a day<br /><br />MODULES:<br /><br />The four modules that make up this activity are:<br /><br />â€¢ Level 1 - Introduction and Basics starting Outlook and help, screen components navigating in Outlook, folder overview, Outlook options, message tools, working with messages<br /><br />â€¢ Level 2 - Messages and Formatting Creating Messages, Formatting and Sending Responding to Messages, Stationery and Templates, Creating Styles and Themes, Multiple Accounts and Delivery Options<br /><br />â€¢ Level 3 - Managing Messages and Contacts Using Signatures, Save As and Cleanup Tools, Junk Mail, Sorting and Quick Parts, Creating and Managing Folders, Adding Contacts, Creating Contact Groups, Working with Contacts, Creating Address Books, Working with Contact Groups<br /><br />â€¢ Level 4 - Calendar and Other Folders Entering Basic Appointments, Other Types of Appointments, Scheduling Meetings, Adding Events, Sharing and Managing Calendars, Delegates Creating and Managing Tasks, Using Notes, The Journal<br /><br />(Duration: 12 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R792.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(318, 'MS Project 2010 Complete (5 modules)', '<p class="MsoNormal" style="margin-bottom: .0001pt;">In this comprehensive and easy-to-follow training programme, you''ll quickly learn the essential tasks using Project 2010 and progress to the more advanced features to enhance your project management skills. You''ll also find out how to use graphical and multimedia elements.<br /><br />You will also learn how to perform tasks at your own pace by following easy step-by-step actions. You can complete your training in bitesize chunks.<br /><br />Within the activity, bookmarking allows you to dip in and out, so you can learn whenever suits you, plus you can jump directly to specific topics of interest quickly and easily. You''ll also be able to test your knowledge at the end of each lesson by completing multiple choice quiz questions.<br /><br />MODULES:<br /><br />This activity collection is comprised of the following modules:<br /><br />â€¢ Level 1 - Introduction and Views; Starting Project and Help Options, Screen Components, Sheet and Form Views, Chart and Rollup Views, Combination Views<br /><br />â€¢ Level 2 - Creating Projects; Templates and Manual Scheduling, Working with Tasks, Durations and Calendars, Relationships and Dependencies, Setting Constraints and Deadlines, Assigning Resources<br /><br />â€¢ Level 3 - Formatting Projects; Formatting Gantt Charts, Formatting the Network Diagram, Formatting in Calendar View, Formatting Tables, Graphics and Drawing Tools<br /><br />â€¢ Level 4 - Viewing and Updating Data; Sorting and Grouping Tasks, Using WBS and Outline Codes, Applying Filters, Material Resources and Baselines, Modifying Projects, Project Options<br /><br />â€¢ Level 5 - Sharing and Master Projects; Import/Export Maps, Exporting Data from Project, Importing Data into Project, Creating Master Projects, Working with Master Projects<br /> <br /> (Duration: 11 hours 50 minutes)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R2,400.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
(319, 'Afrikaans - Talk Now', '<p>INTRODUCTION: <br /> <br /> This activity engages both the logical and creative sides of your brain by combining words in visual and audio form to understand context, improve your memory and help you to remember key words and phrases. The goals are achievable and broken down into a series of rewarding challenges. As you play interactive games, you will be fed new words and pictures to reinforce your memory, and then test your knowledge with quizzes. <br /> <br /> You''ll hear your new language constantly and, using the recording games, you can start speaking right away, and compare your voice to a native speaker. Even if English isn''t your first language, you can set an activity''s "help and support" to any of the 100 languages as soon as you start. <br /> <br /> The areas covered in this activity will assist you toâ€¦<br /> <br /> â€¢ Order food and drink <br /> â€¢ Ask for directions <br /> â€¢ Describe food, colours, shopping, parts of the body, numbers, telling the time and countries <br /> â€¢ Develop a wide vocabulary <br /> <br /> (Duration: 20 hours)</p>', '01/01/2016', '31/12/2016', 3226, 10000, 'R600.00', 'Nationwide', 'Western Cape', 'Y', '', ''),
