(15, 25, 'Assessor Training NQF 5 ', '<p>Assessor are in great demand in the training and development field, either working for large companies or as consultants. This course focuses on giving you the necessary knowledge and skills in conducting outcomes-based assessments in line with your area of expertise.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: National Certificate Occupationally Directed&nbsp;Education Training and Development Practices (NQF 5)&nbsp;&nbsp;</p>', '11/13/2013', '11/13/2013', 47, 20, '0', 'Cape Town', 'Y', '', '1384729200'),
(16, 26, 'Moderator NQF 6', '<p>It is the responsibility of the Moderator to moderate assessments according to relevant outcome statements and quality assurance requirements. The responsibility of the&nbsp;Moderator is significant and they need to meet a high standard of criteria and have to be registered&nbsp;before they are allowed to moderate. this practical course will equip learners with the knowledge and skills to conduct moderation of outcome-based assessment.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: national Certificate: Occupationally Directed Education Training and Development Practices (NQF&nbsp;5)&nbsp;&nbsp;&nbsp;&nbsp;</p>', '11/06/2013', '11/06/2013', 47, 20, '0', 'Cape Town', 'Y', '', '1384729200'),
