(194, 26, 'Moderator NQF 6', '<p>It is the responsibility of the Moderator to moderate assessments according to relevant outcome statements and quality assurance requirements. The responsibility of the&nbsp;Moderator is significant and they need to meet a high standard of criteria and have to be registered&nbsp;before they are allowed to moderate. this practical course will equip learners with the knowledge and skills to conduct moderation of outcome-based assessment.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: national Certificate: Occupationally Directed Education Training and Development Practices (NQF&nbsp;5)&nbsp;&nbsp;&nbsp;&nbsp;</p>', '06/11/2013', '06/11/2013', 47, 20, '0', 'Cape Town', 'Y', 'N', '1431381600'),
(195, 27, 'Facilitating Learning (TtT) NQF L5', '<p>Completing this unit standard will provide recognition for ehose who facilitate or intend to facilitate learning using a variety of given methodologies. Formal recognition will enhance thier employability and also provide a means to identify competent learning facilitators.&nbsp;</p>', '09/12/2013', '09/12/2013', 47, 20, '0', 'Cape Town', 'Y', 'N', '1431381600'),
(196, 26, 'Moderator NQF 6', '<p>It is the responsibility of the Moderator to moderate assessments according to relevant outcome statements and quality assurance requirements. The responsibility of the&nbsp;Moderator is significant and they need to meet a high standard of criteria and have to be registered&nbsp;before they are allowed to moderate. this practical course will equip learners with the knowledge and skills to conduct moderation of outcome-based assessment.</p>\r\n<p>Credits contribute towards the following qualification:</p>\r\n<p>50334: national Certificate: Occupationally Directed Education Training and Development Practices (NQF&nbsp;5)&nbsp;&nbsp;&nbsp;&nbsp;</p>', '06/11/2013', '06/11/2013', 47, 20, '0', 'Cape Town', 'Y', 'N', '1431381600'),
(197, 27, 'Facilitating Learning (TtT) NQF L5', '<p>Completing this unit standard will provide recognition for ehose who facilitate or intend to facilitate learning using a variety of given methodologies. Formal recognition will enhance thier employability and also provide a means to identify competent learning facilitators.&nbsp;</p>', '09/12/2013', '09/12/2013', 47, 20, '0', 'Cape Town', 'Y', 'N', '1431381600'),
