INSERT INTO `forum` (`id`, `userId`, `comment`, `dateAdded`, `topic`, `status`) VALUES
(1, 3, 'I am using the forum to complain about the price of Doc martens', '10/03/2013', 2, 'Offensive'),
(5, 3, '<p>gfhgfhgtfhf</p>', '10/15/2013', 2, 'Offensive'),
(6, 3, '<p>I was very happy with the course on Customer Retention. &nbsp;It has opened my eyes to the potential of...retaining customers.</p>', '10/15/2013', 4, 'Offensive'),
(7, 14, '<p>The Forum system is working great. Its really quick.&nbsp; I hope that these guys monitor these feeds because a lot of important information comes out in these forums.</p>', '10/15/2013', 1, 'Offensive'),
(8, 14, '<p>More commentary</p>', '10/15/2013', 3, 'Offensive'),
(9, 14, '<p>I am really talking alot today!</p>', '10/15/2013', 1, 'Offensive'),
(10, 3, '<p>Has anyone else really enjoyed Using the <strong>*Comment removed for swearing*</strong></p>', '10/17/2013', 3, 'Offensive'),
(11, 2, '<p>Thank you for the comment. If you need further information, please dont hesitate to contact us.</p>', '10/17/2013', 3, 'Y'),
(12, 2, '<p>How else&nbsp;could a forum be beneficial?</p>', '10/17/2013', 1, 'Offensive'),
(13, 3, '<p>I am a forum comment</p>', '10/18/2013', 1, 'Offensive'),
(14, 2, '<p>Add you comment testing for position.</p>', '11/26/2013', 1, 'Offensive'),
(15, 2, '<p>Add you comment - courses category</p>', '11/27/2013', 2, 'Offensive'),
(16, 3, '<p>New Comment</p>', '11/28/2013', 1, 'Offensive'),
(17, 2, '<p>Latest comment</p>', '11/29/2013', 1, 'Offensive'),
(18, 3, '<p>Add you comment</p>', '11/29/2013', 1, 'Offensive'),
(19, 3, '<p>Add you comment</p>', '11/29/2013', 1, 'Offensive'),
(20, 3, '<p>Add you comment</p>', '11/29/2013', 1, 'Offensive'),
(21, 3, '<p>The site is live</p>', '11/29/2013', 1, 'Offensive'),
(22, 65, '<p>This website is great</p>', '01/14/2014', 1, 'Y'),
(23, 71, '<p>Customer Service Training by People Solutions was great!!</p>', '01/15/2014', 4, 'Y'),
(24, 2, '<p>Ola</p>\r\n<p>&nbsp;</p>', '01/16/2014', 2, 'Offensive'),
(25, 3, '<p>Very nice</p>\r\n<p>&nbsp;</p>', '01/16/2014', 1, 'Offensive'),
(26, 109, '<p>Thank you!</p>', '02/26/2014', 1, 'Y'),
(27, 3, '<p>Your website looks bananas.</p>', '03/10/2014', 1, 'Y'),
(28, 188, '<p>its not easy to deal with customer service but the help i got from tsitsi and other bridging managers was fun, it made me realise how important customers are! in our lives</p>', '06/18/2015', 1, 'Y'),
(29, 198, '', '06/18/2015', 1, 'Y'),
(30, 187, '<p>I was totally clueless about customer service till I came to harambee., it has been a great and blissful experience. Thank You Harambee</p>', '06/18/2015', 1, 'Y'),
(31, 200, '<p>In my perspective a job that involved customer services was never an option for me since i new that i had &nbsp;issues regarding my behaviour and because of this it became highly impossible for me to work in an environment that that delt with assisting customers. The skills i have been afforded with have shaped into not just a sales person but a proffessional bussiness person. with regards to my behaviour i was helped by principles such as the ice bag theory, stages of development, causes of upset, turning an upset into a set up, getting out of my comfort zone and entering my learning zone.</p>', '06/22/2015', 1, 'Y'),
(32, 197, '<p>As much as i am consifused with your website</p> <p>for me its not clear and am intrested in Sales. Am so excited about Sales before i came to Harambee i didn''t now anything about sales,</p> <p>But with the help of Harambee i want to learn more and maybe start a career in Sales.</p> <p>Thanx to Kemal and Dan for the wonderful training.</p>', '06/23/2015', 1, 'Y'),
(33, 224, '<p>Harambee has been wonderful because i learnt more about customer service, i did not know anything so coming to harambee taught how to behave in front of a customer and to treat a customer in a good way even though the customer is angry you have to be patient with him/her in order for the job to be done successfully, so that the customer could be happy too.</p>', '06/23/2015', 1, 'Y'),
(34, 64, '<p>I really encourage peopel to use the BPESA Skills POrtal more. It gives you great access to courses and providers across the country. </p>', '02/05/2016', 1, 'Y');
