(46, 'rozina1', 'Rozina Adonis', 'netcare', 'provider', '', '', '<p class="MsoNormal">For the past nine years, People Solutions has successfully provided services ranging from quality education & training delivery, project management of learnerships and/or facilitation of short courses, to a diverse client base. It is this valuable experienced gained that enables People Solutions to achieve effective delivery to its valued clients, from the choice, planning, management and implementation of learning and development interventions.</p> <p class="MsoNormal">The partnership with our clients extends to funding applications from the SERVICES SETA or various other funding donors. In doing this, we allow our clients to focus on their core business.</p> <p>Â </p> <p class="MsoNormal">The People Solutions partnership focuses on cost effective and quality delivery options to the clients enabling a significant return on investment.</p>', '', '', '', 'Y', '06/24/2014 10:06:15'),
