(73, 'IQ_Business', 'David Coughlan', 'human performance', 'provider', 'kcame@iqgroup.net', '', '<p>Human Performance works with clients to enable their people to perform better by:</p> <p>Organising effectively Managing change Learning smarter</p> <p>We facilitate learning and development to positively impact the way in which employees perform their duties, and how they interact with colleagues and customers through:</p> <p>Knowledge building â€“ management development programme Application of skills â€“ performance support tools and coaching Enabling the environment â€“ immediate measurable improvement at an operational and functional level using simulation</p>', '', '', '', 'Y', '03/26/2014 09:03:12'),
