(76, 'AMGreer', 'Andrew Greer', 'France1981', 'users', 'andrew.greer@merchants.co.za', 'CCS - Contact Centre Solutions', '', 'Public/Private', '0745870275', 'www.merchants.co.za', 'Y', '12/10/2013 13:12:09'),
(77, 'Dieter', 'Dieter', 'dedat13', 'users', 'dieter.hoffman@westerncape.gov.za', 'Department of Economic Development', '', 'Please select', '0214839177', '', 'Y', '08/11/2014 22:08:49'),
(78, 'Ruhling.Herbst', 'Ruhling Herbst', 'RHer001', 'provider', 'ruhling@herbst-stark.com', '', '<p>Herbst Stark (Pty) Ltd was founded in 2009 with our main aim at identifying and dveloping unique software packages to address specific needs in the South African market. Our key differentiator is our absolute pasion to be first to market. &nbsp;This drive gave rise to our flagship product ACCLIMATE.</p>\r\n<p>Acclimate is a contact centre simulator that enables you to place new applicants, new hires or veterans in an environment where they can undergo repeated simulations of real life interactions that they would typically experience in their daily role.</p>\r\n<p>From the outset we strived towards producing a unique tool that will not only provide answers to the challenges faced in the South African market, but also break some of the limitations that these simulators exposed internationally.</p>\r\n<p>Using simulation methodologies to build and enhance practical skills has been proven in the global contact centre industry for may years. &nbsp;This practice has just not been widely adopted in South Africa. &nbsp;The purpose of the simulator is to simulate the operating environment as realistically as possible, thereby enabling agents to apply their skills in an integrated manner while under a time constraint, and with a real person on the other side of the phone. Repeated execution of relevant call scenarios builds confidence and proficiency, until the learners are ready to phase the real clients.</p>\r\n<p>We have successfully partnered with reputable training providers who have integrated the simulator into their accredited programmes. &nbsp;Through these relationships we have assisted thousands of learners to practically apply learned skills.</p>\r\n<p>We have exiting offers for both providers and operators who can benefit from the simulation offering through integrating it with their current learning programmes.</p>', '', '', '', 'Y', '04/19/2014 15:04:46'),
(79, 'nonijali', 'Nonhlanhla Jali', 'blossom1', 'users', 'nonij@awards.co.za', 'Achievement Awards Group', '<p>Plan, conceptualize, deisgn and deliver performance improvment programmes - loyalty, channel ncentive, workforce recogniton</p>', '3rd Party/Provider/Captive', '021-700-2300', 'http://awards.co.za', 'Y', '12/16/2013 11:12:44'),
(80, 'jennycargill', 'Jenny Cargill', 'stoepsie', 'users', 'jenny.cargill@westerncape.gov.za', 'Western Cape Government', '', 'Public/Private', '0214833380', 'westerncape.gov.za', 'Y', '01/07/2014 08:01:38'),
(81, 'cindi', 'nolusindiso', '89062206', 'users', 'sindso@gmail.com', 'tlscontact', '', 'domestic/international', '0797540959', '', 'Y', '01/08/2014 09:01:57'),
(82, 'Globalbusiness', 'Karen Beukes', 'global54321', 'provider', 'ctmarketing@globalbusiness.co.za', '', '<p>Global Business Solutions is a leading <strong>Labour Law and Human Resources Consultancy</strong> based in South Africa, offering a diverse range of services aimed at <strong>empowering businesses</strong> to achieve their objectives through <strong>strategic planning</strong>. Originally established in 1989 in the Eastern Cape, we now have a national footprint and offer a wealth of experience and expertise across the full spectrum of <strong>Business Services</strong>, which include the drafting of strategic business plans and business valuations.</p>', '', '', '', 'Y', ''),
(83, 'Lana', 'Lana', 'gerryjackson', 'users', 'LanaJ@tfg.co.za', '', '', 'Public/Private', '0219374116', '', 'Y', '01/13/2014 14:01:18'),
(85, 'lombard@sensoryintelligence.co.za', 'Annemarie Lombard', 'SensoryIQ7', 'provider', 'lombard@sensoryintelligence.co.za', 'Sensory Intelligence', '', '', '', '', 'Y', '05/27/2014 08:05:34'),
(86, 'patrickGordon', 'Patrick Gordon', 'p@tr1Ck', 'admin', 'patrick@bpesawesterncape.co.za', 'BPeSA Western Cape', '', 'Public/Private', '', '', 'Y', '01/16/2014 08:01:51'),
(87, 'noshe', 'Noha Essop', 'noha786', 'provider', 'noha@noshe.co.za', '', '', '', '', '', 'Y', '01/16/2014 10:01:54'),
(88, 'NazSalie', 'Naz Salie', 'password123', 'users', 'naz@bpesawesterncape.co.za', 'password123', '<p>xyz</p>', 'Public/Private', '0214272900', 'www.bpesawesterncape.co.za', 'Y', '01/21/2014 09:01:12'),
(92, 'BwiseTraining', 'Richard Cullinan', 'cassie123', 'provider', 'richard@bwisetraining.co.za', '', '<p><b>Bwise Training Solutions</b> is accredited by the Banking Sector Education and Training Authority in South Africa and has been providing bespoke learning solutions to leading companies and BPOs since 2007.</p> <p>We specialise in designing, customising and delivering our own accredited skills programmes which enhance and improve key contact centre competencies including customer service, collections, telesales and team leadership.</p> <p>Our accredited learning methodology ensures that agents and team leaders who attend one of our accredited skills programmes will retain and apply at least 70% of the contentÂ learnt in the classroom. This is achieved through a combination of workshop learning, coaching, exercises and toolkits, verbal and written assessments, and the compilation ofÂ portfolios of evidence.</p> <p>There are three things that make a Bwise Training Solutions intervention different; our unique accredited learning programmes, our exciting blend of learning experiences, and your return on investment!</p> <p>Â </p>', '', '', '', 'Y', '04/24/2014 12:04:12'),
