(100, 'Lynn Geland', 'Lynn Geland', 'merchants', 'users', 'lynn.geland@merchants.co.za', 'merchants', '<p>&nbsp;</p>\r\n<p><span class="Apple-style-span" style="font-family: arial, verdana, helvetica, sans-serif;">Merchants is a recognised global market leader in providing contact centre solutions that deliver positive results.&nbsp; As customer management and business process outsourcing specialists, we work with our clients to drive excellence in business processes and use our understanding of best practice standards to help offer insights and support organisational transformation.</span></p>\r\n<p style="margin: 0pt; padding: 0pt; border: 0pt currentColor; border-image: none; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: inherit; font-weight: normal; text-decoration: none; vertical-align: text-top; background-color: #ffffff;">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="margin: 0pt; padding: 0pt; border: 0pt currentColor; border-image: none; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: inherit; font-weight: normal; text-decoration: none; vertical-align: text-top; background-color: #ffffff;">Our tried and tested methodologies helps us to understand your business and operational requirements to deliver the correct sourcing option to suit your unique business requirements&nbsp; - from a range of options including outsourcing, co-sourcing, off-shoring and Business Process Outsourcing.</p>\r\n<p>&nbsp;</p>\r\n<p style="margin: 0pt; padding: 0pt; border: 0pt currentColor; border-image: none; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: inherit; font-weight: normal; text-decoration: none; vertical-align: text-top; background-color: #ffffff;">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="margin: 0pt; padding: 0pt; border: 0pt currentColor; border-image: none; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: inherit; font-weight: normal; text-decoration: none; vertical-align: text-top; background-color: #ffffff;">Merchants is a Dimension Data company and part of Dimension Data&rsquo;s Customer Interactive Solutions (CIS) line of business. CIS specialises in integrating customer channels into businesses and creating contact management architectures based on Time Division Multiplexing, Internet Protocol and Intelligent Network (IN) technologies. Our relationship with CIS provides us with access to leading technologies and architectures and gives us a unique insight into technical solutions that are available to contact centres</p>\r\n<p style="margin: 0pt; padding: 0pt; border: 0pt currentColor; border-image: none; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: inherit; font-weight: normal; text-decoration: none; vertical-align: text-top; background-color: #ffffff;">&nbsp;</p>\r\n<p>&nbsp;</p>', 'domestic/international', '0713126342', '', 'Y', '08/31/2015 14:08:43'),
