(104, 'Ursula Jordaan', 'Ursula Jordaan', 'Gudrun$19', 'users', 'jordaan.ursula@pixelfaerie.com', 'PixelFaerie Business Services', '<p><span style="font-family: Calibri;"><span style="font-size: medium;">One-stop-shop for wide range of staff-support in create, produce, and assist services &mdash; simplify operations by procuring a comprehensive service portfolio, across many languages (German, French, English and others) from one partner </span></span></p>\r\n<p><span style="font-family: Calibri;"><span style="font-size: medium;">Enjoy highest, onshore-equivalent service quality&mdash; benefit from fewer errors, quicker response times, native-speaker competence and better care </span></span></p>\r\n<p><span style="font-family: Calibri;"><span style="font-size: medium;">Availability 24/7 &mdash; enjoy flexibility and smooth communication without formalities </span></span></p>\r\n<p><span style="font-family: Calibri;"><span style="font-size: medium;">Save almost 70% on operating costs, even at low volumes &mdash; quickly take advantage of our low-cost service-model through our tried and tested ramp-up process </span></span></p>\r\n<p><span style="font-family: Calibri;"><span style="font-size: medium;">Reliable partner on your side &mdash; relax, knowing your data are secure, people who use the service are extremely satisfied, and our business model is successful and sustainable</span></span></p>', 'domestic/international', '0828493166', 'http://pixelfaerie.com/', 'Y', '06/04/2014 16:06:32'),
(106, 'Inter-active Technologies', 'Camy Moodley ', 'Inter@123', 'provider', 'camy@inter-active.co.za', '', '<p>Inter-Active Technologies (Pty) Ltd was founded in 1999 to deliver services in Call Centre Outsourcing, Management Consulting and Business Communication Technologies <br /><br />Our approach is to LISTEN, UNDERSTAND and DELIVER according to our customer requirement. Our employees are highly qualified to make sure that we provide accurate and effective customer service delivery - we help provide the tools to allow our customers to better service their customers. <br /><br />As a specialist Call Centre and Customer Service Delivery Channel, Inter-Active Technologies currently provides services to many Blue Chip organizations in South Africa and Africa. We have developed long term partnerships with our customers and do everything possible to ensure that these partnerships remain long, healthy and mutually beneficial &ndash; we adopt a win-win approach. <br /><br />We use state of the art technology platforms in our business which makes sure that we remain at the forefront of delivering what we say we can &ndash; we are confident in offering our technology to our customers, because we use the tools ourselves. <br /><br />Our people are our most valuable asset and as such we take great pride in developing our staff and maintaining one of the lowest attrition rates across all of our business units in the Call Centre industry. <br /><br />We have a Broad-Based Black Economic Empowerment Status of a Level 3 Contributor and have a procurement recognition level of 137.50%. <br /><br />Our core values are:<br />&middot; Honesty<br />&middot; Integrity<br />&middot; Entrepreneurship</p>', '', '', '', 'Y', '02/10/2014 09:02:43'),
