(120, 'malebok', 'Malebo Tsajwa', 'lebogal26', 'users', 'malebok@tshwane.gov.za', 'City of Tshwane', '<p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt; text-align: justify;">The City of Tshwane has identified the Business Process Outsourcing (BPO) sector as a critical sector for development due to the sector''s potential to generate large-scale employment opportunities, investment and economic growth. This is in view of the advantages regarding location that the City of Tshwane is endowed with, such as academic institutions, research and development facilities, a large talent pool (skilled and unskilled population), world class connectivity, infrastructure and the first science park in Africa. Against the backdrop of the prevailing socio-economic challenges that Tshwane faces, it makes economic sense to pursue and fast-track the development of this strategic sector of the economy.</p> <p>Â </p>', 'Public/Private', '012 358 1610', 'www.tshwane.gov.za', 'Y', '04/01/2014 07:04:43'),
(121, 'Ubuntu Wellness Boutique Conference Venue', 'Michael de Wet', 'shadow108', 'vendors', 'ian@medispa.co.za', 'Cape Town Medi-Spa', '<p><b>UBUNTU WELLNESS CENTRE â€¢ BOUTIQUE CONFERENCE VENUE â€¢</b></p> <p>Our beautiful wellness-focused boutique conference room offers a central facillity for seminars, lectures and workshops. This quality facility provides a well-equipped and competitively priced venue for confrences, seminars, meeting and training for short term hire by businesses and clients. We specialise in spa-based packages for the ultimate relaxing training setting.</p> <p>The drive for wellness within BPeSA beganin side</p> <p>"The Medi-Spa is a phenomenal experience. It is certainly one of a kind in the world. Not only can you palpably feel the loving and healing energy that''s present and experience fi rst hand the ingenious, highly qualifi ed, diversity of talent, but the soothing and inspiring environment is absolutely transformational. There is no way that you can be there without becoming rejuvenated, relaxed and re-inspired. It adds years to life and life to years."<b>â€“ Dr. John DeMartini, 2008</p> <p><strong>BENEFITS</b><b>* High quality facilities within an upmarket central Cape Town location<br />* Friendly and professional service<br />* Competitive rates<br /><br /><strong>ROOM SPECIFICATIONS / EQUIPMENT</b><b>* Size: 12 x 5m<br />* Up to 80 delegates<br />* Quality audio-visual equipment<br />* 4 x 2m screen<br />* Flip chart, clipboard & pen<br />* ADSL internet & network conferencing<br />* XGA data projector<br /><br /><strong>LAYOUT LECTURE BOARDROOM</b></p> <p>U SHAPE CIRCLE<b>JUST CHAIRS 90 50<br />WITH TABLES 25 30<br />Additional Services<br />* Superb wellness facilities for discerning clients<br />* Flexible catering and refreshments available â€“ in-house or at the restaurants adjacent to the<br />Mount Nelson or along Kloof Street. POA.<br /><br /><strong>ROOM HIRE RATES & SERVICES</b></p> <p><b>DURATION</b></p> HALF-DAY (4 HOURS)-R1500 FULL DAY (8 HOURS)-R2250 UP TO 2 HOURS- R500 per hour <p><i>OVERTIME STAFF:</i><b>AFTER 8PM & SUNDAYS R 300<br />Standard Equipment<br />The above price includes a fl ip chart and stand, pens and paper. If additional equipment is required, the hire<br />rates are as follows:<br /><br /><strong>CATERING & EQUIPMENT HIRE RATES COST/HOUR COST/ DAY</b><b>Tea and Biscuits per person â€“ R 15<br />Lunch per person â€“ R 100-150 (vegan options speciality)<br />XGA NEC Projector R100 R350<br />Laptop Computer R100 R350<br />Dedicated Marketing Mailshot 7500 Database R500 â€“<br />Video Conferencing R300 â€“<br />Xg-1 Canon Video Camera & Stand* â€“ R 750.00<br />Wellness Services â€“ massage, fl oats add-ons & packages (see list) POA POA<br />Video â€“ Photography, Editing & CD/ DVD Burning POA POA<br />Media Campaign â€“ Design, rollout & networking POA POA<br /><br /><strong>TESTIMONIALS</b><br /><br />"Most relaxed and professional conferencing environment we ever found,â€¦ having done workshops all over the worldâ€¦."<br />â€“ Drs Michael & Lynda Thompson, 1st EEG Neurofeedback Trainers in SA, Jan 2004<br /><br />"Medi-Spa was used by our senior executives who represent 43 countries from America, Asia and Europe, whilst they were attending a recent business conference at The Mount Nelson Hotel in Cape Town. I received very positive feedback from all of our participants who attended the spa. The staff and therapists worked very hard to cater for our requirements â€“ this meant carrying out a variety of different treatments for almost 100 senior executives and their partners during the course of our conference week."<br />â€“ Zach Miles, CEO, Vedior, October 2005.</p>', '3rd Party/Provider/Captive', '0829292544', 'www.ubuntu-wellness.co.za', 'Y', '04/09/2014 17:04:08'),
