(123, 'benny.kinnear', 'Ben', 'ben1983', 'provider', 'benny.kinnear@gmail.com', '', '<p>Our unique fun pact and to the point Serve To Lead customer first workshops enable agents to have a real understanding of the voice of their customers and customer expectations. Our goal is to train and develope indivuduals within the customer service function of an organization to deliver conscientious customer service. Our skilled and experienced freelance trainers are passionate and more than ready to take you on our Serve to Lead journey where you will Discover the Difference through putting the customer first.</p> <p>Our workshop caters for 8-15 agents and the duration is 6 hours.</p>', '', '', '', 'Y', '04/23/2014 11:04:31'),
(124, 'Elaine.Herbst', 'Elaine Herbst', 'EHer001', 'users', 'elaine@acclimate.co.za', 'Herbst Stark (Pty( Ltd)', '<p>Herbst Stark is a software development company, with our flagship product ACCLIMATE, focusng on Functional skills development in contact centres. Simulation-based training have been proven in the international market, and with the introduction of our simulator, offers this uniquw learning experience to the South African Market.</p>', 'Please select', '082 336 7245', 'www.acclimate.co.za', 'Y', '04/19/2014 15:04:04'),
(128, 'andy@accentlabs.co.za', 'Andy Quinan', '58lincoln', 'provider', 'Andy@accentlabs.co.za', '', '<p>Accent Labs has developed a unique English accent modification e-learning course which is designed to improve the English accent of people who have English as a second language. The 18 to 36 hour course can be accessed directly via the web and four to six week licenses are offered. The course has been developed by a team led by Michelle Clifford, a speech and language pathologist and contact centre and leadership training provider. The course has been tested by the Harambee Job Accelerator, who have put 2,300 contact centre agent trainees through the course successfully.</p> <p>Accent Labs also offers the PERLS Programmed English Reading & Langauge E-learning System from Bellamy & Hough. PERLS is an intervention designed to encourage a love of reading, build vocabulary, and increase comprehension and reading speed.</p> <p>Â </p>', '', '', '', 'Y', '04/15/2015 11:04:49'),
(129, 'andy@databasesolutions.co.za', 'Andy Quinan', '57tbird', 'users', 'andy@databasesolutions.co.za', 'Database Solutions', '<p>Database Solutions supplies prospect leads to contact centres for outbound telemarketing, SMS and email campaigns</p>', '3rd Party/Provider/Captive', '0834606328', 'www.databasesolutions.co.za', 'Y', '04/30/2014 11:04:16'),
(134, 'Chantal de Kock', 'Chantal de Kock ', 'gap123', 'users', 'cdekock@fetola.co.za', 'Fetola - Graduate Asset Programme', '<p><b>The Graduate Asset Programme (GAP) is a fresh and innovative internship programme aimed at growing the SME sector in South Africa</b>. By helping place thousands of capable and willing unemployed graduates into internships, GAP assists businesses to gain much-needed skills and the graduates to gain valuable, practical learning experience.</p> <p>Â </p> <p>Â </p>', 'Public/Private', '0217017466', 'www.gogap.co.za', 'Y', '11/18/2014 15:11:24'),
(140, 'Oasis', 'Oasis Group Holdings', 'Password@123', 'users', 'pa.nazeem@oasiscrescent.com', 'Oasis Group Holdings (Pty) Ltd', '<p>The Oasis Group is an independent organisation that is driven by its internal stakeholders, dedicated management and multi-skilled staff.</p> <p>The company endeavours to provide unrivalled financial products and services to satisfy the needs of its clients. The unequivocal objective of the Oasis investment team is to protect clients'' assets through the application of a low volatility fund management philosophy that seeks to preserve the capital of its investors during downward market movementsÂ whilst weÂ simultaneously strive to grow the real wealth ofÂ investors during favourable market movements.</p> <p>The application of this philosophy is epitomised in the focused management of financial assets through the utilisation of proven stock selection skills that leverage off a meticulous research processÂ to provide <b>superior returns at lower than market risk.</b></p>', 'Domestic/International', '0214137860', 'www.oasiscrescent.com', 'Y', '05/26/2014 13:05:07'),
(141, 'Karen Venter', 'Karen Venter', 'Mango47@', 'provider', 'karen@innovatebiz.co.za', '', '<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 11.25pt; margin-left: 0cm; mso-outline-level: 4;">Innovate Biz is an accredited training company (Service Seta accreditation number 6457) located in Cape Town with the emphasis on training entrepreneurs and soft skills training. This is done by giving participants a clear understanding of the personal behaviour and characteristics required together with the methods of implementation which are fundamental to success, whether in creating and sustaining new ventures or in a service industry environment.</p> <p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 11.25pt; margin-left: 0cm; mso-outline-level: 4;">Our approach is focused on the participant as an individual, their personal growth and leadership/communication skills thereby inspiring them to maintain the enthusiasm to commit to their businesses/jobs with a vision of the best possible outcome.</p> <p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 11.25pt; margin-left: 0cm; mso-outline-level: 4;">Innovate Biz provides training to the community, individuals and corporate sectors, with special focus on training the unemployed. Training courses and workshops offered in the following areas:</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Entrepreneurial Training (Service Seta accredited)</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Call Centre Customer Service Excellence</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Customer Service Excellence</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Self confidence</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Business Skills</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Write your own Business Plan</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Goal Setting and Planning</p> <p class="MsoNormal" style="margin-left: 54.0pt; text-indent: -36.0pt; mso-list: l0 level1 lfo1; tab-stops: list 54.0pt;">- Stress Management in the Workplace</p> <p class="MsoNormal">Â </p> <p>Â </p> <p class="MsoNormal">Innovate Bizoffers an integrated approach to training considering three pillars of success: <b><i>people, skills and business</i></b>. We demonstrate our capabilities using our training manuals and training experience to offer our clients these valuable skills training programs through corporate sponsorship, learnerships and individual participation.</p>', '', '', '', 'Y', '05/27/2014 15:05:33'),
