(146, 'CTU Training Solutions', 'Jadine van der Colff', 'C@reerC@mpus!123', 'provider', 'enquiry@ctutraining.co.za', '', '<p>Developing ICT Professionals since 1987! CTU specialises in skills development training across various fields in the ICT industry. CTU is one of the largest certifiers of international vendor specific certifications in MEA, producing over 10 000 certifications annually through our 17 training centres nationwide, we make an outstanding contribution to towards skills and employability growth within South Africa. <br /> <br /> CTU Training Solutions offers solutions in Human Resource Development and skills training by implementing the HRD in IT at CTU concept which involves CTU Career Students, Recruits, Learnerships, Internships, Consulting Services, Career Changers and Up-skilling. <br /> <br /> Together these solution areas provide the training, skills and development of people to solve challenges arising from the South African IT training and development trends â€“ lack of skills, demand for certified professionals, technology changes and job creation. <br /> <br /> The inter connectedness of these solution areas enables CTU to offer a holistic approach to providing a wide range of products and services short to long term to help your business reach its bottom line and improve human capital.</p>', '', '', '', 'Y', '07/09/2014 13:07:41');
