(147, 'Nomasonto', 'Nomasonto Ngcungama', '@Nomasonto1', 'provider', 'nomasonto@dibanisalearning.co.za', '', '<p class="MsoNormal">Â </p> <p class="MsoNormal">Â </p> <p class="MsoNormal">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center;" align="center"><b>Dibanisa Learning Solutions</b> is an accredited Training Provider with Services Seta and FASSET.</p> <p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center;" align="center">Accreditation numbers 4119 and A585000027 respectively</p> <p class="MsoNormal" style="margin-bottom: 12.0pt; tab-stops: 36.0pt 72.0pt 108.0pt 144.0pt 180.0pt 216.0pt center 324.0pt;">Â </p> <p class="MsoNormal" style="margin-bottom: 12.0pt; tab-stops: 36.0pt 72.0pt 108.0pt 144.0pt 180.0pt 216.0pt center 324.0pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center;" align="center"><b>COMPANY PROFILE</b><b> â€“ 2014 </b></p> <p class="MsoNormal" style="margin-bottom: 12.0pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;"><i>''One of the indicators on the new element Enterprise and Skills Development is for a company to spend 40% of its procurement from empowering suppliers that are at least 51% black owned. We know that there is a distinct lack of black industrialists and this target is going to be very difficult to achieve. Clever businesses will start the process now of identifying black businesses who can supply substantial values of goods and services. Since the new codes give a one year transitional period, there is not too much time. Ownership, Skills Development and Supplier and Enterprise Development will be priority elements with subminimum requirements '' - </i>December 2013</p> <p class="MsoNormal" style="margin-bottom: .0001pt; text-align: right;" align="right">*<b>New BB-BEE legislation effective April 2015</b></p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p>Â </p> <p class="MsoNormal">Â </p> <p class="MsoTitle" style="margin-left: 21.3pt; mso-add-space: auto; text-indent: -21.3pt; mso-list: l1 level1 lfo16;"><b>1. <strong>INTRODUCTION AND BACKGROUND</b></strong></p> <p class="MsoNormal" style="margin-bottom: 18.0pt;">Dibanisa Learning Solutions, a 100% black-woman owned learning solutions company, was incorporated in November 2009 and started operating in March 2010.</p> <p class="MsoNormal" style="margin-bottom: 18.0pt;">Dibanisa Learning Solutions is a work-based training provider with its head office in Durban, KwaZulu-Natal, and a national footprint. Our aim is to provide high quality training and development opportunities to individuals and companies across South Africa. We offer a wide range of accredited qualifications in addition to tailored and public training courses.</p> <p class="MsoNormal">It is our desire to provide you and your company with the highest quality of training and development possible. All of our training programs are designed to build a solid foundation of knowledge and understanding, cause highly targeted skill development and stimulate a strong sense of self-motivation. We pride ourselves in training that transfers back to the work place.</p> <p class="MsoNormal" style="margin-bottom: 6.0pt;">Â </p> <p class="MsoNormal" style="margin-bottom: 6.0pt;"><b>VISION </b></p> <p class="MsoNormal">Dibanisa Learning Solutions has established a vision with clear goals in order to achieve sustainable growth</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>Planet: </b>Be a responsible citizen that makes a difference by helping build and support sustainable communities through education and learning.</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>Portfolio:</b> Bring to South Africa a portfolio of quality learning solutions that anticipate and satisfy our client''s needs and outcomes for their staff development.</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>Partners:</b> Nurture a winning network of clients; together we create mutual, enduring value.</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>People:</b> Be a great place to work, where our staff, facilitators and trainers are inspired to be the best they can be at all times.</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>Productivity: </b>Be a highly effective, efficient and fast-moving training company amongst our peers.</p> <p class="MsoNormal" style="margin-left: 15.3pt; text-indent: -18pt;">Â· <b>Profit: </b>Maximize long-term returns to the benefit of our clients and learners while being mindful of our overall responsibilities.</p> <p class="MsoNormal">Â </p> <p class="MsoNormal"><b>MISSION STATEMENT</b></p> <p class="MsoNormal">Dibanisa Learning Solutions is committed to maintaining excellence, respect and integrity in all aspects of our business, whether it''s training, facilitation, assessments or moderation. We strive to reflect the highest ethical standards in our relationships with our clients and learners.</p> <p class="MsoNormal">Our mission is to provide high quality learning solutions and to create a return on investment for all in the process.</p> <p class="MsoNormal"><b>VALUES</b></p> <p class="MsoNormal">Dibanisa Learning Solutions is committed to:</p> <p class="MsoListParagraphCxSpFirst" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Development of competent and highly skilled learners</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Empowering individuals through interaction</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Encouraging co-operation and teamwork</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Capacitating through consultation</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Striving for vision-building and sharing through measurable goals</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Working towards long term and sustainable commitments</p> <p class="MsoListParagraphCxSpLast" style="margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; text-indent: -18.0pt; line-height: 150%; mso-list: l0 level1 lfo6;">Â· Working in partnership with clients</p> <p class="MsoNormal"><b>OBJECTIVES</b></p> <p class="MsoListParagraphCxSpFirst" style="margin-bottom: 0.0001pt; text-indent: -18pt;">Â· Participating in development forums in all Skills Development platforms in order to remain current in these areas</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 0.0001pt; text-indent: -18pt;">Â· Empowering our clients by offering training which contributes to the personal growth and performance of each learner</p> <p class="MsoListParagraphCxSpLast" style="margin-bottom: 0.0001pt; text-indent: -18pt;">Â· Maximising Human Potential by:-<b> Â· Following best business practices<br /> Â· Being client and learner focused<br /> Â· Practising operational excellence<br /> Â· Continuous Improvement </b></p> <p class="MsoNormal"><b>Â </b></p> <p class="MsoNormal"><b>OUR STRENGTHS </b></p> <p class="MsoNormal" style="margin-bottom: 6.0pt; tab-stops: 189.2pt;">As an organisation, Dibanisa Learning Solutions has the following strengths and attributes:</p> <p class="MsoListParagraphCxSpFirst" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Experienced training, facilitation and operations team</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Focused on providing clients with value-added training solutions</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Strong resource pool of facilitators, trainers and project managers who are subject matter experts</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Committed to Broad-Based Black Economic Empowerment and Women Empowerment</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Focused on increasing shareholder wealth, which include some of our staff</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Focused on both high-end and entry level training services and solutions.</p> <p class="MsoListParagraphCxSpLast" style="margin-bottom: 6.0pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l17 level1 lfo2; tab-stops: 189.2pt;">Â· Ability to network</p> <p class="MsoNormal"><b>OUR APPROACH </b></p> <p class="MsoNormal">At Dibanisa, we are dedicated to providing high quality training that meets the learners'' and employers'' needs, enabling them to grow both personally and professionally. Our training is centred on individualised learning programmes, flexibly delivery and work-based learning. We work with you to develop a training programme to enable you to develop the knowledge and confidence to achieve your full potential.</p> <p class="MsoNormal">We aim to be the training provider of choice, enabling businesses and individuals to realise their development and training goals and aspirations.</p> <p class="MsoNormal"><b>OUR PHILOSOPHY</b></p> <p class="MsoListParagraphCxSpFirst" style="margin-left: 38.25pt; text-indent: -18pt;">Â· Always acting in an ethical, honourable manner</p> <p class="MsoListParagraphCxSpMiddle" style="margin-left: 38.25pt; text-indent: -18pt;">Â· Showing commitment in everything we do by always keeping our promises</p> <p class="MsoListParagraphCxSpMiddle" style="margin-left: 38.25pt; text-indent: -18pt;">Â· Maintaining industry quality standards as encompassed by accreditation standards</p> <p class="MsoListParagraphCxSpLast" style="margin-left: 38.25pt; text-indent: -18pt;">Â· Building partnerships with market players to the benefit of our Clients</p> <p class="MsoNormal" style="margin-bottom: 6.0pt; tab-stops: 189.2pt;">We are committed to a high standard of service delivery as well as development and skills transfer. One of our most important roles is participating in activities that promote transformation of our country and empowerment of its people with particular focus on training. We aim to increase our capacity to create training and skills transfer and empowerment opportunities for the previously disadvantaged individuals</p> <p class="MsoTitle" style="margin-left: 21.3pt; mso-add-space: auto; text-indent: -21.3pt; mso-list: l1 level1 lfo16;"><b>2. </b><b>SERVICE OFFERINGS</b></p> <p class="MsoNormal">We provide learning solutions across industry sectors such as the retail, telecommunications, financial services, insurance, hospitality and public sector industries. We also have a specialized contact centre training solution.</p> <p class="MsoNormal" style="margin-bottom: 18.0pt; text-align: justify; text-justify: inter-ideograph;">As a training provider, Dibanisa Learning Solutions offers a variety of workshops, skills programs, learnership programmes and full qualifications. We are fully accredited for the full qualifications below:</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><b>Services SETA:</b></p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· NC: Generic Management (Management Development Programme )NQF 5</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Generic Management NQF 4 (awaiting Services Seta final accreditation report)</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Project Management NQF 4 (awaiting Services Seta final accreditation report)</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Business Administration Services NQF 4</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Labour Recruitment Services NQF 4</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Contact Centre Operations NQF 4</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: New Venture Creation (Entrepreneurship) NQF 4</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· NC: Contact Centre and Business Process Outsourcing Support NQF 3</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· NC: New Venture Creation (Entrepreneurship) (SMME) NQF 2</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· GETC: Business Practice NQF 1</p> <p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0cm; margin-bottom: 6.0pt; margin-left: 0cm; text-align: justify; text-justify: inter-ideograph;"><b>Â </b></p> <p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0cm; margin-bottom: 12.0pt; margin-left: 0cm; text-align: justify; text-justify: inter-ideograph;"><b>FASSET<i>:</i></b></p> <p class="MsoListParagraph" style="margin-bottom: 18.0pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· FETC: Debt Recovery NQF 4</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; tab-stops: 189.0pt;"><b>Wholesale and Retail SETA </b>(accreditation in progress)</p> <p class="MsoListParagraph" style="margin-bottom: .0001pt; text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· NC: Wholesale and Retail Distribution NQF 2</p> <p class="MsoListParagraph" style="text-indent: -18.0pt; mso-list: l18 level1 lfo15;">Â· NC: Wholesale and Retail Operations NQF 3</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; tab-stops: 189.0pt;"><b>OUR APPROACH TO LEARNING</b></p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; tab-stops: 189.0pt;">Our approach is based on:</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 1cm; text-align: justify; text-indent: -1cm;">Â· Developing a thorough understanding of each learner''s potential, their strengths and gaps, in relation to required competencies.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 1cm; text-align: justify; text-indent: -1cm;">Â· Developing an individual learning path for a learner through identifying their developmental areas.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 1cm; text-align: justify; text-indent: -1cm;">Â· Coaching and providing assistance to close the developmental areas and fully develop their required competencies.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 1cm; text-align: justify; text-indent: -1cm;">Â· Delivering a learning solution that complies with all SETA regulations.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 1cm; text-align: justify; text-indent: -1cm;">Â· Delivering a learning solution that is innovative and based on the premise that the elements of the training framework are:</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 49.65pt; text-align: justify; text-indent: -21.3pt;">- Behaviour;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 49.65pt; text-align: justify; text-indent: -21.3pt;">- Tools;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 49.65pt; text-align: justify; text-indent: -21.3pt;">- Processes.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 49.65pt; text-align: justify;">Â </p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt; text-align: justify;"><b>OUR LEARNING METHODOLOGY</b></p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 49.65pt; text-align: justify;">Â </p> <p style="margin: 0cm; margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph;">The experienced facilitators of Dibanisa Learning Solutions deliver structured learning interventions in a highly interactive manner, based on experiential learning methods.</p> <p style="margin: 0cm; margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph;">Â </p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">The facilitators use specifically designed activities, role-plays, brainstorming and interactive group exercises as their tools to allow the learner to reflect, discuss, analyze and evaluate their experiences and as a result, they are able to make the desired behavioural changes relevant to their work.</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">Training and development is an on-going event and it is important to state that coaching is the focus of our methodology thus giving rise to an on-going learning and development culture.</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; tab-stops: 60.0pt;"><b>Â </b></p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; tab-stops: 60.0pt;"><b>OUR LEARNING PHILOSOPHY</b></p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">Includes the following factors to ensure optimal learning:</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>People need a positive learning environment</i>. We learn best in a positive, physical, emotional and social environment. One that is both relaxed and stimulating.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Total learning involvement</i>. People learn best when they are totally and actively involved and take full responsibility for their own learning.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Collaboration among learners</i>. People general learn best in an environment of collaboration.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Variety that appeals to all learning styles</i>. People learn best when they have a rich variety of learning options that allows them to use all their senses and exercise their preferred learning style.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Contextual learning</i>. People learn best in context.</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">Â </p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">The principles we use in order to accelerate learning are the following:</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Learning involves the whole mind and body</i>. Learning is not all merely "head" learning but involves the whole body/mind with all its emotions, senses and receptors.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Collaboration aids learning.</i> All good learning has a social base. People learn more from interaction with peers than by any other means. Learning is not a matter of absorbing one little thing at a time in linear fashion, but absorbing many things at once.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Learning comes from doing the work itself, with feedback.</i> People learn best in context. Things learned in isolation are hard to remember and quick to evaporate.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· <i>Positive emotions greatly improve learning. </i>Feelings determine both the quality and quantity of learning.</p> <p class="MsoNormal"><b>Â </b></p> <p class="MsoNormal"><b>OUR ASSESSMENT METHODOLOGY</b></p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Facilitators constantly assess learners during training sessions and feedback is given to the client. Elements such as personal interaction, team integration, enthusiasm, ability to assimilate information, problem solving, communication etc. are assessed. All facilitators will be developed into accredited assessors.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Skills programmes include assignments and a personal development plan.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· A formative assessment of each skills programme will be conducted by an assessor.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Continuous feedback and remediation throughout the process ensure the motivation of the learners</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Assessment of learners whilst on the job, are carried out by constituent assessors.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Feedback and coaching sessions are carried out.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Constant internal moderation is conducted.</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt; text-align: justify;">Â </p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt; text-align: justify;">Â </p> <p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 54pt; text-align: justify; text-indent: -36pt;"><i>2.1 </i><i>CONSULTATION</i></p> <p class="MsoListParagraph" style="margin: 0cm 0cm 0.0001pt; text-align: justify;">Â </p> <p class="MsoNormal" style="margin-top: 6.0pt; text-align: justify; text-justify: inter-ideograph; tab-stops: 21.3pt;">Dibanisa Learning Solutions believe in partnering with our clients to ensure optimal learning takes place. As part of this philosophy, we consult with our client to establish:</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Customer expectations;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Vision for the learning programme;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Values the client wish to entrench during the learning programme;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Specific behaviour that should be targeted during the learning programme;</p> <p class="MsoNormal" style="margin: 6pt 0cm 0.0001pt 21.25pt; text-align: justify; text-indent: -21.25pt;">Â· Scheduling observation and feedback sessions to ensure the least operational disruption.</p> <p class="MsoNormal" style="margin-top: 6.0pt; text-align: justify; text-justify: inter-ideograph; tab-stops: 21.3pt;">Â </p> <p class="MsoNormal" style="margin-top: 6.0pt; text-align: justify; text-justify: inter-ideograph; tab-stops: 21.3pt;">Regular progress reports are submitted to the client and meetings are scheduled to ensure that any concerns are identified and addressed immediately.</p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><b>Â </b></p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><b>Â </b></p> <p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><b>Â </b></p> <p class="MsoTitle" style="margin-left: 14.2pt; mso-add-space: auto; text-indent: -14.2pt; mso-list: l4 level1 lfo18;"><b>2. </b><b>VALUE PROPOSITION </b></p> <p class="MsoNormal">Â </p> <p class="MsoNormal">Our Trainers and Facilitators will abide by the following guidelines:</p> <p class="MsoListParagraphCxSpFirst" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">1. Prepare and present training sessions</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">2. Research, develop and compile Skills Development Programmes to cater for Learner and Client needs, such as Workshops, Short Courses and Simulation</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">3. Participate in Learnerships when such opportunities present themselves</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">4. Perform formative assessments during training sessions, which may well extend to practical workplace-related applications, as well as integrated workplace assessments when required</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">5. Manage and confirm all arrangements relating to training presentations</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">6. Complete all the necessary documents before, during and at conclusion of the session. Follow guidelines as per our policies applicable to Quality Assurance and Training</p> <p class="MsoListParagraphCxSpLast" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l5 level1 lfo5;">7. Apply outcomes-based learning principles, complying with all criteria of the relevant NQF Unit Standards</p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoTitle" style="margin-left: 14.2pt; mso-add-space: auto; text-indent: -14.2pt; mso-list: l4 level1 lfo18;"><b>3. </b><b>COMPANY DIRECTOR</b></p> <p class="MsoNormal" style="margin-bottom: .0001pt;"><b>Â </b></p> <p class="MsoNormal" style="margin-bottom: .0001pt;"><b>Nomasonto Ngcungama</b></p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Nomasonto Ngcungama worked for MTN-SA, a leading African mobile telecommunications company, for 7 years before journeying into her own business.</p> <p>She holds a Bachelor of Commerce (BComm) degree with two majors â€“ Economics and Business Management from the University of University of Durban-Westville (now University of KwaZulu-Natal) She has a post graduate "Finance for Non-Financial Managers" certificate from the Gordon''s Institute of Business Studies (GIBS) â€“ University of Pretoria. She holds various certificates from the skills development industry''s institutions and learning providers. She is currently studying towards a Chartered Financial Analyst (CFA) qualification as of July 2014</p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoTitle" style="margin-left: 14.2pt; mso-add-space: auto; text-indent: -14.2pt; mso-list: l4 level1 lfo18;"><b>4. </b><b>WHY SHOULD YOU DO BUSINESS WITH DIBANISA LEARNING SOLUTIONS? </b></p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p class="MsoListParagraphCxSpFirst" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l6 level1 lfo3;">Â· Dibanisa Learning Solutions is led by a capable team rather than an individual</p> <p class="MsoListParagraphCxSpMiddle" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l6 level1 lfo3;">Â· The team has over 40 years combined operational experience gained over many years in different industries</p> <p class="MsoListParagraphCxSpLast" style="margin-bottom: .0001pt; mso-add-space: auto; text-indent: -18.0pt; mso-list: l6 level1 lfo3;">Â· The team has an appreciation for operational challenges faced through various training interventions it encounters from project to project</p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p> <p>Â </p> <p class="MsoNormal" style="margin-bottom: .0001pt;">Â </p>', '', '', '', 'Y', '07/10/2014 15:07:28'),
