(149, 'FaroukH', 'Farouk Hendricks', 'bph0riz0n', 'users', 'farouk@syntell.co.za', 'Syntell (Pty) Ltd', '<p>Syntell is a leader in end-to-end traffic law enforcement services and systems.</p> <p class="paragraph" style="text-transform: none; background-color: #ffffff; text-indent: 0px; font: 12px Tahoma, Geneva, sans-serif; white-space: normal; letter-spacing: 1px; color: #666666; word-spacing: 0px; -webkit-text-stroke-width: 0px;"><b>Our services include:</b></p> <p class="paragraph" style="text-transform: none; background-color: #ffffff; text-indent: 0px; font: 12px Tahoma, Geneva, sans-serif; white-space: normal; letter-spacing: 1px; color: #666666; word-spacing: 0px; -webkit-text-stroke-width: 0px;">â€¢ Smart Roadblocks that use automatic number plate recognition;<br />â€¢ comprehensive mobile speed camera management system;<br />â€¢ complete fixed camera management system, adapted to local conditions;<br />â€¢ provision of support vehicles;<br />â€¢ integrated contravention system consisting of production, back and front office components;<br />â€¢ remote issuing of summons and warrants;<br />â€¢ integrated back and front office fine follow up service;<br />â€¢ automated on-line interaction and payment services through www.paycity.co.za</p> <p class="paragraph" style="text-transform: none; background-color: #ffffff; text-indent: 0px; font: 12px Tahoma, Geneva, sans-serif; white-space: normal; letter-spacing: 1px; color: #666666; word-spacing: 0px; -webkit-text-stroke-width: 0px;">With over 25 years of experience in the development of road traffic management systems, it is our mission to help SA''s cities flow better.<br style="text-transform: none; background-color: #ffffff; text-indent: 0px; font: 12px Tahoma, Geneva, sans-serif; white-space: normal; letter-spacing: 1px; color: #666666; word-spacing: 0px; -webkit-text-stroke-width: 0px;" /><br style="text-transform: none; background-color: #ffffff; text-indent: 0px; font: 12px Tahoma, Geneva, sans-serif; white-space: normal; letter-spacing: 1px; color: #666666; word-spacing: 0px; -webkit-text-stroke-width: 0px;" />Syntell is the leading developer of state-of-the-art road traffic management systems and has partnered with Metros and local authorities across South Africa to unlock innovative, yet practical solutions that achieve tangible results.Â </p>', 'Public/Private', '0217102716', 'www.syntell.co.za', 'Y', '07/31/2014 15:07:56'),
