(155, 'Wade Shaw', 'Wade', 'wadeshaw', 'provider', 'wade@siyandza.co.za', '', '<p></p> <p></p> <p></p> <p></p> <p>Established in 2006 to challenge existing attitudes and approach for corporate training solutions in the South African market, Siyandza has provided training and other professional services within corporate and government sectors covering a multitude of industries and thousands of learners.</p> <p><b>SIYANDZA</b> is part of the SIMEKA group and has been in existence since 2006.</p> Essentially we offer a full suite of training solutions to meet our customer''s needs, ranging from basic to advanced classroom training to mobile and e-learning solutions. We have developed a South African turn-key training and development solution- our <b>Enterprise Learning Platform: ELP-</b> (c), which takes training and skills development for economic growth to the next level This platform serves as a TOOL to change great learners and employees into excellent ones (Incporating the fundamentals of effective 21st century learning: Learning Managment, Simulation, Effective E-learning,mobile learning, communication and performance) It is ahead of the other offerings in the market place and massively improves Return on Training investment and always results in improved internal and external customer ratings. <p>Believing that every clients environment and needs are unique, <b>Siyandza employs a three phase</b> methodology â”€ <b>discovery, development</b> and implementation â”€ to <b>deliver</b> each of our solutions, ensuring that the needs of both the organization and the learner are identified and successfully merged. <b>Leading</b> the market. </p> <p>Â </p>', '', '', '', 'Y', ''),
(157, 'wayne.smith@bytes.co.za', 'Wayne Smith', 'aol25800', 'provider', 'wayne.smith@bytes.co.za', '', '<p>Â </p> <p class="MsoNormal" style="margin: 0cm 0cm 10pt;">Bytes People Solutions is the internationally accredited education, training, skills development and people consulting arm of the Bytes Technology Group. Bytes People Solutions are recognised as a leader in the industry and has built a credible track record over the past 15 years by providing excellent service to a large number of blue chip companies in South Africa. Various business units, supported by a strong professional skills base, deliver services in all major regions. Our offering is firmly based in facilitating the development of people strategy and leadership skills through developing fit for purpose organisation structure and work design. Change navigation (management) and facilitation in the art of dealing with organisational dynamics is backed by the design and implementation of people management and development strategies.</p> <p>Â </p>', '', '', '', 'Y', '12/17/2014 14:12:41'),
(159, 'RichardStephenson', 'Richard Stephenson', 'lionheartdomino', 'users', 'richard.stephenson@consultant.com', 'Richard Stephenson', '', 'Public/Private', '0728493879', '', 'Y', '10/10/2014 00:10:35'),
(160, 'Ensemble', 'Ensemble Trading 113', 'liampharrell', 'users', 'william@sccentre.co.za', 'liampharrell', '<p></p> <p></p> <p class="MsoNormal" style="margin-bottom: 12.0pt; text-align: justify; background: white;">Ensemble Trading has been in business since the year 2000, and its directors have been actively involved in the Credit and Debt industry, working with Creditors, Debt Administrators and Debt Counsellors alike to help establish a credit industry which is healthy and responsible. </p> <p class="MsoNormal" style="margin-bottom: 12.0pt; text-align: justify; background: white;">Ensemble Trading''s main business endeavours include providing software to ease the massive administrative burdens on Debt Administrators and Debt Counsellors, and also a Call Centre that provides support including, but not limited to assisting financially distressed debtors by referring them to a best-suited solution to their situation. </p> <p class="MsoNormal" style="text-align: justify;">Our company''s values are reflected in the words of Albert Einstein: "Strive not to be a success, but rather to be of value." We always aim to put the best interests of the client above anything else and we strive to serve with integrity, urgency and always with a smile. The core values that govern our culture and conduct are professionalism, integrity, trust, ethics and discipline.</p>', 'Public/Private', '084 4010591', 'www.callensemble.co.za', 'Y', '03/25/2015 15:03:54'),
(161, 'DWallaces', 'Duncan Wallace', 'Adela1de', 'users', 'Duncan.Wallace@interglobal.com.au', 'InterGlobal Management Group (IMG)', '<p>As one of the leading providers of Digital Engagement tools in South Africa through our partnership with Live Person South Africa, IMG is able to give and support this burgeoning sector with valuable insight to those who are looking to upskill their knowledge in this regard.</p>', 'Domestic/International', '0727969186', 'www.interglobal.com.au', 'Y', '11/09/2014 05:11:30'),
