(165, 'awande12', 'Ms Ntokozo Rosemary Khoza', 'ntokozo3', 'provider', 'ntokozorose@icloud.com', '', '<p>NB Holidays is registered company, registered as a (Pty)Â Ltd. The Company is a Black-owned Enterprise, supported byÂ independent professionalsÂ in accounting and legal arenas. Core business is selling holiday packages and offer shuttle services, for convenience to clients who need to be picked up from airports; bus stations, thus offeringÂ comfort during their holida / breaks.</p> <p>The Sales & Marketing Team is led by a highly experienced and competent Executive Consultant. Having been visited by scores of unemployed youth and ordinary unemployed professionals who seek workplace integrated learning,Â we thus decided to offer same in laration to gaining the much needed experience that professionals need post tertiary/ matric. As training is highly regularized, we seek to offer workplace learning in a manner set out by training authorities and assurers, hence the registration, for compliance purposes in keeping ourselves "relevant" and ahead in the industry.</p> <p>Head Office is in Umhlanga - positioned to service holiday makers along the indian ocean, in this way be a catchment area for internships, learnerships, etc.</p>', '', '', '', 'Y', '02/17/2015 11:02:17'),
(166, 'complianceonline', 'Michelle Le Roux', '0834180080M', 'provider', 'nino@complianceonline.co.za', '', '<p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Compliance OnlineÂ® (Pty) Ltd.Â is a specialist provider of legal and regulatory compliance training solutions to private and public sector entities. With more than a decade of market-tested success, we are trusted by today''s most respected companies.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">The founding and sole director,Â Dr. Minette Smit, a former chief economist of the Competition Commission of South Africa, developed the first e-learning programme in 2002 when she identified a need in the market to train geographically dispersed employees on the principles of South African competition law. Since then, she has worked closely with prestige law firmsÂ Webber WentzelÂ andÂ Esselaar AttorneysÂ and other subject matter and industry experts to develop a number of other programmes.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Currently, Compliance Online offers a range of industry-specific programmes on theÂ Competition Act, theÂ Consumer Protection Act, theÂ Protection of Personal Information Act (POPI),Â anticorruption legislationÂ (money laundering and bribery) and customised company-specificÂ code of conduct and ethicsÂ training programmes.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">A number ofÂ our clientsÂ also use the Compliance Online e-learning platform for induction training of their employees on aspects relevant to their business, such asÂ employment lawÂ and internal policies.</p> <p style="box-sizing: border-box; color: #333333; font-family: ''Open Sans'', sans-serif; font-size: 12px; line-height: 20px; text-align: justify;">Compliance Online also assists with the design and development of products to raise compliance awareness in your business.</p>', '', '', '', 'Y', '02/11/2015 11:02:27'),
