(176, 'hayleyw', 'Hayley Williams', 'firefly', 'provider', 'wilconh431@gmail.com', '', '<p></p> <p>Â </p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 10pt;">ABOUT HAYLEY</p> <p style="background: #fff1a8; margin: 0cm 23.25pt 0pt 0cm; text-align: justify; line-height: normal; -ms-text-justify: inter-ideograph;"><b>Hi, I''m Hayley Williams and I specialize in Human and Organisational Development. I''m passionate about what I do, and I love to help people. Nothing is more fulfilling than having a greater purpose that fosters love and kindness.</b></p> <p style="background: #fff1a8; margin: 0cm 23.25pt 10pt 0cm; text-align: justify; line-height: normal; -ms-text-justify: inter-ideograph; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto;"><b>With more than 20 years'' experience and deep competence in Human Resources across various environments viz. manufacturing, corporate, automotive, government, civilÂ engineering, contact centres, I am able to lead through understanding the business environment.</b></p> <p style="margin: 0cm 0cm 10pt;"><b>As a Heartmath Coach, ''Project Young Heart'' is a project close to my heart focussing on heart intelligence and building our Nation one Young Heart at a time, coaching teens and young leaders dealing with stress, anxiety and pressure, with the aim of boosting performance and building resilience.</b></p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 14pt;">44 Franklin Road, Claremont<b> Contact : Hayley 0795071122</p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 14pt;">www.wilcon-hayley.branded.me</p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 14pt;">www.heartmathsa.co.za</p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 10pt;">Â </p> <p style="margin: 0cm 0cm 0pt;">About HeartMath</p> <p style="margin: 0cm 0cm 10pt;"><strong>Heartmath Coaching (Heart Intelligence) is based on 20 years of science and uses techniques and technology in helping people who struggle with stress, anxiety, fatigue and tension. We look at transforming stress using techniques to position the body into a coherent state, to boost performance and ultimately build resilience. This is supported by the use of a heart rate monitor - the emwave pro. The process is powerful and the techniques valuable throughout an individual''s life. Visit </b><b>www.heartmathsa.co.za</b><b> for more information.</b></p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p>', '', '', '', 'Y', ''),
