(247, 'chantal.oettle', 'Chantal Oettle', 'Capita2015', 'operators', 'chantal@fullcirclesa.com', 'Capita SA', '<p>We are the UK''s leading provider of business process management and integrated professional support service solutions, with 68,000 staff across the UK, Europe, South Africa and India.</p>\r\n<p>We have built an organisation characterised by innovation and commitment, in which our people are empowered and motivated to succeed and in which their success is recognised. <br /><br />We have a strong track record in transforming services, saving costs, and delivering value for our clients, for our investors and for our stakeholders.</p>', '', '0214020200', 'www.capita.co.uk', 'Y', '08/06/2015 09:08:45'),
