(3224, 'michaelpatrickhibbert@gamil.com', 'MICHAEL HIBBERT', '21011999', 'provider', 'michaelpatrickhibbert@gmail.com', '', '<p>PRIVATE INDIVIDUAL WITH 10</p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>PRIVATE INDIVIDUAL THAT IS KEEN ON PROVIDING RESEARCH AND PAPERS IN BPO DISCIPLINE. HAVE 10+ YEARS IN IT/TELECOMMUNICATIONS BUSINESS CASE COMPILTAION, FIANCIAL MANAGEMENT, PROCUREMENT MANAGE, ASSET CAPITALISATION AND PROCESS IMPROVEMENTS. ALSO SEEKING EMPLOYMENT IN THE BPO ENVIRONEMT. WILLING TO PROVIDE RESEARCH AND CASE STUDIES ON ALL BPO AFFILITED DISCIPLINES, IT, TELECOMS, HR, FINANCES, COST EFFICIENCY, NETWORK OPTIMISATION, COST REDUCTIONIN BPO ENVIRONMENTS AND IN ITS IMPLEMNTATION.</p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>Â </p> <p>=</p>', '', '', '', 'Y', '10/15/2015 03:10:15'),
(3225, 'Dermot Grazebrook', 'Dermot Grazebrook', 'Oks@sa123', 'operators', 'dermot.grazebrook@blueprint3.co.za', 'Blueprint 3.0', '<p>TBC</p>', '', '0766139645', 'www.blueprint3.co.za', 'Y', '11/12/2015 09:11:36'),
(3226, 'jasa.galsinh@learndirect.com', 'Dan Carter', 'vt9009SA', 'provider', 'dan.carter@learndirect.com', '', '<p><b>Learndirect (</b><b>www.learndirect.com</b><b>)</b></p> <p class="MsoNormal">Learndirect is a specialist learning provider offering a wide range of skills development and training leveraging technology. Having established an office in South Africa, the company has obtained accreditation status with the MICT Seta and with the IEB where it is a registered provider for the QCTO''s Foundational Learning Competency (FLC) skills programme.</p> <p class="MsoNormal">LearndirectÂ was launched in 2000 by Ufi in the United Kingdom. The UK government created Ufi two years earlier, in 1998, in response to the New Labour concept of a ''''University for Industry''''. Ufi was given a remit to use new technology to transform the delivery of learning and skills across England, Wales and Northern Ireland. ThroughÂ LearndirectÂ this vision has been realised. Even back then, we challenged the norm and took a bold step to deliver learning online. In doing so, we have built a unique and market leading position â€“ using technology to provide learning and assessment solutions.</p> <p class="MsoNormal">After privatisation in 2012 LearndirectÂ has become the UK''s leading online learning provider and largest training provider, reaching into local communities, the workplace and people''s homes with flexible, accessible and supported online learning. With a mission to transform the skills and productivity of the working population by using technology to bring people together to work, share and learn online, we have shown how we can transform people''s lives and help businesses thrive.</p> <p class="MsoNormal">Our work has needed to evolve to reflect the changing demands of our learner, the sector, as well as the political and economic landscape. Technology enables us to do this â€“ the explosion and power of the internet pushes us to find new ways to help people and businesses achieve their goals.</p> <p class="MsoNormal" style="line-height: normal;">Our focus is on ensuring learners have the motivation, knowledge and skills critical to support individual, corporate and government objectives.</p> <p class="MsoNormal" style="line-height: normal;">As a trusted delivery partner for the UK Government since 1999, we''ve helped 4.5 million people transform their lives with new skills. We''ve also helped more than 75,000 businesses equip their staff with the skills needed to succeed.</p>', '', '', '', 'Y', '03/10/2016 13:03:06'),
